INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(83864, 'ordinary', '<C><F><I><N><Q>@ordinary /''ɔ:dnri/<br />*  tính từ<br />- thường, thông thường, bình thường, tầm thường<br />=an ordinary day''s work+ công việc bình thường<br />=in an ordinary way+ theo cách thông thường<br />!ordinary seaman<br />- (quân sự) ((viết tắt) O.S) binh nhì hải quân<br />*  danh từ<br />- điều thông thường, điều bình thường<br />=out of the ordinary+ khác thường<br />- cơm bữa (ở quán ăn)<br />- (từ Mỹ,nghĩa Mỹ) quán ăn, quán rượu<br />- xe đạp cổ (bánh to bánh nhỏ)<br />- the Ordinary chủ giáo, giám mục<br />- sách lễ<br />- (từ Mỹ,nghĩa Mỹ) linh mục (ở) nhà tù<br />!to be in ordinary<br />- (hàng hải),  (quân sự) không hoạt động nữa (tàu chiến...)<br />!physician in ordinary<br />- bác sĩ thường nhiệm<br /><br />@ordinary<br />- thường, thông thường</Q></N></I></F></C>'),
(83865, 'Ordinary least square (OLS)', '<C><F><I><N><Q>@Ordinary least square (OLS)<br />- (Econ) Phương pháp bình phương nhỏ nhất thông thường.<br />+ Là phương pháp phổ biến nhất được sử dụng để ước lượng những thông số trong một phương trình hồi quy tuyến tính.</Q></N></I></F></C>'),
(83866, 'ordinary level', '<C><F><I><N><Q>@ordinary level<br />* danh từ<br />- kỳ thi cấp cơ sở lấy chứng chỉ giáo dục phổ thông (ở Anh trước đây)</Q></N></I></F></C>'),
(83867, 'ordinary seaman', '<C><F><I><N><Q>@ordinary seaman<br />* danh từ<br />- &lt;vt&gt;  OS<br />- binh nhì hải quân</Q></N></I></F></C>'),
(83868, 'Ordinary share', '<C><F><I><N><Q>@Ordinary share<br />- (Econ) Cổ phiếu thường.<br />+ Xem EQUITIES, FINANCIAL CAPITAL.</Q></N></I></F></C>'),
(83869, 'Ordinate', '<C><F><I><N><Q>@Ordinate<br />- (Econ) Tung độ.<br />+ Là giá trị trên trục tung của một điểm trên một đồ thị hai chiều.</Q></N></I></F></C>'),
(83870, 'ordinate', '<C><F><I><N><Q>@ordinate /''ɔ:dnit/<br />*  danh từ<br />- điều thông thường, điều bình thường<br />=out of the ordinate+ khác thường<br />- cơm bữa (ở quán ăn)<br />- (từ Mỹ,nghĩa Mỹ) quán ăn, quán rượu<br />- xe đạp cổ (bánh to bánh nhỏ)<br />- (the ordinate) chủ giáo, giám mục<br />- sách lễ<br />- (từ Mỹ,nghĩa Mỹ) linh mục (ở) nhà tù<br />!to be in ordinary<br />- (hàng hải),  (quân sự) không hoạt động nữa (tàu chiến...)<br />!physician in ordinary<br />- bác sĩ thường nhiệm<br />*  danh từ<br />- (toán học) tung độ, đường tung<br /><br />@ordinate<br />- tung độ<br />- end o. tung độ biên</Q></N></I></F></C>'),
(83871, 'ordinates', '<C><F><I><N><Q>@Ordinate<br />- (Econ) Tung độ.<br />+ Là giá trị trên trục tung của một điểm trên một đồ thị hai chiều.</Q></N></I></F></C><C><F><I><N><Q>@ordinate /''ɔ:dnit/<br />*  danh từ<br />- điều thông thường, điều bình thường<br />=out of the ordinate+ khác thường<br />- cơm bữa (ở quán ăn)<br />- (từ Mỹ,nghĩa Mỹ) quán ăn, quán rượu<br />- xe đạp cổ (bánh to bánh nhỏ)<br />- (the ordinate) chủ giáo, giám mục<br />- sách lễ<br />- (từ Mỹ,nghĩa Mỹ) linh mục (ở) nhà tù<br />!to be in ordinary<br />- (hàng hải),  (quân sự) không hoạt động nữa (tàu chiến...)<br />!physician in ordinary<br />- bác sĩ thường nhiệm<br />*  danh từ<br />- (toán học) tung độ, đường tung<br /><br />@ordinate<br />- tung độ<br />- end o. tung độ biên</Q></N></I></F></C>'),
(83872, 'ordination', '<C><F><I><N><Q>@ordination /,ɔ:di''neiʃn/<br />*  danh từ<br />- sự sắp xếp, sự xếp loại<br />- sự ban lệnh, sự định đoạt<br />- (tôn giáo) lễ thụ chức, lễ tôn phong</Q></N></I></F></C>'),
(83873, 'ordinations', '<C><F><I><N><Q>@ordination /,ɔ:di''neiʃn/<br />*  danh từ<br />- sự sắp xếp, sự xếp loại<br />- sự ban lệnh, sự định đoạt<br />- (tôn giáo) lễ thụ chức, lễ tôn phong</Q></N></I></F></C>'),
(83874, 'ordinee', '<C><F><I><N><Q>@ordinee /,ɔ:di''ni:/<br />*  danh từ<br />- mục sư mới được phong chức</Q></N></I></F></C>'),
