(83876, 'ordnance', '<C><F><I><N><Q>@ordnance /''ɔ:dnəns/<br />*  danh từ<br />- pháo, súng lớn<br />- ban quân nhu, ban hậu cần<br />- (từ Mỹ,nghĩa Mỹ) súng ống đạn dược</Q></N></I></F></C>'),
(83877, 'ordnance survey', '<C><F><I><N><Q>@ordnance survey<br />* danh từ<br />- cục bản đồ; bản đồ chính xác và chi tiết (của Anh)</Q></N></I></F></C>'),
(83878, 'ordo', '<C><F><I><N><Q>@ordo<br />* danh từ<br />- số nhiều ordos,  ordines<br />- danh sách các ngày lễ hội của Công giáo trong năm</Q></N></I></F></C>'),
(83879, 'ordonnance', '<C><F><I><N><Q>@ordonnance<br />* danh từ<br />- (pháp luật) sự bố trí, phối hợp, trình bày<br />- pháp lệnh, pháp điển; mệnh lệnh tư pháp</Q></N></I></F></C>'),
(83880, 'ordonnancees', '<C><F><I><N><Q>@ordonnance<br />* danh từ<br />- (pháp luật) sự bố trí, phối hợp, trình bày<br />- pháp lệnh, pháp điển; mệnh lệnh tư pháp</Q></N></I></F></C>'),
