(83891, 'oreographic', '<C><F><I><N><Q>@oreographic /,ɔrou''græfik/ (oreographic) /,ɔriə''græfik/ (oreographical) /,ɔriə''græfikəl/ (orographical) /,ɔrou''græfikəl/<br />*  danh từ<br />- (thuộc) sơn văn học<br />- (thuộc) địa hình núi</Q></N></I></F></C>'),
(83892, 'oreographical', '<C><F><I><N><Q>@oreographical /,ɔrou''græfik/ (oreographic) /,ɔriə''græfik/ (oreographical) /,ɔriə''græfikəl/ (orographical) /,ɔrou''græfikəl/<br />*  danh từ<br />- (thuộc) sơn văn học<br />- (thuộc) địa hình núi</Q></N></I></F></C>'),
(83893, 'oreography', '<C><F><I><N><Q>@oreography /ɔ''rɔgrəfi/ (oreography) /,ɔri''ɔgrəfi/<br />*  danh từ<br />- sơn văn học, khoa mô ta núi</Q></N></I></F></C>'),
