(83895, 'oreologist', '<C><F><I><N><Q>@oreologist /ɔ''rɔlədʤist/ (oreologist) /,ɔri''ɔlədʤist/<br />*  danh từ<br />- nhà nghiên cứu núi</Q></N></I></F></C>'),
