(83899, 'orexin', '<C><F><I><N><Q>@orexin<br />* danh từ<br />- (hoá học) Orexin</Q></N></I></F></C>'),
(83900, 'orexis', '<C><F><I><N><Q>@orexis<br />* danh từ<br />- dục vọng; sự thèm ăn</Q></N></I></F></C>'),
(83901, 'orfray', '<C><F><I><N><Q>@orfray /''ɔ:fri/ (orfray) /''ɔ:frei/<br />*  danh từ<br />- dải viền thêu (để viền áo thầy tu)</Q></N></I></F></C>'),
(83902, 'organ', '<C><F><I><N><Q>@organ /''ɔ:gən/<br />*  danh từ<br />- đàn ống (dùng trong nhà thờ); đàn hộp (có tay quay) ((cũng) barrel organ)<br />- (sinh vật học) cơ quan<br />=organs of speech+ cơ quan phát âm<br />- cơ quan, cơ quan ngôn luận, cơ quan nhà nước<br />- giọng nói<br />=to have a magnificent organ+ có giọng nói to</Q></N></I></F></C>'),
(83903, 'organ-blower', '<C><F><I><N><Q>@organ-blower /''ɔ:gən,blouə/<br />*  danh từ<br />- người cho chạy bộ phận thổi đàn ống<br />- bộ phận máy thổi đàn ống</Q></N></I></F></C>'),
(83904, 'organ-builder', '<C><F><I><N><Q>@organ-builder /''ɔ:gən,bildə/<br />*  danh từ<br />- người làm đàn ống</Q></N></I></F></C>'),
(83905, 'organ-grinder', '<C><F><I><N><Q>@organ-grinder /''ɔ:gən,graində/<br />*  danh từ<br />- người quay đàn hộp (đi rong ở phố)</Q></N></I></F></C>'),
(83906, 'organ-loft', '<C><F><I><N><Q>@organ-loft /''ɔ:gənlɔft/<br />*  danh từ<br />- phòng để đàn ống (trong nhà thờ)</Q></N></I></F></C>'),
(83907, 'organ-pipe', '<C><F><I><N><Q>@organ-pipe /,ɔ:gənpaip/<br />*  danh từ<br />- ống đàn ống</Q></N></I></F></C>'),
(83908, 'organa', '<C><F><I><N><Q>@organa<br />* danh từ<br />- số nhiều<br />- xem organon<br />- danh từ,  số nhiều</Q></N></I></F></C>'),
(83909, 'organdie', '<C><F><I><N><Q>@organdie /''ɔ:gəndi/ (organdy) /''ɔ:gəndi/<br />*  danh từ<br />- vải phin nõn ocganđi</Q></N></I></F></C>'),
(83910, 'organdies', '<C><F><I><N><Q>@organdie /''ɔ:gəndi/ (organdy) /''ɔ:gəndi/<br />*  danh từ<br />- vải phin nõn ocganđi</Q></N></I></F></C><C><F><I><N><Q>@organdy /''ɔ:gəndi/ (organdy) /''ɔ:gəndi/<br />*  danh từ<br />- vải phin nõn ocganđi</Q></N></I></F></C>'),
(83911, 'organdy', '<C><F><I><N><Q>@organdy /''ɔ:gəndi/ (organdy) /''ɔ:gəndi/<br />*  danh từ<br />- vải phin nõn ocganđi</Q></N></I></F></C>'),
(83912, 'organelle', '<C><F><I><N><Q>@organelle<br />* danh từ<br />- (sinh vật học) hạt cơ quan (cơ quan tử); cơ quan tế bào</Q></N></I></F></C>'),
(83913, 'organelles', '<C><F><I><N><Q>@organelle<br />* danh từ<br />- (sinh vật học) hạt cơ quan (cơ quan tử); cơ quan tế bào</Q></N></I></F></C>'),
(83914, 'organic', '<C><F><I><N><Q>@organic /ɔ:''gænik/<br />*  tính từ<br />- (thuộc) cơ quan<br />- có cơ quan, có tổ chức<br />- (hoá học),  (y học) hữu cơ<br />=organic chemistry+ hoá học hữu cơ<br />=organic disease+ bệnh hữu cơ<br />- (pháp lý) cơ bản, có kết cấu<br />=the organic law+ luật cơ bản<br />- có hệ thống, có phối hợp, hữu cơ<br />=an organic whole+ một tổng thể hữu cơ</Q></N></I></F></C>'),
(83915, 'organic chemistry', '<C><F><I><N><Q>@organic chemistry<br />* danh từ<br />- hoá học hữu cơ</Q></N></I></F></C>'),
(83916, 'Organic composition of capital', '<C><F><I><N><Q>@Organic composition of capital<br />- (Econ) Thành phần hữu cơ của vốn.<br />+ Là thuật ngữ do C.MÁC dùng để gọi tỷ số giữa vốn cố định với vốn khả biến và là khái niệm gần giống nhưng không hoàn toàn đồng nghĩa với khái niệm hiện đại về tỉ suất VỐN-LAO ĐỘNG vì vốn cố định chỉ thể hiện được vốn và nguyên liệu đã được sử dụng trong quá trình sản suất chứ khong thể hiện được tổng số vốn và nguyên liệu sẵn có cho lao động.</Q></N></I></F></C>'),
(83917, 'organical', '<C><F><I><N><Q>@organical<br />- xem organic</Q></N></I></F></C>'),
(83918, 'organically', '<C><F><I><N><Q>@organically /''ɔ:gænikəli/<br />*  phó từ<br />- hữu cơ</Q></N></I></F></C>'),
(83919, 'organice', '<C><F><I><N><Q>@organice /''ɔ:gənaiz/ (organise) /''ɔ:gənaiz/<br />*  ngoại động từ<br />- tổ chức, cấu tạo, thiết lập<br />- (từ Mỹ,nghĩa Mỹ) lập thành nghiệp đoàn, đưa vào nghiệp đoàn<br />*  nội động từ<br />- thành tổ chức<br />- (từ Mỹ,nghĩa Mỹ) thành lập nghiệp đoàn, gia nhập nghiệp đoàn</Q></N></I></F></C>'),
(83920, 'organicism', '<C><F><I><N><Q>@organicism /''ɔ:gənisizm/<br />*  danh từ<br />- (sinh vật học); (triết học) thuyết hữu cơ<br />- (y học) thuyết tổn thương cơ quan, thuyết hữu cơ</Q></N></I></F></C>'),
(83921, 'organise', '<C><F><I><N><Q>@organise<br />- xem organize</Q></N></I></F></C>'),
(83922, 'organism', '<C><F><I><N><Q>@organism /''ɔ:gənizm/<br />*  danh từ<br />- cơ thể; sinh vật<br />- cơ quan, tổ chức</Q></N></I></F></C>'),
(83923, 'organisms', '<C><F><I><N><Q>@organism /''ɔ:gənizm/<br />*  danh từ<br />- cơ thể; sinh vật<br />- cơ quan, tổ chức</Q></N></I></F></C>'),
(83924, 'organist', '<C><F><I><N><Q>@organist /''ɔ:gənist/<br />*  danh từ<br />- người đánh đàn ống</Q></N></I></F></C>'),
(83925, 'organists', '<C><F><I><N><Q>@organist /''ɔ:gənist/<br />*  danh từ<br />- người đánh đàn ống</Q></N></I></F></C>'),
(83926, 'organizable', '<C><F><I><N><Q>@organizable /''ɔ:gənaizəbl/<br />*  tính từ<br />- có thể tổ chức được</Q></N></I></F></C>'),
(83927, 'organization', '<C><F><I><N><Q>@organization /,ɔ:gənai''zeiʃn/<br />*  danh từ<br />- sự tổ chức, sự cấu tạo<br />- tổ chức, cơ quan<br />=world organizations+ các tổ chức quốc tế</Q></N></I></F></C>'),
(83928, 'Organization for European Economic Co-operation  (OEEC)', '<C><F><I><N><Q>@Organization for European Economic Co-operation  (OEEC)<br />- (Econ) Tổ chức hợp tác kinh tế châu Âu.<br />+ Năm 1947, sau khi có sự gợi ý ban đầu của Marshall, bộ trưởng ngoại giao Mỹ về một chương trình hỗ trợ của Mỹ nhằm phục hôi của kinh tế châu âu sau chiến tranh, 16 nước châu Âu đã thành lâp Uỷ ban hợp tác kinh tế châu âu để quản lí và điều phối CHƯƠNG TRÌNH PHỤC HỒI CHÂU ÂU.</Q></N></I></F></C>'),
(83929, 'Organization of Arab Petroleum Exporting Countries', '<C><F><I><N><Q>@Organization of Arab Petroleum Exporting Countries<br />- (Econ) (OAPEC) - Tổ chức Các nước Ả rập xuất khẩu dầu mỏ.<br />+ Là một tổ chức hàng hoá quốc tế được thành lập vào năm 1968, có nhiệm vụ điều phối các chính sách kinh tế về dầu mỏ và khuyến khích hợp tác kinh tế giữa các nước Ả rập sản xuất dầu mỏ.</Q></N></I></F></C>'),
(83930, 'Organization of Economic Co-operation and Development (OECD)', '<C><F><I><N><Q>@Organization of Economic Co-operation and Development (OECD)<br />- (Econ) Tổ chức hợp tác và phát triển kinh tế.<br />+ Là một tổ chức liên chinh phủ được thành lập năm 1961 để thay thế và mở rộng tổ chức hợp tác kinh tế châu âu (OEEC) theo các điều khoản của cong ước ký tại Paris năm 1960 bởi các nước thành viên ban đầu của OEEC gồm Canada, Tây ban nha và Mỹ.</Q></N></I></F></C>'),
(83931, 'Organization of Petroleum Exporting Countries', '<C><F><I><N><Q>@Organization of Petroleum Exporting Countries<br />- (Econ) (OPEC) - Tổ chức các nước xuất khẩu dầu mỏ.<br />+ Là một tổ chức hàng hoá quốc tế có nhiệm vụ điều phối các chính sách sản xuất và định giá dầu mỏ tại các nước thành viên của các nước xuất khẩu dầu mỏ.</Q></N></I></F></C>'),
(83932, 'Organization slack', '<C><F><I><N><Q>@Organization slack<br />- (Econ) Sự lỏng lẻo về tổ chức.</Q></N></I></F></C>'),
(83933, 'organizational', '<C><F><I><N><Q>@organizational<br />* tính từ<br />- (thuộc) tổ chức, cơ quan<br />- (thuộc) sự tổ chức, cấu tạo</Q></N></I></F></C>'),
