(83935, 'organize', '<C><F><I><N><Q>@organize /''ɔ:gənaiz/ (organise) /''ɔ:gənaiz/<br />*  ngoại động từ<br />- tổ chức, cấu tạo, thiết lập<br />- (từ Mỹ,nghĩa Mỹ) lập thành nghiệp đoàn, đưa vào nghiệp đoàn<br />*  nội động từ<br />- thành tổ chức<br />- (từ Mỹ,nghĩa Mỹ) thành lập nghiệp đoàn, gia nhập nghiệp đoàn</Q></N></I></F></C>'),
(83936, 'organized', '<C><F><I><N><Q>@organized<br />* tính từ<br />- có trật tự, ngăn nắp, hữu hiệu<br />- được sắp xếp, chuẩn bị<br />- có chân trong nghiệp đoàn (về công nhân)</Q></N></I></F></C><C><F><I><N><Q>@organize /''ɔ:gənaiz/ (organise) /''ɔ:gənaiz/<br />*  ngoại động từ<br />- tổ chức, cấu tạo, thiết lập<br />- (từ Mỹ,nghĩa Mỹ) lập thành nghiệp đoàn, đưa vào nghiệp đoàn<br />*  nội động từ<br />- thành tổ chức<br />- (từ Mỹ,nghĩa Mỹ) thành lập nghiệp đoàn, gia nhập nghiệp đoàn</Q></N></I></F></C>'),
