(84224, 'oscillating', '<C><F><I><N><Q>@oscillate /''ɔsileit/<br />*  động từ<br />- lung lay, đu đưa<br />- lưỡng lự, do dự; dao động<br />- (kỹ thuật) dao động<br /><br />@oscillate<br />- dao động, rung động</Q></N></I></F></C>'),
(84225, 'oscillation', '<C><F><I><N><Q>@oscillation /,ɔsi''leiʃn/<br />*  danh từ<br />- sự lung lay, sự đu đưa<br />- sự lưỡng lự, sự do dự; sự dao động<br />- (kỹ thuật) sự dao động<br /><br />@oscillation<br />- (sự) dao động; dao độ o. at a point dao động tại một điểm <br />- o. of a function dao động của một hàm <br />- damped o. (vật lí) dao động tắt dần<br />- discontinuous o. dao động không liên tục, dao động gián đoạn <br />- exponential o. dao động theo luật mũ <br />- forced o. (vật lí) dao động cưỡng bức <br />- free o. dao động tự do<br />- harmonic o. dao động điều hoà<br />- natural o. dao động riêng<br />- pitching o. (cơ học) dao động [dọc, chòng chành] (tàu biển, máy bay)<br />- principal o. dao động chính <br />- residual o. dao động còn dư<br />- steady-state o. (vật lí) dao động ổn định<br />- tidal o. dao động thuỷ triều<br />- transient o. dao động nhất thời<br />- undamped o. dao động không tắt dần</Q></N></I></F></C>'),
(84226, 'oscillations', '<C><F><I><N><Q>@oscillation /,ɔsi''leiʃn/<br />*  danh từ<br />- sự lung lay, sự đu đưa<br />- sự lưỡng lự, sự do dự; sự dao động<br />- (kỹ thuật) sự dao động<br /><br />@oscillation<br />- (sự) dao động; dao độ o. at a point dao động tại một điểm <br />- o. of a function dao động của một hàm <br />- damped o. (vật lí) dao động tắt dần<br />- discontinuous o. dao động không liên tục, dao động gián đoạn <br />- exponential o. dao động theo luật mũ <br />- forced o. (vật lí) dao động cưỡng bức <br />- free o. dao động tự do<br />- harmonic o. dao động điều hoà<br />- natural o. dao động riêng<br />- pitching o. (cơ học) dao động [dọc, chòng chành] (tàu biển, máy bay)<br />- principal o. dao động chính <br />- residual o. dao động còn dư<br />- steady-state o. (vật lí) dao động ổn định<br />- tidal o. dao động thuỷ triều<br />- transient o. dao động nhất thời<br />- undamped o. dao động không tắt dần</Q></N></I></F></C>'),
