(84415, 'other', '<C><F><I><N><Q>@other /''ʌðə/<br />*  tính từ<br />- khác<br />=we have other evidence+ chúng tôi có chứng cớ khác<br />=it was none other than Nam+ không phải ai khác mà chính là Nam<br />- kia<br />=now open the other eye+ bây giờ mở mắt kia ra<br />!every other day<br />- (xem) every<br />!the other day<br />- (xem) day<br />!on the other hand<br />- mặt khác<br />*  danh từ &amp; đại từ<br />- người khác, vật khác, cái khác<br />=the six other are late+ sáu người kia đến chậm<br />=give me some others+ đưa cho tôi một vài cái khác<br />*  phó từ<br />- khác, cách khác</Q></N></I></F></C>'),
