(84424, 'others', '<C><F><I><N><Q>@others<br />- đại từ<br />- những người khác; những vật khác<br />= some people like cars,  others like motorbikes+một số người thích xe ô tô, những người khác thì thích xe gắn máy<br />= we must help others needier than ourselves+chúng ta phải giúp đỡ những người khác túng thiếu hơn chúng ta<br />- (the others) những người hoặc vật còn lại trong một nhóm; những người/vật khác/kia<br />= he is the only person to help poor pupils - none of the others bothered+ông ta là người duy nhất giúp đỡ học sinh nghèo - những người khác chẳng ai quan tâm đến<br />= I went swimming while the others played tennis+tôi đi bơi, còn những người khác chơi quần vợt<br />= I can''t do the fourth and fifth questions but I''ve done all the others+tôi không làm được câu hỏi thứ tư và thứ năm, nhưng đã làm được tất cả các câu hỏi khác</Q></N></I></F></C><C><F><I><N><Q>@other /''ʌðə/<br />*  tính từ<br />- khác<br />=we have other evidence+ chúng tôi có chứng cớ khác<br />=it was none other than Nam+ không phải ai khác mà chính là Nam<br />- kia<br />=now open the other eye+ bây giờ mở mắt kia ra<br />!every other day<br />- (xem) every<br />!the other day<br />- (xem) day<br />!on the other hand<br />- mặt khác<br />*  danh từ &amp; đại từ<br />- người khác, vật khác, cái khác<br />=the six other are late+ sáu người kia đến chậm<br />=give me some others+ đưa cho tôi một vài cái khác<br />*  phó từ<br />- khác, cách khác</Q></N></I></F></C>'),
