(84484, 'our', '<C><F><I><N><Q>@our /''auə/<br />*  tính từ sở hữu<br />- của chúng ta, của chúng tôi, của chúng mình<br />=in our opinion+ theo ý kiến chúng tôi<br />- của trẫm (vua chúa...)<br />!Our Father<br />- thượng đế<br />!Our Saviour<br />- Đức Chúa Giê-xu (đối với người theo đạo Thiên chúa)<br />!Our Lady<br />- Đức Mẹ đồng trinh (đối với người theo đạo Thiên chúa)</Q></N></I></F></C>'),
