(84486, 'ours', '<C><F><I><N><Q>@ours /''auəz/<br />*  đại từ sở hữu<br />- cái của chúng ta, cái của chúng tôi, cái của chúng mình<br />=ours is a large family+ gia đình chúng tôi là một gia đình lớn<br />- trung đoàn của chúng ta, đội của chúng ta, trung đoàn của chúng tôi, đội của chúng tôi<br />=Jones of ours+ Giôn ở đội của chúng tôi</Q></N></I></F></C>'),
(84487, 'ourself', '<C><F><I><N><Q>@ourself /,auə''self/<br />*  đại từ phản thân<br />- số ít của ourselves (chỉ dùng khi một vị vua chúa tự xưng, hoặc trường hợp này cũng dùng số nhiều khi một nhà báo, một người bình thường tự xưng)</Q></N></I></F></C>'),
(84488, 'ourselves', '<C><F><I><N><Q>@ourselves /,auə''selvz/<br />*  đại từ phản thân<br />- bản thân chúng ta, bản thân chúng tôi, bản thân chúng mình; tự chúng mình<br />=we ourselves will see to it+ bản thân chúng tôi sẽ chăm lo việc đó<br />- chúng tôi, chúng mình (khi nói trước công chúng, khi viết một bài báo không ký tên)<br />=it will do good to all and to ourselves+ cái đó sẽ có lợi cho mọi người và cho chúng mình</Q></N></I></F></C>'),
