(84492, 'ouster', '<C><F><I><N><Q>@ouster /''austə/<br />*  danh từ<br />- (pháp lý) sự trục xuất<br />- (từ Mỹ,nghĩa Mỹ) sự đuổi, sự trục xuất; sự hất cẳng<br />- (từ Mỹ,nghĩa Mỹ) kẻ đuổi, kẻ trục xuất; kẻ hất cẳng</Q></N></I></F></C>'),
(84493, 'ousters', '<C><F><I><N><Q>@ouster /''austə/<br />*  danh từ<br />- (pháp lý) sự trục xuất<br />- (từ Mỹ,nghĩa Mỹ) sự đuổi, sự trục xuất; sự hất cẳng<br />- (từ Mỹ,nghĩa Mỹ) kẻ đuổi, kẻ trục xuất; kẻ hất cẳng</Q></N></I></F></C>'),
