(84503, 'out-group', '<C><F><I><N><Q>@out-group /''autgru:p/<br />*  danh từ<br />- những người ngoài nhóm</Q></N></I></F></C>'),
(84504, 'out-herod', '<C><F><I><N><Q>@out-herod /aut''herəd/<br />*  ngoại động từ<br />- hống hách hơn cả Hê-rốt, hơn (ai) về (một cái gì quá quắt)<br />=to out-herod Judas in perfidy+ thâm độc hơn cả Giu-đa</Q></N></I></F></C>'),
(84505, 'out-jockey', '<C><F><I><N><Q>@out-jockey /aut''dʤɔki/<br />*  ngoại động từ<br />- mưu mẹo hơn (ai), láu cá hơn (ai)</Q></N></I></F></C>'),
