(84516, 'out-of-print', '<C><F><I><N><Q>@out-of-print /''autəv''pɔkit/<br />*  tính từ<br />- không xuất bản nữa<br />*  danh từ<br />- tài liệu không xuất bản nữa</Q></N></I></F></C>'),
(84517, 'out-of-the-way', '<C><F><I><N><Q>@out-of-the-way /''autəvðə''wei/<br />*  tính từ<br />- xa xôi, hẻo lánh<br />=an out-of-the-way p[lace+ vùng hẻo lánh<br />- lạ, khác thường<br />- không chỉnh, không phải lối, không đúng lề lối; làm mếch lòng<br />=out-of-the-way remarks+ những lời nhận xét làm mếch lòng</Q></N></I></F></C>'),
(84518, 'out-of-truth', '<C><F><I><N><Q>@out-of-truth /''autəv''tru:θ/<br />*  tính từ<br />- (kỹ thuật) không khớp<br />*  phó từ<br />- không đúng</Q></N></I></F></C>'),
(84519, 'out-of-work', '<C><F><I><N><Q>@out-of-work /''autəv''wə:k/<br />*  tính từ<br />- không có việc làm, thất nghiệp<br />*  danh từ<br />- người thất nghiệp</Q></N></I></F></C>'),
(84520, 'out-relief', '<C><F><I><N><Q>@out-relief /''autri,li:f/<br />*  danh từ<br />- tiền trợ cấp cho những người không ở trại tế bần</Q></N></I></F></C>'),
