(84586, 'outcrop', '<C><F><I><N><Q>@outcrop /''autkrɔp/<br />*  danh từ<br />- (địa lý,địa chất) sự trồi lên mặt đát (một lớp đất, một vỉa than)<br />- phần (đất, than) trồi lên<br />- (từ Mỹ,nghĩa Mỹ) sự nổ bùng; đợt nổ ra<br />*  nội động từ<br />- (địa lý,địa chất) trồi lên, nhô lên</Q></N></I></F></C>'),
(84587, 'outcropped', '<C><F><I><N><Q>@outcrop /''autkrɔp/<br />*  danh từ<br />- (địa lý,địa chất) sự trồi lên mặt đát (một lớp đất, một vỉa than)<br />- phần (đất, than) trồi lên<br />- (từ Mỹ,nghĩa Mỹ) sự nổ bùng; đợt nổ ra<br />*  nội động từ<br />- (địa lý,địa chất) trồi lên, nhô lên</Q></N></I></F></C>'),
