(84590, 'outcross', '<C><F><I><N><Q>@outcross /autkrɔsiɳ/ (outcross) /''autkrɔs/<br />*  danh từ<br />- sự giao phối cùng giống</Q></N></I></F></C>'),
(84591, 'outcrossing', '<C><F><I><N><Q>@outcrossing /autkrɔsiɳ/ (outcross) /''autkrɔs/<br />*  danh từ<br />- sự giao phối cùng giống</Q></N></I></F></C>'),
(84592, 'outcry', '<C><F><I><N><Q>@outcry /''autkrai/<br />*  danh từ<br />- sự la thét; tiếng la thét<br />- sự la ó, sự phản đối kịch liệt<br />- (từ Mỹ,nghĩa Mỹ) sự bán đấu giá<br />*  ngoại động từ<br />- kêu to hơn (ai), la thét to hơn ai</Q></N></I></F></C>'),
