(84726, 'outlet', '<C><F><I><N><Q>@outlet /''autlet/<br />*  danh từ<br />- chỗ thoát ra, lối ra; (nghĩa bóng) phương tiện thoả mãn... (chí hướng...)<br />- cửa sông (ra biển, vào hồ...)<br />- dòng sông, dòng nước (chảy từ hồ...)<br />- (thương nghiệp) thị trường, chỗ tiêu thụ; cửa hàng tiêu thụ, cửa hàng đại lý (của một hãng)<br />- (từ Mỹ,nghĩa Mỹ) đài phát thanh phụ (phát lại của một hệ thống lớn hơn)<br /><br />@outlet<br />- (máy tính) lối ra, rút ra</Q></N></I></F></C>'),
(84727, 'outlets', '<C><F><I><N><Q>@outlet /''autlet/<br />*  danh từ<br />- chỗ thoát ra, lối ra; (nghĩa bóng) phương tiện thoả mãn... (chí hướng...)<br />- cửa sông (ra biển, vào hồ...)<br />- dòng sông, dòng nước (chảy từ hồ...)<br />- (thương nghiệp) thị trường, chỗ tiêu thụ; cửa hàng tiêu thụ, cửa hàng đại lý (của một hãng)<br />- (từ Mỹ,nghĩa Mỹ) đài phát thanh phụ (phát lại của một hệ thống lớn hơn)<br /><br />@outlet<br />- (máy tính) lối ra, rút ra</Q></N></I></F></C>'),
(84728, 'outlie', '<C><F><I><N><Q>@outlie<br />* nội động từ outlay,  outlian+ở ngoài đồng, nằm ngoài trời</Q></N></I></F></C>'),
(84729, 'Outlier', '<C><F><I><N><Q>@Outlier<br />- (Econ) Giá trị ngoại lai.<br />+ Là một thuật ngữ được dùng để mô tả một điểm số liệu mà cách xa một cách bất thường trung tâm của quan sát.</Q></N></I></F></C>'),
(84730, 'outlier', '<C><F><I><N><Q>@outlier /''aut,laiə/<br />*  danh từ<br />- người nằm ngoài, cái nằm ngoài<br />- (từ Mỹ,nghĩa Mỹ) người đứng ngoài (một tổ chức...), người tách khỏi nhóm...<br />- (địa lý,địa chất) phần tách ngoài (tách ra khỏi phần chính)<br />- (từ Mỹ,nghĩa Mỹ) người ở ngoài (chỗ làm...)<br /><br />@outlier<br />- (thống kê) giá trị ngoại lệ</Q></N></I></F></C>'),
(84731, 'outliers', '<C><F><I><N><Q>@Outlier<br />- (Econ) Giá trị ngoại lai.<br />+ Là một thuật ngữ được dùng để mô tả một điểm số liệu mà cách xa một cách bất thường trung tâm của quan sát.</Q></N></I></F></C><C><F><I><N><Q>@outlier /''aut,laiə/<br />*  danh từ<br />- người nằm ngoài, cái nằm ngoài<br />- (từ Mỹ,nghĩa Mỹ) người đứng ngoài (một tổ chức...), người tách khỏi nhóm...<br />- (địa lý,địa chất) phần tách ngoài (tách ra khỏi phần chính)<br />- (từ Mỹ,nghĩa Mỹ) người ở ngoài (chỗ làm...)<br /><br />@outlier<br />- (thống kê) giá trị ngoại lệ</Q></N></I></F></C>'),
(84732, 'outline', '<C><F><I><N><Q>@outline /''autlain/<br />*  danh từ<br />- nét ngoài, đường nét<br />- hình dáng, hình bóng<br />=the outline of a church+ hình bóng của một toà nhà thờ<br />- nét phác, nét đại cương; đề cương; sự vạch ra những nét chính (của một kế hoạch...)<br />- (số nhiều) đặc điểm chính, nguyên tắc chung<br />*  ngoại động từ<br />- vẽ phác, phác thảo<br />- vẽ đường nét bên ngoài, vạch hình dáng bên ngoài<br />=the mountain range was clearly outlined against the morning sky+ dãy núi in hình rõ lên nền trời buổi sáng<br />- thảo những nét chính, phác ra những nét chính (của một kế hoạch...)</Q></N></I></F></C>'),
(84733, 'outlinear', '<C><F><I><N><Q>@outlinear<br />* tính từ<br />- xem outline (danh từ), chỉ thuộc về</Q></N></I></F></C>'),
(84734, 'outlined', '<C><F><I><N><Q>@outline /''autlain/<br />*  danh từ<br />- nét ngoài, đường nét<br />- hình dáng, hình bóng<br />=the outline of a church+ hình bóng của một toà nhà thờ<br />- nét phác, nét đại cương; đề cương; sự vạch ra những nét chính (của một kế hoạch...)<br />- (số nhiều) đặc điểm chính, nguyên tắc chung<br />*  ngoại động từ<br />- vẽ phác, phác thảo<br />- vẽ đường nét bên ngoài, vạch hình dáng bên ngoài<br />=the mountain range was clearly outlined against the morning sky+ dãy núi in hình rõ lên nền trời buổi sáng<br />- thảo những nét chính, phác ra những nét chính (của một kế hoạch...)</Q></N></I></F></C>');
