(84847, 'outs', '<C><F><I><N><Q>@out /aut/<br />*  phó từ<br />- ngoài, ở ngoài, ra ngoài<br />=to be out in the rain+ ở ngoài mưa<br />=to be out+ đi vắng<br />=to put out to sea+ ra khơi<br />=to be out at sea+ ở ngoài khơi<br />- ra<br />=the war broke out+ chiến tranh nổ ra<br />=to spread out+ trải rộng ra<br />=to lenngthen out+ dài ra<br />=to dead out+ chia ra<br />=to pick out+ chọn ra<br />- hẳn, hoàn toàn hết<br />=to dry out+ khô hẳn<br />=to be tired out+ mệt lử<br />=to die out+ chết hẳn<br />=before the week is out+ trước khi hết tuần<br />=have you read it out?+ anh ta đã đọc hết cuốn sách đó chưa?<br />=he would not hear me out+ nó nhất định không nghe tôi nói hết đã<br />- không nắm chính quyền<br />=Tories are out+ đảng Bảo thủ (Anh) không nắm chính quyền<br />- đang bãi công<br />=miners are out+ công nhân mỏ đang bãi công<br />- tắt, không cháy<br />=the fire is out+ đám cháy tắt<br />=to turn out the light+ tắt đèn<br />- không còn là mốt nữa<br />=top hats are out+ mũ chóp cao không còn là mốt nữa<br />- to thẳng, rõ ra<br />=to sing out+ hát to<br />=to speak out+ nói to; nói thẳng<br />=to have it out with somebody+ giải thích cho rõ ra với ai, nói thẳng ra với ai<br />- sai khớp, trật khớp, trẹo xương<br />=arm is out+ cánh tay bị trẹo xương<br />- gục, bất tỉnh<br />=to knock out+ đánh gục, đánh bất tỉnh, cho đo ván<br />=to pass out+ ngất đi, bất tỉnh<br />- sai, lầm<br />=to be out in one''s calculations+ sai trong sự tính toán<br />- không như bình thường, bối rối, luống cuống, lúng túng<br />=the news put him out+ tin đó làm anh ra bối rối<br />=I have forgotten my part and I am out+ tôi quên mất phần vở (kịch) của tôi và tôi cuống lên<br />- đã xuất bản (sách); đã nở (gà con); đã được cho ra giao du (con gái mới lớn lên); đã truyền đi (bức điện)<br />!all out<br />- (thông tục) hoàn toàn, hết sức, hết lực; toàn tâm toàn ý<br />!to be out and about<br />- đã dậy ra ngoài được (sau khi ốm khỏi)<br />!out and away<br />- bỏ xa, không thể so sánh được với<br />!out and to be out for something<br />- đang đi tìm cái gì; theo đuổi cái gì; quyết tâm kiếm bằng được cái gì<br />!out from under<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) thoát khỏi cảnh khó khăn, thoát khỏi cảnh hiểm nghèo<br />!out of<br />- ra ngoài, ra khỏi, ngoài<br />=out of the house+ ra khỏi nhà<br />=out of reach+ ngoài tầm với<br />=out of danger+ thoát khỏi cảnh hiểm nguy<br />- vì<br />=out of curiosity+ vì tò mò<br />=out of pity+ vì lòng trắc ẩn<br />=out of mecessity+ vì cần thiết<br />- bằng<br />=made out of stone+ làm bằng đá<br />- cách xa, cách<br />=three kilometers out of Hanoi+ cách Hà nội ba kilômet<br />=out of sight out of mind+ xa mặt cách lòng<br />- sai lạc<br />=to sing out of tune+ hát sai, hát lạc điệu<br />=out of drawing+ vẽ sai<br />- trong, trong đám<br />=nine out of ten+ chín trong mười cái (lần...)<br />=to take one out of the lot+ lấy ra một cái trong đám<br />- hết; mất<br />=to be out of money+ hết tiền<br />=to be out of patience+ không kiên nhẫn được nữa, không nhịn được nữa<br />=to be out of one''s mind+ mất bình tĩnh<br />=to cheat someone out of his money+ lừa ai lấy hết tiền<br />- không<br />=out of doubt+ không còn nghi ngờ gì nữa, chắc chắn<br />=out of number+ không đếm xuể, vô số<br />=out of place+ không đúng chỗ, không đúng lúc<br />!out to<br />- (từ Mỹ,nghĩa Mỹ) quyết tâm, gắng sức (làm điều gì)<br />!out with<br />- cút đi, cút khỏi, ra khỏi<br />=out with him!+ tống cổ nó ra!<br />=out with it!+ nói ra đi!, cứ nói đi!<br />- bất hoà, xích mích, không thân thiện<br />=to be out with somebody+ xích mích với ai, không thân thiện với ai<br />*  danh từ<br />- từ ở... ra, từ... ra<br />=from out the room came a voice+ một giọng nói vọng từ trong buồng ra<br />- ở ngoài, ngoài<br />=out this window+ ở ngoài cửa sổ này<br />*  tính từ<br />- ở ngoài, ở xa<br />=an out match+ một trận đấu ở sân khác (không phải ở sân nhà)<br />- quả<br />=out size+ cỡ quá khổ<br />*  danh từ<br />- (số nhiều) (chính trị) (the outs) đảng không nắm chính quyền<br />- (ngành in) sự bỏ sót chữ; chữ bỏ sót<br />- (thể dục,thể thao) quả bóng đánh ra ngoài sân (quần vợt)<br />- (từ Mỹ,nghĩa Mỹ),  (từ lóng) lối thoát; cách cáo từ, cách thoái thác<br />!the ins and outs<br />- (xem) in<br />*  ngoại động từ (từ lóng)<br />- (thông tục) tống cổ nó đi<br />- (thể dục,thể thao) cho nó đo ván (quyền Anh)<br />*  nội động từ<br />- lộ ra (điều bí mật...)</Q></N></I></F></C>'),
(84848, 'outsail', '<C><F><I><N><Q>@outsail /aut''seil/<br />*  ngoại động từ<br />- lèo lái giỏi hơn<br />- đi nhanh hơn, đi xa hơn (thuyền)</Q></N></I></F></C>'),
