(84869, 'outside', '<C><F><I><N><Q>@outside /''aut''said/<br />*  danh từ<br />- bề ngoài, bên ngoài<br />=to open the door from the outside+ mở cửa từ bên ngoài<br />- thế giới bên ngoài<br />- hành khách ngồi phía ngoài<br />- (số nhiều) những tờ giấy ngoài (của một ram giấy)<br />!at the outside<br />- nhiều nhất là, tối đa là<br />=it is four kilometers at the outside+ nhiều nhất là 4 kilômét<br />*  phó từ<br />- ở phía ngoài; ở ngoài trời; ở ngoài biển khơi<br />=put these flowers outside+ hây để những bông hoa này ra ngoài (phòng)<br />!come outside<br />- ra ngoài đi, thử ra ngoài chơi nào (thách thức)<br />!to get outside of<br />- (từ lóng) hiểu<br />- chén, nhậu<br />*  tính từ<br />- ở ngoài, ở gần phía ngoài<br />=outside seat+ ghế ở gần phía ngoài, ghế phía đằng cuối<br />=outside work+ việc làm ở ngoài trời<br />- mỏng manh (cơ hội)<br />- của người ngoài<br />=an outside opinion+ ý kiến của người ngoài (không phải là nhị sĩ)<br />=outside broker+ người mua bán cổ phần ở ngoài (không thuộc sở chứng khoán)<br />- cao nhất, tối đa<br />=to quote the outside prices+ định giá cao nhất<br />*  giới từ<br />- ngoài, ra ngoài<br />=cannot go outside the evidence+ không thể đi ra ngoài bằng chứng được<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) trừ ra<br />!outside of<br />- ngoài ra<br /><br />@outside<br />- cạnh ngoài, mặt ngoài, phía ngoài</Q></N></I></F></C>'),
(84870, 'outside broadcast', '<C><F><I><N><Q>@outside broadcast<br />* danh từ<br />- chương trình quay phim hoặc thu ở một nơi ngoài studio chính</Q></N></I></F></C>'),
(84871, 'Outside lag', '<C><F><I><N><Q>@Outside lag<br />- (Econ) Độ trễ bên ngoài.<br />+ Là sự trễ giữa việc thực thi một chính sách (kinh tế vĩ mô) và tác động toàn bộ hay hoàn toàn của nó.</Q></N></I></F></C>'),
(84872, 'outside lane', '<C><F><I><N><Q>@outside lane<br />* danh từ<br />- phần đường siêu tốc</Q></N></I></F></C>'),
(84873, 'outside left', '<C><F><I><N><Q>@outside left<br />* danh từ<br />- tả biên; bên cánh trái (bóng đá)</Q></N></I></F></C>'),
(84874, 'outside line', '<C><F><I><N><Q>@outside line<br />* danh từ<br />- đường dây điện thoại nối với một nơi nào hoặc một tổ chức ở bên ngoài toà nhà</Q></N></I></F></C>'),
(84875, 'Outside money', '<C><F><I><N><Q>@Outside money<br />- (Econ) Tiền bên ngoài.<br />+ Cụm thuật ngữ này nói đến tiền mà giá trị của nó dựa vào những tài sản không phái là tài sản nợ theo nghĩa là những tài sản đó không tạo ra một khiếu nợ đối với các cá nhân trong nền kinh tế.</Q></N></I></F></C>'),
(84876, 'outside right', '<C><F><I><N><Q>@outside right<br />* danh từ<br />- hữu biên; bên cánh phải (bóng đá)</Q></N></I></F></C>'),
(84877, 'outsider', '<C><F><I><N><Q>@outsider /''aut''saidə/<br />*  danh từ<br />- người ngoài cuộc; người không thể cho nhập bọn<br />- người không cùng nghề; người không chuyên môn<br />- đấu thủ ít có khả năng thắng; ngựa đua ít có khả năng thắng</Q></N></I></F></C>'),
(84878, 'outsiders', '<C><F><I><N><Q>@outsider /''aut''saidə/<br />*  danh từ<br />- người ngoài cuộc; người không thể cho nhập bọn<br />- người không cùng nghề; người không chuyên môn<br />- đấu thủ ít có khả năng thắng; ngựa đua ít có khả năng thắng</Q></N></I></F></C>'),
