(85023, 'oven-bird', '<C><F><I><N><Q>@oven-bird /''ʌvnbə:d/<br />*  danh từ<br />- (động vật học) chim lò (ở Nam Mỹ, làm tổ hình lò)</Q></N></I></F></C>'),
