(85026, 'ovens', '<C><F><I><N><Q>@oven /''ʌvn/<br />*  danh từ<br />- lò (để hấp bánh, để dùng trong thí nghiệm hoá học)</Q></N></I></F></C>'),
(85027, 'ovenware', '<C><F><I><N><Q>@ovenware<br />* danh từ<br />- đĩa chịu nhiệt có thể dùng để nấu thức ăn trong lò<br />= ovenware pottery+đồ gốm dùng cho lò</Q></N></I></F></C>'),
(85028, 'over', '<C><F><I><N><Q>@over /''ouvə/<br />*  danh từ<br />- trên; ở trên<br />=a lamp over our heads+ cái đèn treo trên đầu chúng ta<br />=with his hat over his eyes+ cái mũ sùm sụp trên mắt<br />=the radio+ trên đài phát thanh<br />- trên khắp, ở khắp<br />=rice is grown all over Vietnam+ khắp nơi ở Việt Nam nơi nào cũng trồng lúa<br />=all the world over+ trên khắp thế giới<br />=all the world over+ trên khắp thế giới<br />=to travel over Europe+ đi du lịch khắp Châu Âu<br />- hơn, trên<br />=to set somebody over the rest+ đánh giá ai hơn những người khác, đặt ai trên những người khác<br />=to win a victory over the enemy+ đánh thắng kẻ thù<br />=to have command over oneself+ tự làm chủ được bản thân mình, tự kiềm chế được mình<br />- hơn, nhiều hơn<br />=it costs over 100d+ giá hơn 100 đồng<br />- qua, sang, đến tận<br />=to jump over the brook+ nhảy qua con suối<br />=to look over the hedge+ nhìn qua hàng rào<br />=the house over the way+ nhà bên kia đường<br />=to stumble over a stone+ vấp phải hòn đá<br />=over the telephone+ qua dây nói<br />=if we can tide over the next month+ nếu ta có thể vượt qua được hết tháng sau<br />=can you stay over Wednesday?+ anh có thể ở đến hết thứ tư không?<br />!all over somebody<br />- (từ lóng) mê ai, phải lòng ai, say ai<br />!over all<br />- từ bên này đến bên kia, bao quát<br />!over our heads<br />- khó quá chúng tôi không hiểu được<br />- vượt qua đầu chúng tôi, không hỏi ý kiến chúng tôi<br />!over head and ears in love<br />- yêu say đắm<br />!over shoes over boots<br />- (xem) boot<br />!over the top<br />- nhảy lên (hào giao thông) để công kích<br />!to go to sleep over one''s work<br />- đi ngủ mà còn suy nghĩ đến công việc<br />!to have a talk over a cup of tea<br />- nói chuyện trong khi uống trà<br />*  phó từ<br />- nghiêng, ngửa<br />=to lean over+ tỳ nghiêng (qua)<br />=to fall over+ ngã ngửa<br />- qua, sang<br />=to jump over+ nhảy qua<br />=to look over+ nhìn qua (sang bên kia)<br />=to ask somebody over+ mời ai qua chơi<br />=he is going over to the Soviet Union+ anh ấy đang đi Liên-xô<br />=please turn over+ đề nghị lật sang trang sau<br />=to turn somebody over on his face+ lật sấp ai xuống<br />=to go over to the people''s side+ đi sang phía nhân dân<br />- khắp, khắp chỗ, khắp nơi<br />=to paint it over+ sơn khắp chỗ<br />- ngược<br />=to bend something over+ bẻ ngược cái gì, gấp ngược cái gì<br />- lần nữa, lại<br />=the work is badly done, it must be done over+ công việc làm không tốt, phải làm lại<br />- quá, hơn<br />=over anxious+ quá lo lắng<br />= 20kg and over+ hơn 20 kg<br />- từ đầu đến cuối, kỹ lưỡng, cẩn thận<br />=to count over+ đếm đi đếm lại cẩn thận<br />=to think a matter over+ nghĩ cho chín một vấn đề<br />- qua, xong, hết<br />=time is over+ đã hết giờ<br />!all over<br />- (xem) all<br />!over again<br />- lại nữa<br />!over against<br />- đối lập với<br />!over and above<br />- (xem) above<br />!over and over [again]<br />- nhiều lần lặp đi lặp lại<br />*  danh từ<br />- cái thêm vào, cái vượt quá<br />- (từ Mỹ,nghĩa Mỹ),  (quân sự) phát đạn nổ quá mục tiêu<br />*  tính từ<br />- cao hơn<br />- ở ngoài hơn<br />- nhiều hơn, quá<br />- qua, xong hết<br /><br />@over<br />- trên, quá</Q></N></I></F></C>'),
