(85061, 'Over the counter market', '<C><F><I><N><Q>@Over the counter market<br />- (Econ) Thị trường không nơi giao dịch.<br />+ Là một thị trường cổ phiếu, phần lớn của các công ty loại nhỏ, được phân biệt bằng thực tế là thị trường này không có trụ sở giao dịch; việc mua bán được thu xếp bằng viễn thông, mặc dù khách hàng có thể mua bán cổ phiếu ngay trên bàn làm việc của mình.</Q></N></I></F></C>'),
