(85073, 'overall', '<C><F><I><N><Q>@overall /''ouvərɔ:l/<br />*  tính từ<br />- toàn bộ, toàn thể, từ đầu này sang đầu kia<br />=an overall view+ quang cảnh toàn thể<br />=an overall solution+ giải pháp toàn bộ<br />*  danh từ<br />- áo khoác, làm việc<br />- (số nhiều) quần yếm (quần may liền với miếng che ngực của công nhân)<br />- (quân sự) (số nhiều) quần chật ống (của sĩ quan)<br /><br />@overall<br />- khắp cả</Q></N></I></F></C>'),
