(85549, 'Overshooting', '<C><F><I><N><Q>@Overshooting<br />- (Econ) Tăng quá cao (tỷ giá hối đoái).<br />+ Dưới chế độ TỶ GIÁ HỐI ĐOÁI LINH HOẠT, đó là hiện tượng được thấy thường xuyên để phản ứng lại một cơn sốc của giá trị thực tế của tỷ giá hối đoái vượt quá giá trị cân bằng mới khi mà giá trị này được xác định dựa vào các nguyên tắc cơ bản chẳng hạn như sự ngang bằng sức mua.</Q></N></I></F></C>'),
