(85794, 'own', '<C><F><I><N><Q>@own /oun/<br />*  tính từ<br />- của chính mình, của riêng mình<br />=I saw it with my own eyes+ chính mắt tôi trông thấy<br />=I have nothing of my own+ tôi chẳng có cái gì riêng cả<br />!on one''s own<br />- độc lập cho bản thân mình; tự mình chịu trách nhiệm; với phương tiện của bản thân mình<br />=to do something on one''s own+ làm việc gì tự ý mình<br />!to be one''s own man<br />- (xem) man<br />!to get one''s own back<br />- (thông tục) trả thù<br />!to hold one''s own<br />- giữ vững vị trí, giữ vững lập trường<br />- chẳng kém ai, có thể đối địch được với người<br />*  ngoại động từ<br />- có, là chủ của<br />=to own something+ có cái gì<br />- nhận, nhìn nhận; thừa nhận là có, thừa nhận là đúng, cam tâm nhận (sự thống trị...)<br />=he owns his deficiencies+ anh ta nhận những thiếu sót của anh ta<br />=to own oneself indebted+ thừa nhận là có hàm ơn<br />*  nội động từ<br />- thú nhận, đầu thú<br />=to own to having done something+ thú nhận là đã làm việc gì<br />!to own up<br />- (thông tục) thú, thú nhận<br /><br />@own<br />- riêng // cơ sở hữu</Q></N></I></F></C>'),
