(85958, 'p o', '<C><F><I><N><Q>@po /pou/<br />*  danh từ,  số nhiều pos  /pouz/<br />- muấy áu át[poutʃ]<br />*  ngoại động từ<br />- bỏ vô chần nước sôi; chần nước sôi (trứng)<br />*  ngoại động từ<br />- (+ into) thọc, đâm (gậy, ngón tay... vào cái gì)<br />- giẫm nát (cỏ...); giẫm lầy (đất...) (ngựa...)<br />- săn trộm, câu trộm<br />=to po hares+ săn trộm thỏ rừng<br />- xâm phạm (tài sản người khác)<br />- (thể dục,thể thao) đánh (bóng quần vợt) lấn phần sân đồng đội<br />- dở ngón ăn gian để đạt (thắng lợi trong cuộc đua...)<br />*  nội động từ<br />- bị giẫm lầy (đất)<br />- săn trộm, câu trộm (ở khu vực cấm...)<br />- xâm phạm<br />=to po on a neighbour''s land+ xâm phạm đất đai của người bên cạnh<br />- (thể dục,thể thao) đánh bóng lấn phần sân đồng đội (quần vợt)<br />- dở ngón ăn gian (trong cuộc chạy đua...)</Q></N></I></F></C>'),
