(85966, 'pace', '<C><F><I><N><Q>@pace /peis/<br />*  danh từ<br />- bước chân, bước<br />- bước đi; nhịp đi; tốc độ đi, tốc độ chạy<br />=to go at a foat''s (walking) pace+ đi từng bước<br />=to go at a quick pace+ đi rảo bước, đi nhanh<br />- nước đi (của ngựa); cách đi<br />- nước kiệu (ngựa)<br />- nhịp độ tiến triển, tốc độ tiến triển<br />!to go the pace<br />- đi nhanh<br />- ăn chơi, phóng đãng<br />!to hold (keep) pace with<br />- theo kịp, sánh kịp<br />!to mend one''s pace<br />- (xem) mend<br />!to put someone through his paces<br />- thử tài ai, thử sức ai<br />- cho ai thi thố tài năng<br />!to set the pace<br />- dẫn tốc độ; chỉ đạo tốc độ (trong chạy đua)<br />- nêu gương cho (ai) theo<br />- tiên tiến nhất, thành công vượt bực<br />*  nội động từ<br />- đi từng bước, bước từng bước<br />=to pace up and down+ đi bách bộ, đi đi lại lại<br />- chạy nước kiệu (ngựa)<br />*  ngoại động từ<br />- bước từng bước qua, đi đi lại lại; đo bằng bước chân<br />=to pace the room+ đi đi lại lại trong phòng; đo gian phòng bằng bước chân<br />- dẫn tốc độ; chỉ đạo tốc độ (trong chạy đua)<br />*  danh từ<br />- mạn phép, xin lỗi (khi không đồng ý)<br />=pace Smith+ xin lỗi ông Xmít; xin mạn phép ông Xmít</Q></N></I></F></C>'),
