(86018, 'pacifying', '<C><F><I><N><Q>@pacify /''pæsifai/<br />*  ngoại động từ<br />- bình định; dẹp yên<br />- làm yên, làm nguôi (cơn giận...)</Q></N></I></F></C>'),
(86019, 'pacing', '<C><F><I><N><Q>@pace /peis/<br />*  danh từ<br />- bước chân, bước<br />- bước đi; nhịp đi; tốc độ đi, tốc độ chạy<br />=to go at a foat''s (walking) pace+ đi từng bước<br />=to go at a quick pace+ đi rảo bước, đi nhanh<br />- nước đi (của ngựa); cách đi<br />- nước kiệu (ngựa)<br />- nhịp độ tiến triển, tốc độ tiến triển<br />!to go the pace<br />- đi nhanh<br />- ăn chơi, phóng đãng<br />!to hold (keep) pace with<br />- theo kịp, sánh kịp<br />!to mend one''s pace<br />- (xem) mend<br />!to put someone through his paces<br />- thử tài ai, thử sức ai<br />- cho ai thi thố tài năng<br />!to set the pace<br />- dẫn tốc độ; chỉ đạo tốc độ (trong chạy đua)<br />- nêu gương cho (ai) theo<br />- tiên tiến nhất, thành công vượt bực<br />*  nội động từ<br />- đi từng bước, bước từng bước<br />=to pace up and down+ đi bách bộ, đi đi lại lại<br />- chạy nước kiệu (ngựa)<br />*  ngoại động từ<br />- bước từng bước qua, đi đi lại lại; đo bằng bước chân<br />=to pace the room+ đi đi lại lại trong phòng; đo gian phòng bằng bước chân<br />- dẫn tốc độ; chỉ đạo tốc độ (trong chạy đua)<br />*  danh từ<br />- mạn phép, xin lỗi (khi không đồng ý)<br />=pace Smith+ xin lỗi ông Xmít; xin mạn phép ông Xmít</Q></N></I></F></C>'),
(86020, 'pack', '<C><F><I><N><Q>@pack /pæk/<br />*  danh từ<br />- bó, gói; ba lô (quần áo)<br />- đàn, bầy (chó săn, chó sói...)<br />=pack of wolves+ bầy chó sói<br />=pack of grouse+ đàn gà gô trắng<br />=pack of U-boats+ một đội tàu ngầm Đức<br />- lũ, loạt, lô<br />=a pack of fools+ một lũ ngốc<br />=a pack of lies+ một loạt những lời nói láo<br />=a pack of troubles+ một lô rắc rối phiền hà<br />- bộ, cỗ (bài)<br />- (thương nghiệp) kiện (hàng); khối lượng hàng (cá, hoa quả...) đóng gói trong một vụ; phương pháp đóng gói hàng<br />- (thể dục,thể thao) hàng tiền đạo (bóng, bầu dục)<br />- đám băng nổi ((cũng) pack ice)<br />- (y học) khăn ướt để đắp, mền ướt để cuốn (người); sự đắp khăn ướt, sự cuốn mền ướt (vào người)<br />- lượt đắp (kem đắp vào mặt cho mịn da...)<br />*  ngoại động từ<br />- gói, bọc lại, buộc lại; đóng gói, đóng hộp, đóng kiện<br />- tập hợp lại thành bầy (chó); sắp thành bộ, sắp thành cỗ (bài)<br />- xếp chặt (vào hòm, hộp); ních người (vào phòng, xe)<br />=to pack a bag with old clothes+ xếp quần áo cũ vào bị<br />=the car was packed with passangers+ xe chật ních hành khách<br />- thồ hàng lên (ngựa, súc vật...)<br />- nhét, hàn, gắn (khe hở)<br />- (y học) đắp khăn ướt lên, cuốn mền ướt vào (người)<br />- xếp người phe mình (vào hội đồng giám khảo...) để chiếm đa số khi quyết định<br />- (thể dục,thể thao),  (từ lóng) nện, giáng<br />=to pack a punch+ nện một quả đấm (quyền Anh)<br />*  nội động từ<br />- ((thường) + up) sắp xếp hành lý<br />- đóng gói, đóng kiện<br />=dry food packs easity+ thực phẩm khô để đóng gói<br />- tụ tập thành bầy, tụ tập thành đàn<br />- khăn gói ra đi, cuốn gói<br />=to send somebody packing+ đuổi ai đi, tống cổ ai đi<br />!to pack off<br />- tống tiền (ai), cho (ai) đi xa, tống cổ (ai) đi<br />- khăn gói ra đi, cuốn gói<br />!to pack it in<br />- (từ lóng) làm xong, hoàn thành<br />!to pack it up<br />- (từ lóng) thôi ngừng<br />!to pack up<br />- (từ lóng) không chạy, chết máy, không nổ (máy...)<br /><br />@pack<br />- bó; khối; (lý thuyết trò chơi) cỗ bài<br />- ap. of cards cỗ bài</Q></N></I></F></C>'),
(86021, 'pack-animal', '<C><F><I><N><Q>@pack-animal /''pæk,æniməl/<br />*  danh từ<br />- súc vật thồ</Q></N></I></F></C>'),
