(86033, 'packable', '<C><F><I><N><Q>@packable<br />- xem pack</Q></N></I></F></C>'),
(86034, 'package', '<C><F><I><N><Q>@package /''pækidʤ/<br />*  danh từ<br />- gói đồ; kiện hàng; hộp để đóng hàng<br />- sự đóng gói hàng<br />- (từ Mỹ,nghĩa Mỹ) chương trình quảng cáo hoàn chỉnh (trên đài truyền thanh, đài truyền hình)<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) món<br />=that girl is a pretty package+ cô ả kia là một món xinh<br />*  ngoại động từ<br />- đóng gói, đóng kiện, xếp vào bao bì<br />- (từ Mỹ,nghĩa Mỹ) trình bày và sản xuất bao bì cho (một thứ hàng)<br />- (từ Mỹ,nghĩa Mỹ) kết hợp (gộp) (các bộ phận) thành một đơn vị<br /><br />@package<br />- (máy tính) khối</Q></N></I></F></C>'),
