(86042, 'packaging', '<C><F><I><N><Q>@packaging<br />* danh từ<br />- bao bì</Q></N></I></F></C><C><F><I><N><Q>@package /''pækidʤ/<br />*  danh từ<br />- gói đồ; kiện hàng; hộp để đóng hàng<br />- sự đóng gói hàng<br />- (từ Mỹ,nghĩa Mỹ) chương trình quảng cáo hoàn chỉnh (trên đài truyền thanh, đài truyền hình)<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) món<br />=that girl is a pretty package+ cô ả kia là một món xinh<br />*  ngoại động từ<br />- đóng gói, đóng kiện, xếp vào bao bì<br />- (từ Mỹ,nghĩa Mỹ) trình bày và sản xuất bao bì cho (một thứ hàng)<br />- (từ Mỹ,nghĩa Mỹ) kết hợp (gộp) (các bộ phận) thành một đơn vị<br /><br />@package<br />- (máy tính) khối</Q></N></I></F></C>'),
(86043, 'packed', '<C><F><I><N><Q>@packed<br />* tính từ<br />- nhồi nhét<br />= an action packed story+một câu chuyện nhồi nhét hành động<br />- đầu tràn</Q></N></I></F></C><C><F><I><N><Q>@pack /pæk/<br />*  danh từ<br />- bó, gói; ba lô (quần áo)<br />- đàn, bầy (chó săn, chó sói...)<br />=pack of wolves+ bầy chó sói<br />=pack of grouse+ đàn gà gô trắng<br />=pack of U-boats+ một đội tàu ngầm Đức<br />- lũ, loạt, lô<br />=a pack of fools+ một lũ ngốc<br />=a pack of lies+ một loạt những lời nói láo<br />=a pack of troubles+ một lô rắc rối phiền hà<br />- bộ, cỗ (bài)<br />- (thương nghiệp) kiện (hàng); khối lượng hàng (cá, hoa quả...) đóng gói trong một vụ; phương pháp đóng gói hàng<br />- (thể dục,thể thao) hàng tiền đạo (bóng, bầu dục)<br />- đám băng nổi ((cũng) pack ice)<br />- (y học) khăn ướt để đắp, mền ướt để cuốn (người); sự đắp khăn ướt, sự cuốn mền ướt (vào người)<br />- lượt đắp (kem đắp vào mặt cho mịn da...)<br />*  ngoại động từ<br />- gói, bọc lại, buộc lại; đóng gói, đóng hộp, đóng kiện<br />- tập hợp lại thành bầy (chó); sắp thành bộ, sắp thành cỗ (bài)<br />- xếp chặt (vào hòm, hộp); ních người (vào phòng, xe)<br />=to pack a bag with old clothes+ xếp quần áo cũ vào bị<br />=the car was packed with passangers+ xe chật ních hành khách<br />- thồ hàng lên (ngựa, súc vật...)<br />- nhét, hàn, gắn (khe hở)<br />- (y học) đắp khăn ướt lên, cuốn mền ướt vào (người)<br />- xếp người phe mình (vào hội đồng giám khảo...) để chiếm đa số khi quyết định<br />- (thể dục,thể thao),  (từ lóng) nện, giáng<br />=to pack a punch+ nện một quả đấm (quyền Anh)<br />*  nội động từ<br />- ((thường) + up) sắp xếp hành lý<br />- đóng gói, đóng kiện<br />=dry food packs easity+ thực phẩm khô để đóng gói<br />- tụ tập thành bầy, tụ tập thành đàn<br />- khăn gói ra đi, cuốn gói<br />=to send somebody packing+ đuổi ai đi, tống cổ ai đi<br />!to pack off<br />- tống tiền (ai), cho (ai) đi xa, tống cổ (ai) đi<br />- khăn gói ra đi, cuốn gói<br />!to pack it in<br />- (từ lóng) làm xong, hoàn thành<br />!to pack it up<br />- (từ lóng) thôi ngừng<br />!to pack up<br />- (từ lóng) không chạy, chết máy, không nổ (máy...)<br /><br />@pack<br />- bó; khối; (lý thuyết trò chơi) cỗ bài<br />- ap. of cards cỗ bài</Q></N></I></F></C>'),
(86044, 'packer', '<C><F><I><N><Q>@packer /''pækə/<br />*  danh từ<br />- người gói hàng; máy gói hàng<br />- người đóng đồ hộp<br />- (từ Mỹ,nghĩa Mỹ) người khuân vác; người tải hàng bằng sức vật thồ</Q></N></I></F></C>'),
(86045, 'packers', '<C><F><I><N><Q>@packer /''pækə/<br />*  danh từ<br />- người gói hàng; máy gói hàng<br />- người đóng đồ hộp<br />- (từ Mỹ,nghĩa Mỹ) người khuân vác; người tải hàng bằng sức vật thồ</Q></N></I></F></C>'),
(86046, 'packet', '<C><F><I><N><Q>@packet /''pækit/<br />*  danh từ<br />- gói nhỏ<br />=a packet of cigarettes+ gói thuốc lá<br />- tàu chở thư ((cũng) packet boat)<br />- (từ lóng) món tiền được cuộc; món tiền thua cuộc (đánh cuộc, đánh đổ...)<br />- (từ lóng) viên đạn<br />=to catch (stop) a packet+ bị ăn đạn</Q></N></I></F></C>'),
