(86052, 'packing', '<C><F><I><N><Q>@packing /''pækiɳ/<br />*  danh từ<br />- sự gói đồ, sự đóng kiện, sự đóng gói, sự xếp hàng vào bao bì<br />- bao bì<br />- sự xếp chặt, sự ních vào<br />- sự thồ, sự khuân vác; sự chất hàng (lên lưng súc vật thồ)<br />- (từ Mỹ,nghĩa Mỹ) sự gắn kín, sự nhét kín, sự đệm kín<br />- vật liệu để gắn kín, vật liệu để nhét kín, vật liệu để đệm kín<br />- (y học) sự đắp bằng khăn ướt, sự cuốn bằng mền ướt<br /><br />@packing<br />- sự hợp lại<br />- o. of orders (máy tính) hợp các lệnh</Q></N></I></F></C><C><F><I><N><Q>@pack /pæk/<br />*  danh từ<br />- bó, gói; ba lô (quần áo)<br />- đàn, bầy (chó săn, chó sói...)<br />=pack of wolves+ bầy chó sói<br />=pack of grouse+ đàn gà gô trắng<br />=pack of U-boats+ một đội tàu ngầm Đức<br />- lũ, loạt, lô<br />=a pack of fools+ một lũ ngốc<br />=a pack of lies+ một loạt những lời nói láo<br />=a pack of troubles+ một lô rắc rối phiền hà<br />- bộ, cỗ (bài)<br />- (thương nghiệp) kiện (hàng); khối lượng hàng (cá, hoa quả...) đóng gói trong một vụ; phương pháp đóng gói hàng<br />- (thể dục,thể thao) hàng tiền đạo (bóng, bầu dục)<br />- đám băng nổi ((cũng) pack ice)<br />- (y học) khăn ướt để đắp, mền ướt để cuốn (người); sự đắp khăn ướt, sự cuốn mền ướt (vào người)<br />- lượt đắp (kem đắp vào mặt cho mịn da...)<br />*  ngoại động từ<br />- gói, bọc lại, buộc lại; đóng gói, đóng hộp, đóng kiện<br />- tập hợp lại thành bầy (chó); sắp thành bộ, sắp thành cỗ (bài)<br />- xếp chặt (vào hòm, hộp); ních người (vào phòng, xe)<br />=to pack a bag with old clothes+ xếp quần áo cũ vào bị<br />=the car was packed with passangers+ xe chật ních hành khách<br />- thồ hàng lên (ngựa, súc vật...)<br />- nhét, hàn, gắn (khe hở)<br />- (y học) đắp khăn ướt lên, cuốn mền ướt vào (người)<br />- xếp người phe mình (vào hội đồng giám khảo...) để chiếm đa số khi quyết định<br />- (thể dục,thể thao),  (từ lóng) nện, giáng<br />=to pack a punch+ nện một quả đấm (quyền Anh)<br />*  nội động từ<br />- ((thường) + up) sắp x