(86071, 'pad', '<C><F><I><N><Q>@pad /pæd/<br />*  danh từ<br />- (từ lóng) đường cái<br />=gentleman (knight, squire) of the pad+ kẻ cướp đường<br />- ngựa dễ cưỡi ((cũng) pad nag)<br />*  động từ<br />- đi chân, cuốc bộ<br />=to pad it; to pad the hoof+ (từ lóng) cuốc bộ<br />*  danh từ<br />- cái đệm, cái lót; yên ngựa có đệm<br />- tập giấy thấm; tập giấy (viết, vẽ)<br />- lõi hộp mực đóng dấu<br />- cái đệm ống chân (chơi bóng gậy cong...)<br />- gan bàn chân (loài vật); bàn chân (thỏ, cáo...)<br />*  ngoại động từ<br />- đệm, lót, độn (áo...)<br />- ((thường) + out) nhồi nhét những thứ thừa (đầy câu, đầy sách...)<br />=to pad a sentence out+ nhồi nhét những thứ thừa đầy câu<br />!padded cell<br />- buồng có tường lót đệm (để nhốt người điên)<br />*  danh từ<br />- giỏ (dùng làm đơn vị đo lường)<br />*  danh từ<br />- (từ Mỹ,nghĩa Mỹ),  (từ lóng) ổ ăn chơi; tiệm hút</Q></N></I></F></C>'),
