(86193, 'paid', '<C><F><I><N><Q>@paid /pei/<br />*  ngoại động từ paid  /peid/<br />- trả (tiền lương...); nộp, thanh toán<br />=to high wages+ trả lương cao<br />=to pay somebody+ trả tiền ai<br />=to pay a sum+ trả một số tiền<br />=to pay one''s debt+ trả nợ, thanh toán nợ<br />=to pay taxes+ nộp thuế<br />- (nghĩa bóng) trả công, thưởng, đền đáp lại<br />- dành cho; đến (thăm...); ngỏ (lời khen...)<br />=to pay a visit+ đến thăm<br />=to pay one''s respects to someone+ đến chào ai<br />=to pay someone a compliment+ ngỏ lời khen ngợi, ca tụng ai<br />=to pay attention to+ chú ý tới<br />- cho (lãi...), mang (lợi...)<br />=it pays six per cent+ món đó cho sáu phần trăm lãi<br />*  nội động từ<br />- trả tiền<br />- (+ for) (nghĩa bóng) phải trả giá đắt, phải chịu hậu quả<br />=he shall pay for it+ hắn sẽ phải trả giá đắt về việc đó<br />- có lợi; mang lợi, sinh lợi<br />=this concern does not pay+ công việc kinh doanh chẳng lợi lộc gì<br />!to pay away<br />- trả hết, thanh toán, trang trải<br />- (hàng hải) thả (dây chuyền...)<br />!to pay back<br />- trả lại, hoàn lại<br />!to pay down<br />- trả tiền mặt<br />!to pay in<br />- nộp tiền<br />!to pay off<br />- thanh toán, trang trải<br />- trả hết lương rồi cho thôi việc<br />- giáng trả, trả đũa, trả thù<br />- cho kết quả, mang lại kết quả<br />- (hàng hải) đi né về phía dưới gió (tàu, thuyền)<br />!to pay out<br />- (như) to pay away<br />- trả thù, trừng phạt (ai)<br />!to pay up<br />- trả hết, thanh toán, trang trải, xuỳ tiền ra<br />!to pay someone in his own coin<br />- (xem) coin<br />!to pay through the nose<br />- (xem) nose<br />!he who pays the piper calls the tume<br />- ai trả tiền thì người ấy có quyền<br />!to pay one''s way<br />- không mang công việc mắc nợ<br />!to pay for one''s whistle<br />- phải trả giá đắt về cái tính ngông cuồng của mình<br />*  ngoại động từ<br />- sơn, quét hắc ín</Q></N></I></F></C><C><F><I><N><Q>@pay /pei/<br />*  ngoại động từ paid  /peid/<br />- trả (tiền lương...); nộp, thanh toán<br />=to high wages+ trả lương cao<br />=to pay somebody+ trả tiền ai<br />=to pay a sum+ trả một số tiền<br />=to pay one''s debt+ trả nợ, thanh toán nợ<br />=to pay taxes+ nộp thuế<br />- (nghĩa bóng) trả công, thưởng, đền đáp lại<br />- dành cho; đến (thăm...); ngỏ (lời khen...)<br />=to pay a visit+ đến thăm<br />=to pay one''s respects to someone+ đến chào ai<br />=to pay someone a compliment+ ngỏ lời khen ngợi, ca tụng ai<br />=to pay attention to+ chú ý tới<br />- cho (lãi...), mang (lợi...)<br />=it pays six per cent+ món đó cho sáu phần trăm lãi<br />*  nội động từ<br />- trả tiền<br />- (+ for) (nghĩa bóng) phải trả giá đắt, phải chịu hậu quả<br />=he shall pay for it+ hắn sẽ phải trả giá đắt về việc đó<br />- có lợi; mang lợi, sinh lợi<br />=this concern does not pay+ công việc kinh doanh chẳng lợi lộc gì<br />!to pay away<br />- trả hết, thanh toán, trang trải<br />- (hàng hải) thả (dây chuyền...)<br />!to pay back<br />- trả lại, hoàn lại<br />!to pay down<br />- trả tiền mặt<br />!to pay in<br />- nộp tiền<br />!to pay off<br />- thanh toán, trang trải<br />- trả hết lương rồi cho thôi việc<br />- giáng trả, trả đũa, trả thù<br />- cho kết quả, mang lại kết quả<br />- (hàng hải) đi né về phía dưới gió (tàu, thuyền)<br />!to pay out<br />- (như) to pay away<br />- trả thù, trừng phạt (ai)<br />!to pay up<br />- trả hết, thanh toán, trang trải, xuỳ tiền ra<br />!to pay someone in his own coin<br />- (xem) coin<br />!to pay through the nose<br />- (xem) nose<br />!he who pays the piper calls the tume<br />- ai trả tiền thì người ấy có quyền<br />!to pay one''s way<br />- không mang công việc mắc nợ<br />!to pay for one''s whistle<br />- phải trả giá đắt về cái tính ngông cuồng của mình<br />*  ngoại động từ<br />- sơn, quét hắc ín<br /><br />@pay<br />- trả, trả giá p. in thu vào; p. off trả tiền; p. out trả (tiền)</Q></N></I></F></C>'),
(86194, 'paid-up', '<C><F><I><N><Q>@paid-up<br />* tính từ<br />- đã trả tiền thù lao cần thiết (để trở thành thành viên của tổ chức)</Q></N></I></F></C>'),
