(86205, 'pain', '<C><F><I><N><Q>@pain /pein/<br />*  danh từ<br />- sự đau đớn, sự đau khổ (thể chất, tinh thần)<br />=to have a pain in the head+ đau đầu<br />- (số nhiều) sự đau đẻ<br />- (số nhiều) nỗi khó nhọc công sức<br />=to take pains+ bỏ công sức<br />- hình phạt<br />=pains and penalties+ các hình phạt<br />=on (under) pain of death+ sẽ bị xử tử, sẽ bị tội chết (nếu vi phạm cái gì...)<br />!to be at the pains of doing something<br />- chịu thương chịu khó làm cái gì<br />!to give someone a pain in the neck<br />- quấy rầy ai, chọc tức ai<br />*  ngoại động từ<br />- làm đau đớn, làm đau khổ<br />=does your tooth pain you?+ răng anh có làm anh đau không?<br />*  nội động từ<br />- đau nhức, đau đớn<br />=my arm is paining+ tay tôi đang đau nhức đây</Q></N></I></F></C>'),
