(86219, 'paint', '<C><F><I><N><Q>@paint /peint/<br />*  danh từ<br />- sơn<br />- thuốc màu<br />- phấn (bôi má)<br />!as pretty (smart) as paint<br />- đẹp như vẽ<br />*  ngoại động từ<br />- sơn, quét sơn<br />=to paint a door green+ sơn cửa màu lục<br />- vẽ, tô vẽ, mô tả<br />=to paint a landscope+ vẽ phong cảnh<br />=to paint a black (rosy) picture of+ bôi đen (tô hồng)<br />- đánh phấn<br />*  nội động từ<br />- vẽ tranh<br />- thoa phấn<br />!to paint in<br />- ghi bằng sơn<br />!to paint out<br />- sơn phủ lên, lấy sơn quét lấp đi<br />!to panin in bright colours<br />- vẽ màu tươi, vẽ màu sáng; (nghĩa bóng) tô hồng (sự việc gì)<br />!to pain the lily<br />- mặc thêm là lượt cho phò mã (làm một việc thừa)<br />!to paint the town red<br />- (xem) town</Q></N></I></F></C>'),
