(86240, 'pair', '<C><F><I><N><Q>@pair /peə/<br />*  danh từ<br />- đôi, cặp<br />=a pair of gloves+ đôi găng tay<br />=pair of horses+ cặp ngựa<br />- cặp vợ chồng; đôi đực cái, đôi trống mái (loài vật)<br />- chiếc; cái (đồ vật có hai bộ phận)<br />=a pair of scissor+ cái kéo<br />=where is the pair to this sock?+ chiếc tất kia đâu rồi?<br />- (chính trị) cặp (nghị sĩ ở hai đảng đối lập thoả thuận cùng không bỏ phiếu); người kết đôi (một trong hai nghị sĩ ở hai đảng đối lạp thoả thuận cùng không bỏ phiếu)<br />=I cannot find a pair+ tôi không tìm được người kết đôi (trong việc bỏ phiếu)<br />!in pairs<br />- từng đôi, từng cặp<br />!pairs of stairs<br />!pair of steps<br />- cầu thang, tầng gác<br />!that is another pair of shoes<br />- đó lại là vấn đề khác<br />*  ngoại động từ<br />- ghép đôi, ghép cặp<br />- cho yêu nhau, cho lấy nhau (đôi trai gái)<br />*  nội động từ<br />- kết đôi, sánh cặp<br />- yêu nhau, lấy nhau (đôi trai gái); kết đôi với nhau (con đực con cái, con trống con mái)<br />!to pair off<br />- ghép từng đôi một; hợp thành từng đôi; kết đôi (trong việc thoả thuận không bỏ phiếu ở nghị trường)<br />!to pair off with<br />- (thông tục) kết duyên với<br /><br />@pair<br />- cặp // ghép đôi<br />- ap. of compasses compa<br />- admissible p. (tô pô) cặp chuẩn nhận được<br />- genarating p. (giải tích) cặp sinh (của hàm giải tích)<br />- line p. (hình học) cặp đường thẳng<br />- ordered p. (giải tích) cặp có thứ tự, cặp được sắp<br />- plane p. cặp mặt phẳng<br />- point p. cặp điểm<br />- triangulated p. (tô pô) cặp đã được tam giác hoá</Q></N></I></F></C>'),
