(86331, 'pale', '<C><F><I><N><Q>@pale /peil/<br />*  ngoại động từ<br />- làm rào bao quanh, quây rào<br />- làm tái đi, làm nhợt nhạt, làm xanh xám<br />*  nội động từ<br />- tái đi, nhợt nhạt, xanh xám<br />- (nghĩa bóng) lu mờ đi<br />=my work paled beside his+ công trình của tôi lu mờ đi bên cạnh công trình của anh ấy<br />*  tính từ<br />- tái, nhợt nhạt, xanh xám<br />=to be pale with fear+ sợ xanh mặt<br />=to look pale+ trông nhợt nhạt<br />=to turn pale+ tái đi<br />- nhợt (màu); lờ mờ, yếu ớt (ánh sáng)</Q></N></I></F></C>'),
