(86658, 'panel', '<C><F><I><N><Q>@panel /''pænl/<br />*  danh từ<br />- cán ô (cửa, tường),  panô; ô vải khác màu (trên quần áo đàn bà); mảnh da (cừu, dê... để viết)<br />- (pháp lý) danh sách hội thẩm; ban hội thẩm; (Ê-cốt) danh sách báo cáo; danh sách bác sĩ bảo hiểm (đăng ký nhận chữa bệnh nhân theo chế độ bảo hiểm ở Anh)<br />- nhóm người tham gia hội thảo, nhóm người tham gia tiết mục "trả lời câu đố" ... (ở đài phát thanh, đài truyền hình); cuộc hội thảo... (ở đài phát thanh, đài truyền hình...)<br />- Panô, bức tranh tấm, bức ảnh dài<br />- đệm yên ngựa; yên ngựa (không có cốt sắt)<br />- bảng,  panen<br />=distribution panel+ bảng phân phối<br />=control panel+ bảng điều khiển<br />=signal panel+ bảng tín hiệu!<br />*  ngoại động từ<br />- đóng ván ô, đóng panô (cửa, tường)<br />- may ô vải màu vào (quần áo)<br />- đóng yên (ngựa)<br /><br />@panel<br />- (máy tính) panen (để lắp ráp); bảng điều khiển; bảng dụng cụ; đế (đền)<br />- control p. bảng điều khiển <br />- main control p. bảng điểu khiển chính<br />- testing p. (máy tính) panen thử<br />- valve p. đế đền</Q></N></I></F></C>'),
