(87090, 'parallels', '<C><F><I><N><Q>@parallel /''pærəlel/<br />*  tính từ<br />- song song<br />=parallel to (with)+ song song với<br />- tương đương, tương tự, giống với, ngang hàng<br />=here is a parallel case+ đây là một trường hợp tương tự<br />*  danh từ<br />- đường song song<br />- đường vĩ, vĩ tuyến ((cũng) parallel of latitude)<br />=the 17th parallel+ vĩ tuyến 17<br />- (quân sự) đường hào ngang (song song với trận tuyến)<br />- người tương đương, vật tương đương<br />=without [a] parallel+ không ai (không gì) sánh bằng<br />- sự so sánh, sự tương đương<br />=to draw a parallel between two things+ so sánh hai vật<br />- (điện học) sự mắc song song<br />- dấu song song<br />*  ngoại động từ<br />- đặt song song với; tìm tương đương với; so sánh<br />=to parallel one thing with another+ so sánh vật này với vật kia<br />- song song với; tương đương với; ngang với, giống với<br />=the road parallels the river+ con đường chạy song song với con sông<br />- (điện học) mắc song song<br /><br />@parallel<br />- song song // đường song song; sự so sánh; vĩ tuyến<br />- p. of Clifford đường song song Clifơt<br />- p. of latitude (lý thuyết trò chơi) vĩ tuyến <br />- p.s of a surface of revolution các vĩ tuyến của một mặt tròn xoay<br />- geodesic p.s đường song song trắc địa</Q></N></I></F></C>'),
