(87121, 'parameter', '<C><F><I><N><Q>@parameter /pə''ræmitə/<br />*  danh từ<br />- (toán học) thông số, tham số, tham biến<br /><br />@parameter<br />- thông số, tham số<br />- p. of distribution tham số phân phối<br />- p. of location (thống kê) tham số vị trí<br />- age p. tham số tuổi, tham số tăng<br />- characteristic p. tham số đặc trưng<br />- conformal p. tham số bảo giác<br />- differential p. tham số vi phân<br />- dimensionless p. tham số không thứ nguyên<br />- direction p. tham số chỉ phương<br />- geodesic p. tham số trắc địa<br />- incidental p. (thống kê) các tham số không cốt yếu<br />- isometric p. tham số đẳng cự<br />- local p. (giải tích) tham số địa phương<br />- lumped p. (điều khiển học) tham số tập trung<br />- mean p. tham số trung bình<br />- mixed differential p. tham số vi phân hỗn tạp<br />- nuisance p. (thống kê) tham số trở ngại<br />- program(me) p. tham số chương trình<br />- statistic (al) p. tham số thống kê<br />- stray p. tham số parazit<br />- superfluous p. tham số thừa<br />- time-varying p. (điều khiển học) tham số thay đổi theo thời gian<br />- uniformizing p. tham số đơn trị hoá</Q></N></I></F></C>'),
