(87346, 'pares', '<C><F><I><N><Q>@pare /peə/<br />*  ngoại động từ<br />- cắt, gọt, đẽo, xén; xén bớt chỗ nham nhở<br />=to pare a fruit+ gọt vỏ quả<br />- ((thường) + away,  down) (nghĩa bóng) giảm dần, bớt dần, làm nhỏ dần<br />!to pare away (off)<br />- cắt đi, xén đi, gọt đi, cạo đi<br />!to pare to the quick<br />- gọt (móng tay...) sắt quá đến tận chỗ thấy đau</Q></N></I></F></C>'),
