(87349, 'Paretian Liberal, Impossibility of', '<C><F><I><N><Q>@Paretian Liberal, Impossibility of<br />- (Econ) Tính không thể của tự do Pareto.<br />+ Tên đặt cho một định lý do A.K.Sen trình bày. Định lý chứng minh rằng không thể có QUY TẮC QUYẾT ĐỊNH XÃ HỘI nào có thể đồng thời thoả mãn tiêu chuẩn Pareto và cho phép các cá nhân có những quyết định về một số vấn đề riêng tư mà không tính đến (bất kể) nguyện vọng của những người khác (tự do cá nhân).</Q></N></I></F></C>'),
(87350, 'paretic', '<C><F><I><N><Q>@paretic /pə''retik/<br />*  tính từ<br />- (y học) liệt nhẹ</Q></N></I></F></C>'),
(87351, 'paretics', '<C><F><I><N><Q>@paretic /pə''retik/<br />*  tính từ<br />- (y học) liệt nhẹ</Q></N></I></F></C>'),
(87352, 'Pareto conditions', '<C><F><I><N><Q>@Pareto conditions<br />- (Econ) Các điều kiện Pareto.<br />+ Một loạt các quy tắc đặt ra trong kinh tế học phúc lợi, nếu thực hiện được sẽ đưa đến một tối ưu Pareto.</Q></N></I></F></C>'),
(87353, 'Pareto criterion', '<C><F><I><N><Q>@Pareto criterion<br />- (Econ) Tiêu chuẩn Pareto.<br />+ Xem PARETO OPTIMUM.</Q></N></I></F></C>'),
(87354, 'Pareto efficiency of resource allocation', '<C><F><I><N><Q>@Pareto efficiency of resource allocation<br />- (Econ) Tính hiệu quả Pareto của phân bổ nguồn lực.</Q></N></I></F></C>'),
(87355, 'Pareto improvement', '<C><F><I><N><Q>@Pareto improvement<br />- (Econ) Sự cải thiện Pareto.<br />+ Một sự phân phối lại các nguồn lực làm cho ít nhất một người khá lên mà không làm cho bất cứ ai kém đi.</Q></N></I></F></C>'),
(87356, 'Pareto non-comparability', '<C><F><I><N><Q>@Pareto non-comparability<br />- (Econ) Tính không thể so sánh Pareto.<br />+ Một tình trạng xã hội mà một số cá nhân thích tình trạng này hơn và một số khác lại thích tình trạng kia hơn thì hai tình trạng này được coi là tình trạng không thể so sánh Pareto.</Q></N></I></F></C>'),
(87357, 'Pareto optimum', '<C><F><I><N><Q>@Pareto optimum<br />- (Econ) Tối ưu Pareto.<br />+ Khi các nguồn lực và sản lượng của một nền kinh tế được phân chia mà không có sự phân chia lại nào làm cho bất cứ ai khá lên mà cũng không là cho ít nhất là bất cứ một người nào khác kém đi thì lúc đó là có sự hiện hữu của một tối ưu Pareto.</Q></N></I></F></C>'),
(87358, 'Pareto-optional redistribution', '<C><F><I><N><Q>@Pareto-optional redistribution<br />- (Econ) Sự phân phối lại tối ưu theo Pareto.<br />+ Sự dịch chuyển thu nhập hoặc của cải từ một cá nhân này sang một cá nhân khác làm tăng độ thoả dụng, hoặc thoả mãn của cả người cho lẫn người nhận, do đó đem lại sự cải thiện Pareto.</Q></N></I></F></C>'),
(87359, 'Pareto-relevant externality', '<C><F><I><N><Q>@Pareto-relevant externality<br />- (Econ) Ngoại ứng liên quan đến Pareto.<br />+ Xem EXTENALITIES.</Q></N></I></F></C>'),
(87360, 'Pareto, Vilfredo', '<C><F><I><N><Q>@Pareto, Vilfredo<br />- (Econ) (1848 - 1923)<br />+ Nhà kinh tế học người Italia được đào tạo sâu về toán học, lý học và kỹ thuât. Pareto là người kế tục Leon Walras ở vị trí chủ nhiệm khoa kinh tế học ở trường đại học Lausanne năm 1892. Sư quan tâm đến việc ứng dụng toán học và thống kê học vào kinh tế của ông đã dẫn đến việc mở rộng các điêu kiện toán học cho hệ thống cân bằng tổng thể của Walras, từ đó thành lập một trường phái Lausanne rõ ràng. Trong giáo dục kinh tế chính trị học, ông nêu lên quan niệm là các điều kiên toán học của một hệ tống cân bằng tổng thể dựa trên sự phụ thuộc lẫn nhau của tất cả các đại lượng kinh tế. Ngoài việc nhấn mạnh vào bản chất chính của một khoa học học kinh tế thực chứng đã loại bỏ mọi yếu tố đạo đức, Pareto cũng bác bỏ chủ nghĩa xã hội trên các cơ sở chuẩn tắc và biện minh cho sự bất bình đẳng thu nhập dựa trên cơ sở của một sự bất biến giả định về phân phối thu nhập ở các nước và qua thời gian. (định luật Pareto).</Q></N></I></F></C>'),
