(87563, 'part', '<C><F><I><N><Q>@part /pɑ:t/<br />*  danh từ<br />- phần, bộ phận, tập (sách)<br />=[a] great part of this story is true+ phần lớn chuyện đó là đúng<br />=[a] part of them have arrived+ một số trong bọn họ đã đến<br />=3 parts of sugar, 5 of flour+ 3 phần đường, 5 phần bột<br />=spare parts of a machine+ phụ tùng của máy<br />- bộ phận cơ thể<br />=the [privy] parts+ chỗ kín (bộ phận sinh dục)<br />- phần việc, nhiệm vụ<br />=I have done my part+ tôi đã làm phần việc của tôi<br />=it was not my part to interfere+ tôi không có nhiệm vụ can thiệp vào<br />=to have neither part nor lot in+ không có dính dáng gì vào<br />- vai, vai trò; lời nói của một vai kịch; bản chép lời của một vai kịch<br />=her part was well+ vai chị ấy đóng giỏi<br />=they don''t know their parts yet+ họ không thuộc lời các vai của họ<br />=to play an important part in the negotiations+ giữ một vai quan trọng trong cuộc đàm phán<br />=to play a part+ (nghĩa bóng) đóng kịch, giả vờ<br />- (số nhiều) nơi, vùng<br />=I am a stranger in these parts+ tôi là một người lạ trong vùng này<br />- phía, bè<br />=to take someone''s part; to take part with someone+ đứng về phía ai, về bè với ai, ủng hộ ai<br />- (âm nhạc) bè<br />- (từ cổ,nghĩa cổ) tài năng<br />=a man of [good] part+ một người có tài<br />!for my part<br />- về phần tôi<br />!for the most part<br />- phần lớn, phần nhiều<br />!in part<br />- một phần, phần nào<br />!on one''s part; on the part of<br />- về phía<br />=there was no objection on his part+ anh ta không phản đối gì<br />=he apologized on the part of his young brother+ anh ấy xin lỗi hộ em anh ấy<br />!part and parcel<br />- (xem) parcel<br />!part of speech<br />- (ngôn ngữ học) loại từ<br />!to take someething in good part<br />- không chấp nhất điều gì; không phật ý về việc gì<br />!to take part in<br />- tham gia vào<br />*  ngoại động từ<br />- chia thành từng phần, chia làm đôi<br />- rẽ ra, tách ra, tách làm đôi<br />=to part the crowd+ rẽ đám đông ra<br />=to part one''s hair+ rẽ đường ngôi (tóc)<br />- (từ cổ,nghĩa cổ) phân phối, chia phần (cái gì)<br />*  nội động từ<br />- rẽ ra, tách ra, đứt<br />=the crowd parted anf let him through+ đám đông rẽ ra cho anh ấy đi<br />=the cord parted+ thừng đứt ra<br />- chia tay, từ biệt, ra đi<br />=they parted in joy+ họ hoan hỉ chia tay nhau<br />=let us part friends+ chúng ta hãy vui vẻ chia tay nhau<br />=to part from (with) somebody+ chia tay ai<br />- chết<br />- (+ with) bỏ, lìa bỏ<br />=to part with one''s property+ bỏ của cải<br />!to part brass rags with somebody<br />- (xem) brass<br />!to part company with<br />- cắt đắt quan hệ bầu bạn với<br />*  phó từ<br />- một phần<br />=it is made part of iron and part of wood+ cái đó làm một phần bằng sắt một phần bằng gỗ<br /><br />@part<br />- bộ phận, phần // chia thành phần<br />- aliquot p. ước số <br />- imaginaty p. phần ảo<br />- principal p. phần chính<br />- real p. phần thực</Q></N></I></F></C>'),
