(87572, 'part-timer', '<C><F><I><N><Q>@part-timer /,pɑ:t''taimə/<br />*  danh từ<br />- (thông tục) người chỉ có công ăn việc làm không trọn ngày công, người nửa thất nghiệp</Q></N></I></F></C>'),
(87573, 'partake', '<C><F><I><N><Q>@partake /pɑ:''teik/<br />*  ngoại động từ partook  /pɑ:''tuk/,  partaken  /pɑ:''teikn/<br />- tham dự, cùng có phần, cùng hưởng, cùng chia xẻ<br />*  nội động từ<br />- (+ in,  of,  with) cùng tham dự, cùng có phần, cùng hưởng, cùng chia sẻ<br />=to partake in (of) something+ cùng có phần cái gì, cùng hưởng cái gì<br />=to partake with somebody+ cùng tham dự với ai<br />- (+ of) ăn uống (một phần cái gì); (thông tục) hết cả cái gì<br />=he partook of our lowly fare+ anh ta cũng cùng ăn những thứ ăn nghèo nàn đạm bạc của chúng tôi<br />- có phần nào<br />=his manner partakes of insolence+ thái độ của hắn có phần nào láo xược</Q></N></I></F></C>'),
(87574, 'partaken', '<C><F><I><N><Q>@partaken /pɑ:''teik/<br />*  ngoại động từ partook  /pɑ:''tuk/,  partaken  /pɑ:''teikn/<br />- tham dự, cùng có phần, cùng hưởng, cùng chia xẻ<br />*  nội động từ<br />- (+ in,  of,  with) cùng tham dự, cùng có phần, cùng hưởng, cùng chia sẻ<br />=to partake in (of) something+ cùng có phần cái gì, cùng hưởng cái gì<br />=to partake with somebody+ cùng tham dự với ai<br />- (+ of) ăn uống (một phần cái gì); (thông tục) hết cả cái gì<br />=he partook of our lowly fare+ anh ta cũng cùng ăn những thứ ăn nghèo nàn đạm bạc của chúng tôi<br />- có phần nào<br />=his manner partakes of insolence+ thái độ của hắn có phần nào láo xược</Q></N></I></F></C><C><F><I><N><Q>@partake /pɑ:''teik/<br />*  ngoại động từ partook  /pɑ:''tuk/,  partaken  /pɑ:''teikn/<br />- tham dự, cùng có phần, cùng hưởng, cùng chia xẻ<br />*  nội động từ<br />- (+ in,  of,  with) cùng tham dự, cùng có phần, cùng hưởng, cùng chia sẻ<br />=to partake in (of) something+ cùng có phần cái gì, cùng hưởng cái gì<br />=to partake with somebody+ cùng tham dự với ai<br />- (+ of) ăn uống (một phần cái gì); (thông tục) hết cả cái gì<br />=he partook of our lowly fare+ anh ta cũng cùng ăn những thứ ăn nghèo nàn đạm bạc của chúng tôi<br />- có phần nào<br />=his manner partakes of insolence+ thái độ của hắn có phần nào láo xược</Q></N></I></F></C>'),
(87575, 'partaker', '<C><F><I><N><Q>@partaker /pɑ:''teikə/<br />*  danh từ<br />- người tham dự, người cùng có phần, người cùng chia sẻ<br />=a partaker in guilt+ kẻ đồng phạm</Q></N></I></F></C>'),
(87576, 'partakers', '<C><F><I><N><Q>@partaker /pɑ:''teikə/<br />*  danh từ<br />- người tham dự, người cùng có phần, người cùng chia sẻ<br />=a partaker in guilt+ kẻ đồng phạm</Q></N></I></F></C>'),
(87577, 'partakes', '<C><F><I><N><Q>@partake /pɑ:''teik/<br />*  ngoại động từ partook  /pɑ:''tuk/,  partaken  /pɑ:''teikn/<br />- tham dự, cùng có phần, cùng hưởng, cùng chia xẻ<br />*  nội động từ<br />- (+ in,  of,  with) cùng tham dự, cùng có phần, cùng hưởng, cùng chia sẻ<br />=to partake in (of) something+ cùng có phần cái gì, cùng hưởng cái gì<br />=to partake with somebody+ cùng tham dự với ai<br />- (+ of) ăn uống (một phần cái gì); (thông tục) hết cả cái gì<br />=he partook of our lowly fare+ anh ta cũng cùng ăn những thứ ăn nghèo nàn đạm bạc của chúng tôi<br />- có phần nào<br />=his manner partakes of insolence+ thái độ của hắn có phần nào láo xược</Q></N></I></F></C>'),
(87578, 'partaking', '<C><F><I><N><Q>@partake /pɑ:''teik/<br />*  ngoại động từ partook  /pɑ:''tuk/,  partaken  /pɑ:''teikn/<br />- tham dự, cùng có phần, cùng hưởng, cùng chia xẻ<br />*  nội động từ<br />- (+ in,  of,  with) cùng tham dự, cùng có phần, cùng hưởng, cùng chia sẻ<br />=to partake in (of) something+ cùng có phần cái gì, cùng hưởng cái gì<br />=to partake with somebody+ cùng tham dự với ai<br />- (+ of) ăn uống (một phần cái gì); (thông tục) hết cả cái gì<br />=he partook of our lowly fare+ anh ta cũng cùng ăn những thứ ăn nghèo nàn đạm bạc của chúng tôi<br />- có phần nào<br />=his manner partakes of insolence+ thái độ của hắn có phần nào láo xược</Q></N></I></F></C>'),
(87579, 'partan', '<C><F><I><N><Q>@partan /''pɑ:tn/<br />*  danh từ<br />- (Ê-cốt) con cua</Q></N></I></F></C>'),
(87580, 'parted', '<C><F><I><N><Q>@parted<br />- tính từ<br />- bị chia thành từng phần<br />- chẻ, xẻ sâu<br />- hé mở<br />= parted lips+đôi môi hé mở</Q></N></I></F></C><C><F><I><N><Q>@part /pɑ:t/<br />*  danh từ<br />- phần, bộ phận, tập (sách)<br />=[a] great part of this story is true+ phần lớn chuyện đó là đúng<br />=[a] part of them have arrived+ một số trong bọn họ đã đến<br />=3 parts of sugar, 5 of flour+ 3 phần đường, 5 phần bột<br />=spare parts of a machine+ phụ tùng của máy<br />- bộ phận cơ thể<br />=the [privy] parts+ chỗ kín (bộ phận sinh dục)<br />- phần việc, nhiệm vụ<br />=I have done my part+ tôi đã làm phần việc của tôi<br />=it was not my part to interfere+ tôi không có nhiệm vụ can thiệp vào<br />=to have neither part nor lot in+ không có dính dáng gì vào<br />- vai, vai trò; lời nói của một vai kịch; bản chép lời của một vai kịch<br />=her part was well+ vai chị ấy đóng giỏi<br />=they don''t know their parts yet+ họ không thuộc lời các vai của họ<br />=to play an important part in the negotiations+ giữ một vai quan trọng trong cuộc đàm phán<br />=to play a part+ (nghĩa bóng) đóng kịch, giả vờ<br />- (số nhiều) nơi, vùng<br />=I am a stranger in these parts+ tôi là một người lạ trong vùng này<br />- phía, bè<br />=to take someone''s part; to take part with someone+ đứng về phía ai, về bè với ai, ủng hộ ai<br />- (âm nhạc) bè<br />- (từ cổ,nghĩa cổ) tài năng<br />=a man of [good] part+ một người có tài<br />!for my part<br />- về phần tôi<br />!for the most part<br />- phần lớn, phần nhiều<br />!in part<br />- một phần, phần nào<br />!on one''s part; on the part of<br />- về phía<br />=there was no objection on his part+ anh ta không phản đối gì<br />=he apologized on the part of his young brother+ anh ấy xin lỗi hộ em anh ấy<br />!part and parcel<br />- (xem) parcel<br />!part of speech<br />- (ngôn ngữ học) loại từ<br />!to take someething in good part<br />- không chấp nhất điều gì; không phật ý về việc gì<br />!to take part in<br />- tham gia vào<br />*  ngoại động từ<br />- chia thành từng phần, chia làm đôi<br />- rẽ ra, tách ra, tách làm đôi<br />=to part the crowd+ rẽ đám đông ra<br />=to part one''s hair+ rẽ đường ngôi (tóc)<br />- (từ cổ,nghĩa cổ) phân phối, chia phần (cái gì)<br />*  nội động từ<br />- rẽ ra, tách ra, đứt<br />=the crowd parted anf let him through+ đám đông rẽ ra cho anh ấy đi<br />=the cord parted+ thừng đứt ra<br />- chia tay, từ biệt, ra đi<br />=they parted in joy+ họ hoan hỉ chia tay nhau<br />=let us part friends+ chúng ta hãy vui vẻ chia tay nhau<br />=to part from (with) somebody+ chia tay ai<br />- chết<br />- (+ with) bỏ, lìa bỏ<br />=to part with one''s property+ bỏ của cải<br />!to part brass rags with somebody<br />- (xem) brass<br />!to part company with<br />- cắt đắt quan hệ bầu bạn với<br />*  phó từ<br />- một phần<br />=it is made part of iron and part of wood+ cái đó làm một phần bằng sắt một phần bằng gỗ<br /><br />@part<br />- bộ phận, phần // chia thành phần<br />- aliquot p. ước số <br />- imaginaty p. phần ảo<br />- principal p. phần chính<br />- real p. phần thực</Q></N></I></F></C>'),
(87581, 'parterre', '<C><F><I><N><Q>@parterre /pɑ:''teə/<br />*  danh từ<br />- khu vực trước sân khấu<br />- bồn hoa (khoảng đất trồng hoa trong vườn)</Q></N></I></F></C>'),
(87582, 'parterres', '<C><F><I><N><Q>@parterre /pɑ:''teə/<br />*  danh từ<br />- khu vực trước sân khấu<br />- bồn hoa (khoảng đất trồng hoa trong vườn)</Q></N></I></F></C>'),
(87583, 'parthenocarpic', '<C><F><I><N><Q>@parthenocarpic<br />* tính từ<br />- thuộc quả không hạt, thuộc quả điếc</Q></N></I></F></C>'),
(87584, 'parthenocarpy', '<C><F><I><N><Q>@parthenocarpy<br />* danh từ<br />- (thực vật học) tính tạo quả không hạt</Q></N></I></F></C>'),
(87585, 'parthenogamy', '<C><F><I><N><Q>@parthenogamy<br />* danh từ<br />- (sinh vật học) sự tiếp hợp nhân đơn tính</Q></N></I></F></C>'),
(87586, 'parthenogeneses', '<C><F><I><N><Q>@parthenogenesis /''pɑ:θinou''dʤenisis/<br />*  danh từ<br />- (sinh vật học) sự sinh sản đơn tính</Q></N></I></F></C>'),
(87587, 'parthenogenesis', '<C><F><I><N><Q>@parthenogenesis /''pɑ:θinou''dʤenisis/<br />*  danh từ<br />- (sinh vật học) sự sinh sản đơn tính</Q></N></I></F></C>'),
(87588, 'parthenogenetic', '<C><F><I><N><Q>@parthenogenetic /''pa:θinoudʤi''netik/<br />*  tính từ<br />- (sinh vật học) sinh sản đơn tính</Q></N></I></F></C>'),
(87589, 'parthenogenetically', '<C><F><I><N><Q>@parthenogenetically<br />- xem parthenogenesis</Q></N></I></F></C>'),
(87590, 'parthian', '<C><F><I><N><Q>@parthian /''pɑ:θjən/<br />*  tính từ<br />- (thuộc) nước Pa-thi xưa (ở Tây-A)<br />!Parthian glance<br />- cái nhìn cuối cùng lúc ra đi<br />!Parthian shot (shaft, arrow)<br />- phát súng (mũi tên) bắn khi rút lui (khi vờ rút lui); kế đà đao<br />- (nghĩa bóng) lời cuối cùng nói lúc ra đi</Q></N></I></F></C>'),
(87591, 'parthian shot', '<C><F><I><N><Q>@parthian shot<br />* danh từ(Parthian shot)+phát súng (mũi tên) bắn khi rút lui (khi vờ rút lui); kế đà đao<br />- &lt;bóng&gt; lời nhận xét sắc sảo, đanh thép cuối cùng (của ai) lúc ra đi</Q></N></I></F></C>'),
(87592, 'parti', '<C><F><I><N><Q>@parti<br />* danh từ<br />- đám (trong hôn nhân)</Q></N></I></F></C>'),
(87593, 'parti pris', '<C><F><I><N><Q>@parti pris /pɑ:''ti:''pri:/<br />*  danh từ<br />- thiên kiến; định kiến</Q></N></I></F></C>'),
(87594, 'partiable', '<C><F><I><N><Q>@partiable /''pɑ:tibl/<br />*  tính từ<br />- có thể chia được (của thừa kế...)</Q></N></I></F></C>'),
(87595, 'partial', '<C><F><I><N><Q>@partial /''pɑ:ʃəl/<br />*  tính từ<br />- bộ phận; cục bộ<br />=a partial success+ thắng lợi cục bộ<br />- thiên vị; không công bằng<br />- (+ to) mê thích<br />=to be partial to sports+ mê thích thể thao<br /><br />@partial<br />- riêng, riêng phần; thiên vị</Q></N></I></F></C>'),
(87596, 'Partial adjustment', '<C><F><I><N><Q>@Partial adjustment<br />- (Econ) Điều chỉnh từng phần.<br />+ Một quá trình mà theo đó hành vi được điều chỉnh một cách không hoàn chỉnh hướng tới một mức mong muốn nào đó.</Q></N></I></F></C>'),
(87597, 'Partial derivative', '<C><F><I><N><Q>@Partial derivative<br />- (Econ) Đạo hàm riêng phần.<br />+ Trong các hàm số có hai biến số độc lập hay có nhiều hơn, đạo hàm này tính theo một trong những biến số này, trong khi coi các biến số độc lập khác là hằng số.</Q></N></I></F></C>'),
(87598, 'Partial equilibrium', '<C><F><I><N><Q>@Partial equilibrium<br />- (Econ) Cân bằng bộ phận.<br />+ Việc nghiên cứu thị trường cho một hàng hoá trong điều kiện tách biệt.</Q></N></I></F></C>'),
(87599, 'partialism', '<C><F><I><N><Q>@partialism<br />* danh từ<br />- thái độ thiên lệch, thái độ phiến diện, thái độ không công bằng</Q></N></I></F></C>'),
(87600, 'partialities', '<C><F><I><N><Q>@partiality /,pɑ:ʃi''æliti/<br />*  danh từ<br />- tính thiên vị, tính không công bằng<br />- sự mê thích</Q></N></I></F></C>'),
(87601, 'partiality', '<C><F><I><N><Q>@partiality /,pɑ:ʃi''æliti/<br />*  danh từ<br />- tính thiên vị, tính không công bằng<br />- sự mê thích</Q></N></I></F></C>'),
(87602, 'partially', '<C><F><I><N><Q>@partially<br />* phó từ<br />- không hoàn chỉnh; cục bộ, một phần<br />- một cách không vô tư; thiên vị</Q></N></I></F></C>'),
(87603, 'partialness', '<C><F><I><N><Q>@partialness<br />- xem partial</Q></N></I></F></C>'),
(87604, 'partibility', '<C><F><I><N><Q>@partibility<br />* danh từ<br />- tính chia được</Q></N></I></F></C>'),
