(87610, 'participate', '<C><F><I><N><Q>@participate /pɑ:''tisipeit/<br />*  động từ<br />- tham gia, tham dự; cùng góp phần<br />=to participate in something+ cùng góp phần vào cái gì<br />=to participate insomething+ cùng góp phần vào cái gì<br />=to participate with somebody+ cùng tham gia với ai<br />- (+ of) có phần nào, phần nào mang tính chất<br />=his poems participate of the nature of satire+ thơ của anh ta phần nào mang tính chất châm biếm</Q></N></I></F></C>'),
