(87620, 'participial', '<C><F><I><N><Q>@participial /,pɑ:ti''sipiəl/<br />*  tính từ<br />- (ngôn ngữ học) (thuộc) động tính từ</Q></N></I></F></C>'),
(87621, 'participially', '<C><F><I><N><Q>@participially<br />- xem participial</Q></N></I></F></C>'),
(87622, 'participle', '<C><F><I><N><Q>@participle /''pɑ:tsipl/<br />*  danh từ<br />- (ngôn ngữ học) động tính từ<br />=past participle+ động tính từ quá khứ<br />=present participle+ động tính từ hiện tại</Q></N></I></F></C>'),
(87623, 'participles', '<C><F><I><N><Q>@participle /''pɑ:tsipl/<br />*  danh từ<br />- (ngôn ngữ học) động tính từ<br />=past participle+ động tính từ quá khứ<br />=present participle+ động tính từ hiện tại</Q></N></I></F></C>'),
(87624, 'particle', '<C><F><I><N><Q>@particle /''pɑ:tikl/<br />*  danh từ<br />- chút, tí chút<br />=he has not a particle of sense+ nó không có một tí ý thức nào cả<br />- (ngôn ngữ học) tiểu từ không biến đổi; tiền tố, hậu tố<br />- (vật lý) hạt<br /><br />@particle<br />- hạt<br />- alpha p. hạt anpha<br />- fluid p. hạt chất lỏng<br />- relativistic p. hạt tương đối</Q></N></I></F></C>'),
(87625, 'particles', '<C><F><I><N><Q>@particle /''pɑ:tikl/<br />*  danh từ<br />- chút, tí chút<br />=he has not a particle of sense+ nó không có một tí ý thức nào cả<br />- (ngôn ngữ học) tiểu từ không biến đổi; tiền tố, hậu tố<br />- (vật lý) hạt<br /><br />@particle<br />- hạt<br />- alpha p. hạt anpha<br />- fluid p. hạt chất lỏng<br />- relativistic p. hạt tương đối</Q></N></I></F></C>'),
(87626, 'particolored', '<C><F><I><N><Q>@particolored<br />- có nhiều màu, nhiều bộ phận khác nhau</Q></N></I></F></C>'),
(87627, 'particoloured', '<C><F><I><N><Q>@particoloured /''pɑ:ti,kʌləd/ (party-coloured) /''pɑ:ti,kʌləd/<br />-coloured) /''pɑ:ti,kʌləd/<br />*  tính từ<br />- lẫn màu, nhiều màu</Q></N></I></F></C>'),
(87628, 'particular', '<C><F><I><N><Q>@particular /pə''tikjulə/<br />*  tính từ<br />- đặc biệt, đặc thù; cá biệt, riêng biệt<br />=for no particular reason+ không vì lý do gì đặc biệt<br />=of no particular importance+ không có tầm quan trọng đặc biệt<br />=a particular case+ một trường hợp cá biệt<br />=in particular+ đặc biệt<br />- tường tận, tỉ mỉ, chi tiết<br />=a full and particular account+ bản tường thuật đầy đủ và tường tận<br />- kỹ lưỡng, cặn kẽ, câu nệ đến từng chi tiết<br />=to be particular in one''s speech+ kỹ lưỡng trong cách nói năng<br />- khó tính, khảnh, cảnh vẻ (trong cách ăn mặc...)<br />=too particular about what (as to what) one wats+ quá khảnh ăn<br />*  danh từ<br />- chi tiết<br />=to go (enter) into particulars+ đi sâu vào chi tiết<br />- đặc biệt đặc thù<br />=fog is a London particular+ sương mù là một đặc điểm của Luân-đôn<br />- (số nhiều) bản tường thuật chi tiết</Q></N></I></F></C>'),
(87629, 'particularisation', '<C><F><I><N><Q>@particularisation<br />* danh từ<br />- sự đặc biệt hoá, tính đặc thù hoá<br />- sự đặc tả, sự liệt kê, sự tỉ mỉ</Q></N></I></F></C>'),
(87630, 'particularise', '<C><F><I><N><Q>@particularise<br />* ngoại động từ<br />- đặc biệt hoá, đặc thù hoá<br />- liệt kê, đặc tả (chi tiết); tường thuật tỉ mỉ, đi sâu vào chi tiết</Q></N></I></F></C>'),
(87631, 'particularism', '<C><F><I><N><Q>@particularism /pə''tikjulərizm/<br />*  danh từ<br />- chủ nghĩa đặc thù<br />- chủ nghĩa phân lập<br />- sự trung thành tuyệt đối (đối với một đảng phái, môn phái)</Q></N></I></F></C>'),
(87632, 'particularist', '<C><F><I><N><Q>@particularist<br />- xem particularism</Q></N></I></F></C>'),
(87633, 'particularistic', '<C><F><I><N><Q>@particularistic<br />- xem particularism</Q></N></I></F></C>'),
(87634, 'particularities', '<C><F><I><N><Q>@particularity /pə,tikju''læriti/<br />*  danh từ<br />- tính cá biệt, tính riêng biệt<br />- đặc tính, đặc điểm, nét đặc thù<br />- tính kỹ lưỡng, tính cặn kẽ, tính câu nệ đến từng chi tiết<br />- tính khảnh, tính cảnh vẻ; sự khó chịu (trong cách ăn mặc...)</Q></N></I></F></C>'),
(87635, 'particularity', '<C><F><I><N><Q>@particularity /pə,tikju''læriti/<br />*  danh từ<br />- tính cá biệt, tính riêng biệt<br />- đặc tính, đặc điểm, nét đặc thù<br />- tính kỹ lưỡng, tính cặn kẽ, tính câu nệ đến từng chi tiết<br />- tính khảnh, tính cảnh vẻ; sự khó chịu (trong cách ăn mặc...)</Q></N></I></F></C>'),
(87636, 'particularization', '<C><F><I><N><Q>@particularization<br />* danh từ<br />- sự đặc biệt hoá, tính đặc thù hoá<br />- sự đặc tả, sự liệt kê, sự tỉ mỉ</Q></N></I></F></C>'),
(87637, 'particularize', '<C><F><I><N><Q>@particularize /pə''tikjuləraiz/<br />*  động từ<br />- đặc biệt hoá, đặc thù hoá<br />- lần lượt nêu tên<br />- tường thuật tỉ mỉ; đi sâu vào chi tiết</Q></N></I></F></C>'),
(87638, 'particularized', '<C><F><I><N><Q>@particularize /pə''tikjuləraiz/<br />*  động từ<br />- đặc biệt hoá, đặc thù hoá<br />- lần lượt nêu tên<br />- tường thuật tỉ mỉ; đi sâu vào chi tiết</Q></N></I></F></C>'),
(87639, 'particularizer', '<C><F><I><N><Q>@particularizer<br />- xem particularize</Q></N></I></F></C>'),
(87640, 'particularizes', '<C><F><I><N><Q>@particularize /pə''tikjuləraiz/<br />*  động từ<br />- đặc biệt hoá, đặc thù hoá<br />- lần lượt nêu tên<br />- tường thuật tỉ mỉ; đi sâu vào chi tiết</Q></N></I></F></C>'),
(87641, 'particularizing', '<C><F><I><N><Q>@particularize /pə''tikjuləraiz/<br />*  động từ<br />- đặc biệt hoá, đặc thù hoá<br />- lần lượt nêu tên<br />- tường thuật tỉ mỉ; đi sâu vào chi tiết</Q></N></I></F></C>'),
(87642, 'particularly', '<C><F><I><N><Q>@particularly /pə''tikjuləli/<br />*  phó từ<br />- đặc biệt, cá biệt, riêng biệt<br />=particularly good+ đặc biệt tốt<br />=generally and particularly+ nói chung và nói riêng<br />- tỉ mỉ, chi tiết</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(87643, 'particulars', '<C><F><I><N><Q>@particular /pə''tikjulə/<br />*  tính từ<br />- đặc biệt, đặc thù; cá biệt, riêng biệt<br />=for no particular reason+ không vì lý do gì đặc biệt<br />=of no particular importance+ không có tầm quan trọng đặc biệt<br />=a particular case+ một trường hợp cá biệt<br />=in particular+ đặc biệt<br />- tường tận, tỉ mỉ, chi tiết<br />=a full and particular account+ bản tường thuật đầy đủ và tường tận<br />- kỹ lưỡng, cặn kẽ, câu nệ đến từng chi tiết<br />=to be particular in one''s speech+ kỹ lưỡng trong cách nói năng<br />- khó tính, khảnh, cảnh vẻ (trong cách ăn mặc...)<br />=too particular about what (as to what) one wats+ quá khảnh ăn<br />*  danh từ<br />- chi tiết<br />=to go (enter) into particulars+ đi sâu vào chi tiết<br />- đặc biệt đặc thù<br />=fog is a London particular+ sương mù là một đặc điểm của Luân-đôn<br />- (số nhiều) bản tường thuật chi tiết</Q></N></I></F></C>'),
(87644, 'particulate', '<C><F><I><N><Q>@particulate<br />* danh từ<br />- hạt; chất hạt<br />- particulate radioactive<br />- hạt phóng xạ<br />* tính từ<br />- thuộc hạt</Q></N></I></F></C>'),
(87645, 'particulates', '<C><F><I><N><Q>@particulate<br />* danh từ<br />- hạt; chất hạt<br />- particulate radioactive<br />- hạt phóng xạ<br />* tính từ<br />- thuộc hạt</Q></N></I></F></C>'),
(87646, 'parties', '<C><F><I><N><Q>@party /''pɑ:ti/<br />*  danh từ<br />- đảng<br />!the Communist Party<br />- đảng Cộng sản<br />=a political party+ một chính đảng<br />- sự đứng về phe (trong vấn đề chính trị); sự trung thành với phe đảng<br />- (định ngữ) (thuộc) đảng, có tính chất đảng phái<br />=party card+ thẻ đảng<br />=party dues+ đảng phí<br />=party member+ đảng viên<br />=party organization+ tổ chức đảng<br />=party local+ trụ sở đảng<br />=party nucleus+ nòng cốt của đảng<br />=party spirit+ tính đảng; óc đảng phái<br />*  danh từ<br />- tiệc, buổi liên hoan<br />- những người cùng đi<br />=the minister anf his party+ bộ trưởng và những người cùng đi<br />- toán, đội, nhóm<br />=landing party+ đội đổ bộ<br />- (pháp lý) bên<br />=the contracting parties+ các bên ký kết<br />- người tham gia, người tham dự<br />=to be a party to something+ thằng cha, lão, anh chàng, gã, con bé, mụ...<br />=an old party with spectales+ lâo đeo kính<br />=a coquettish party+ con bé làm đỏm</Q></N></I></F></C>'),
(87647, 'parting', '<C><F><I><N><Q>@parting /''pɑ:tiɳ/<br />*  danh từ<br />- sự chia ly, sự chia tay, sự từ biệt<br />=on parting+ lúc chia tay<br />- đường ngôi (của tóc)<br />- chỗ rẽ, ngã ba<br />=parting of the ways+ ngã ba đường ((nghĩa đen) &amp; (nghĩa bóng))</Q></N></I></F></C><C><F><I><N><Q>@part /pɑ:t/<br />*  danh từ<br />- phần, bộ phận, tập (sách)<br />=[a] great part of this story is true+ phần lớn chuyện đó là đúng<br />=[a] part of them have arrived+ một số trong bọn họ đã đến<br />=3 parts of sugar, 5 of flour+ 3 phần đường, 5 phần bột<br />=spare parts of a machine+ phụ tùng của máy<br />- bộ phận cơ thể<br />=the [privy] parts+ chỗ kín (bộ phận sinh dục)<br />- phần việc, nhiệm vụ<br />=I have done my part+ tôi đã làm phần việc của tôi<br />=it was not my part to interfere+ tôi không có nhiệm vụ can thiệp vào<br />=to have neither part nor lot in+ không có dính dáng gì vào<br />- vai, vai trò; lời nói của một vai kịch; bản chép lời của một vai kịch<br />=her part was well+ vai chị ấy đóng giỏi<br />=they don''t know their parts yet+ họ không thuộc lời các vai của họ<br />=to play an important part in the negotiations+ giữ một vai quan trọng trong cuộc đàm phán<br />=to play a part+ (nghĩa bóng) đóng kịch, giả vờ<br />- (số nhiều) nơi, vùng<br />=I am a stranger in these parts+ tôi là một người lạ trong vùng này<br />- phía, bè<br />=to take someone''s part; to take part with someone+ đứng về phía ai, về bè với ai, ủng hộ ai<br />- (âm nhạc) bè<br />- (từ cổ,nghĩa cổ) tài năng<br />=a man of [good] part+ một người có tài<br />!for my part<br />- về phần tôi<br />!for the most part<br />- phần lớn, phần nhiều<br />!in part<br />- một phần, phần nào<br />!on one''s part; on the part of<br />- về phía<br />=there was no objection on his part+ anh ta không phản đối gì<br />=he apologized on the part of his young brother+ anh ấy xin lỗi hộ em anh ấy<br />!part and parcel<br />- (xem) parcel<br />!part of speech<br />- (ngôn ngữ học) loại từ<br />!to take someething in good part<br />- không chấp nhất điều gì; không phật ý về việc gì<br />!to take part in<br />- tham gia vào<br />*  ngoại động từ<br />- chia thành từng phần, chia làm đôi<br />- rẽ ra, tách ra, tách làm đôi<br />=to part the crowd+ rẽ đám đông ra<br />=to part one''s hair+ rẽ đường ngôi (tóc)<br />- (từ cổ,nghĩa cổ) phân phối, chia phần (cái gì)<br />*  nội động từ<br />- rẽ ra, tách ra, đứt<br />=the crowd parted anf let him through+ đám đông rẽ ra cho anh ấy đi<br />=the cord parted+ thừng đứt ra<br />- chia tay, từ biệt, ra đi<br />=they parted in joy+ họ hoan hỉ chia tay nhau<br />=let us part friends+ chúng ta hãy vui vẻ chia tay nhau<br />=to part from (with) somebody+ chia tay ai<br />- chết<br />- (+ with) bỏ, lìa bỏ<br />=to part with one''s property+ bỏ của cải<br />!to part brass rags with somebody<br />- (xem) brass<br />!to part company with<br />- cắt đắt quan hệ bầu bạn với<br />*  phó từ<br />- một phần<br />=it is made part of iron and part of wood+ cái đó làm một phần bằng sắt một phần bằng gỗ<br /><br />@part<br />- bộ phận, phần // chia thành phần<br />- aliquot p. ước số <br />- imaginaty p. phần ảo<br />- principal p. phần chính<br />- real p. phần thực</Q></N></I></F></C>'),
(87648, 'partings', '<C><F><I><N><Q>@parting /''pɑ:tiɳ/<br />*  danh từ<br />- sự chia ly, sự chia tay, sự từ biệt<br />=on parting+ lúc chia tay<br />- đường ngôi (của tóc)<br />- chỗ rẽ, ngã ba<br />=parting of the ways+ ngã ba đường ((nghĩa đen) &amp; (nghĩa bóng))</Q></N></I></F></C>'),
(87649, 'partisan', '<C><F><I><N><Q>@partisan /,pɑ:ti''zæn/<br />*  danh từ<br />- người theo một đảng phái, đảng viên<br />- người ủng hộ<br />=partisan of peace+ người ủng hộ hoà bình<br />- đội viên du kích<br />- (sử học), quân đội viên đội biệt động<br />- (định ngữ) có tính chất đảng phái<br />=in a partisan spirit+ với óc đảng phái<br />*  danh từ<br />- (sử học) cây thương dài, trường thương</Q></N></I></F></C>'),
(87650, 'partisans', '<C><F><I><N><Q>@partisan /,pɑ:ti''zæn/<br />*  danh từ<br />- người theo một đảng phái, đảng viên<br />- người ủng hộ<br />=partisan of peace+ người ủng hộ hoà bình<br />- đội viên du kích<br />- (sử học), quân đội viên đội biệt động<br />- (định ngữ) có tính chất đảng phái<br />=in a partisan spirit+ với óc đảng phái<br />*  danh từ<br />- (sử học) cây thương dài, trường thương</Q></N></I></F></C>'),
(87651, 'partisanship', '<C><F><I><N><Q>@partisanship /,pɑ:ti''zænʃip/<br />*  danh từ<br />- lòng trung thành với đảng phái; óc đảng phái</Q></N></I></F></C>'),
(87652, 'partite', '<C><F><I><N><Q>@partite<br />* tính từ<br />- (thực vật học) xẻ sâu; xẻ sát gốc<br /><br />@partite<br />- tách biệt, phân riêng ra</Q></N></I></F></C>'),
(87653, 'partition', '<C><F><I><N><Q>@partition /pɑ:''tiʃn/<br />*  danh từ<br />- sự chia ra<br />- ngăn phần<br />- liếp ngăn, bức vách ngăn<br />- (chính trị) sự chia cắt đất nước<br />- (pháp lý) sự chia tài sản<br />*  ngoại động từ<br />- chia ra, chia cắt, ngăn ra<br />!to partiton off<br />- ngăn (một căn phòng...) bằng bức vách<br /><br />@partition<br />- sự phân hoạch, sự phân chia<br />- conjugate p.s (đại số) phân hoạch liên hợp<br />- simplicial p. (tô pô) phân hoạch đơn hình</Q></N></I></F></C>'),
(87654, 'partitioned', '<C><F><I><N><Q>@partition /pɑ:''tiʃn/<br />*  danh từ<br />- sự chia ra<br />- ngăn phần<br />- liếp ngăn, bức vách ngăn<br />- (chính trị) sự chia cắt đất nước<br />- (pháp lý) sự chia tài sản<br />*  ngoại động từ<br />- chia ra, chia cắt, ngăn ra<br />!to partiton off<br />- ngăn (một căn phòng...) bằng bức vách<br /><br />@partition<br />- sự phân hoạch, sự phân chia<br />- conjugate p.s (đại số) phân hoạch liên hợp<br />- simplicial p. (tô pô) phân hoạch đơn hình</Q></N></I></F></C>'),
(87655, 'partitioner', '<C><F><I><N><Q>@partitioner<br />- xem partition</Q></N></I></F></C>'),
(87656, 'partitioning', '<C><F><I><N><Q>@partition /pɑ:''tiʃn/<br />*  danh từ<br />- sự chia ra<br />- ngăn phần<br />- liếp ngăn, bức vách ngăn<br />- (chính trị) sự chia cắt đất nước<br />- (pháp lý) sự chia tài sản<br />*  ngoại động từ<br />- chia ra, chia cắt, ngăn ra<br />!to partiton off<br />- ngăn (một căn phòng...) bằng bức vách<br /><br />@partition<br />- sự phân hoạch, sự phân chia<br />- conjugate p.s (đại số) phân hoạch liên hợp<br />- simplicial p. (tô pô) phân hoạch đơn hình</Q></N></I></F></C>'),
(87657, 'partitions', '<C><F><I><N><Q>@partition /pɑ:''tiʃn/<br />*  danh từ<br />- sự chia ra<br />- ngăn phần<br />- liếp ngăn, bức vách ngăn<br />- (chính trị) sự chia cắt đất nước<br />- (pháp lý) sự chia tài sản<br />*  ngoại động từ<br />- chia ra, chia cắt, ngăn ra<br />!to partiton off<br />- ngăn (một căn phòng...) bằng bức vách<br /><br />@partition<br />- sự phân hoạch, sự phân chia<br />- conjugate p.s (đại số) phân hoạch liên hợp<br />- simplicial p. (tô pô) phân hoạch đơn hình</Q></N></I></F></C>'),
(87658, 'partitive', '<C><F><I><N><Q>@partitive /''pɑ:titiv/<br />*  danh từ<br />- (ngôn ngữ học) bộ phận<br />=partitive adjective+ tính từ bộ phận</Q></N></I></F></C>'),
