(87660, 'partitives', '<C><F><I><N><Q>@partitive /''pɑ:titiv/<br />*  danh từ<br />- (ngôn ngữ học) bộ phận<br />=partitive adjective+ tính từ bộ phận</Q></N></I></F></C>'),
(87661, 'partlet', '<C><F><I><N><Q>@partlet /''pɑ:tli/<br />*  danh từ<br />- (từ cổ,nghĩa cổ) con gà mái<br />- người đàn bà</Q></N></I></F></C>'),
(87662, 'partly', '<C><F><I><N><Q>@partly /''pɑ:tli/<br />*  phó từ<br />- một phần, phần nào<br /><br />@partly<br />- từng phần, một phần</Q></N></I></F></C>'),
(87663, 'Partly rational expectations', '<C><F><I><N><Q>@Partly rational expectations<br />- (Econ) Những kỳ vọng hợp lý riêng phần.<br />+ Một giả định rằng người ta kỳ vọng một cách hợp lý sự cân bằng dài hạn nhưng lại không chắc chắn về con đường mà nến kinh tế sẽ đi đến vị trí đó, cho nên các kỳ vọng sẽ được xem xét lại ở từng thời kỳ để tính đến sự không nhất quán giữa giá trị thực tế và giá trị kỳ vọng.</Q></N></I></F></C>'),
(87664, 'partner', '<C><F><I><N><Q>@partner /''pɑ:tnə/<br />*  danh từ<br />- người cùng chung phần; người cùng canh ty<br />- hội viên (của một công ty, một minh ước quốc tế)<br />- bạn cùng phe (trong một trò chơi)<br />- bạn cùng nhảy (vũ quốc tế)<br />- vợ; chồng<br />- (số nhiều) khung lỗ (ở sàn tàu để cột buồm và trục lái... đi qua)<br />!predominant partner<br />- thành viên lớn nhất của nước Anh (tức Inh-len)<br />!silent partner<br />- hội viên hùn vốn (không có tiếng nói trong công việc quản trị công ty)<br />!sleeping partner<br />- hội viên hùn vốn kín (không tham gia công việc quản trị công ty và ít người biết đến) ((cũng) secret partner; dormant partner)<br />*  ngoại động từ<br />- chung phần với, công ty với (ai)<br />- cho (ai) nhập hội; kết (ai với ai) thành một phe<br />=to partner someone with another+ kết ai với ai thành một phe<br />- là người cùng chung phần với (ai); là người cùng canh ty với (ai); là bạn cùng phe với (ai)<br /><br />@partner<br />- (lý thuyết trò chơi) người cùng phe</Q></N></I></F></C>'),
(87665, 'partnered', '<C><F><I><N><Q>@partner /''pɑ:tnə/<br />*  danh từ<br />- người cùng chung phần; người cùng canh ty<br />- hội viên (của một công ty, một minh ước quốc tế)<br />- bạn cùng phe (trong một trò chơi)<br />- bạn cùng nhảy (vũ quốc tế)<br />- vợ; chồng<br />- (số nhiều) khung lỗ (ở sàn tàu để cột buồm và trục lái... đi qua)<br />!predominant partner<br />- thành viên lớn nhất của nước Anh (tức Inh-len)<br />!silent partner<br />- hội viên hùn vốn (không có tiếng nói trong công việc quản trị công ty)<br />!sleeping partner<br />- hội viên hùn vốn kín (không tham gia công việc quản trị công ty và ít người biết đến) ((cũng) secret partner; dormant partner)<br />*  ngoại động từ<br />- chung phần với, công ty với (ai)<br />- cho (ai) nhập hội; kết (ai với ai) thành một phe<br />=to partner someone with another+ kết ai với ai thành một phe<br />- là người cùng chung phần với (ai); là người cùng canh ty với (ai); là bạn cùng phe với (ai)<br /><br />@partner<br />- (lý thuyết trò chơi) người cùng phe</Q></N></I></F></C>'),
(87666, 'partnering', '<C><F><I><N><Q>@partner /''pɑ:tnə/<br />*  danh từ<br />- người cùng chung phần; người cùng canh ty<br />- hội viên (của một công ty, một minh ước quốc tế)<br />- bạn cùng phe (trong một trò chơi)<br />- bạn cùng nhảy (vũ quốc tế)<br />- vợ; chồng<br />- (số nhiều) khung lỗ (ở sàn tàu để cột buồm và trục lái... đi qua)<br />!predominant partner<br />- thành viên lớn nhất của nước Anh (tức Inh-len)<br />!silent partner<br />- hội viên hùn vốn (không có tiếng nói trong công việc quản trị công ty)<br />!sleeping partner<br />- hội viên hùn vốn kín (không tham gia công việc quản trị công ty và ít người biết đến) ((cũng) secret partner; dormant partner)<br />*  ngoại động từ<br />- chung phần với, công ty với (ai)<br />- cho (ai) nhập hội; kết (ai với ai) thành một phe<br />=to partner someone with another+ kết ai với ai thành một phe<br />- là người cùng chung phần với (ai); là người cùng canh ty với (ai); là bạn cùng phe với (ai)<br /><br />@partner<br />- (lý thuyết trò chơi) người cùng phe</Q></N></I></F></C>'),
(87667, 'partners', '<C><F><I><N><Q>@partner /''pɑ:tnə/<br />*  danh từ<br />- người cùng chung phần; người cùng canh ty<br />- hội viên (của một công ty, một minh ước quốc tế)<br />- bạn cùng phe (trong một trò chơi)<br />- bạn cùng nhảy (vũ quốc tế)<br />- vợ; chồng<br />- (số nhiều) khung lỗ (ở sàn tàu để cột buồm và trục lái... đi qua)<br />!predominant partner<br />- thành viên lớn nhất của nước Anh (tức Inh-len)<br />!silent partner<br />- hội viên hùn vốn (không có tiếng nói trong công việc quản trị công ty)<br />!sleeping partner<br />- hội viên hùn vốn kín (không tham gia công việc quản trị công ty và ít người biết đến) ((cũng) secret partner; dormant partner)<br />*  ngoại động từ<br />- chung phần với, công ty với (ai)<br />- cho (ai) nhập hội; kết (ai với ai) thành một phe<br />=to partner someone with another+ kết ai với ai thành một phe<br />- là người cùng chung phần với (ai); là người cùng canh ty với (ai); là bạn cùng phe với (ai)<br /><br />@partner<br />- (lý thuyết trò chơi) người cùng phe</Q></N></I></F></C>'),
(87668, 'Partnership', '<C><F><I><N><Q>@Partnership<br />- (Econ) Bên tham gia; Hội chung vốn.</Q></N></I></F></C>'),
(87669, 'partnership', '<C><F><I><N><Q>@partnership /''pɑ:tnəʃip/<br />*  danh từ<br />- sự chung thân<br />- hội, công ty<br />=enter into partnership with+ cùng chung phần với; cùng nhập hội với<br />=to take someone into partnership+ cho ai nhập hội, nhận ai vào công ty</Q></N></I></F></C>'),
(87670, 'partnerships', '<C><F><I><N><Q>@Partnership<br />- (Econ) Bên tham gia; Hội chung vốn.</Q></N></I></F></C><C><F><I><N><Q>@partnership /''pɑ:tnəʃip/<br />*  danh từ<br />- sự chung thân<br />- hội, công ty<br />=enter into partnership with+ cùng chung phần với; cùng nhập hội với<br />=to take someone into partnership+ cho ai nhập hội, nhận ai vào công ty</Q></N></I></F></C>'),
(87671, 'parton', '<C><F><I><N><Q>@parton<br />* danh từ<br />- hạt cơ bản theo giả thiết tạo thành neutron và thường được đồng nhất hoá với quak</Q></N></I></F></C>'),
(87672, 'partook', '<C><F><I><N><Q>@partook /pɑ:''teik/<br />*  ngoại động từ partook  /pɑ:''tuk/,  partaken  /pɑ:''teikn/<br />- tham dự, cùng có phần, cùng hưởng, cùng chia xẻ<br />*  nội động từ<br />- (+ in,  of,  with) cùng tham dự, cùng có phần, cùng hưởng, cùng chia sẻ<br />=to partake in (of) something+ cùng có phần cái gì, cùng hưởng cái gì<br />=to partake with somebody+ cùng tham dự với ai<br />- (+ of) ăn uống (một phần cái gì); (thông tục) hết cả cái gì<br />=he partook of our lowly fare+ anh ta cũng cùng ăn những thứ ăn nghèo nàn đạm bạc của chúng tôi<br />- có phần nào<br />=his manner partakes of insolence+ thái độ của hắn có phần nào láo xược</Q></N></I></F></C><C><F><I><N><Q>@partake /pɑ:''teik/<br />*  ngoại động từ partook  /pɑ:''tuk/,  partaken  /pɑ:''teikn/<br />- tham dự, cùng có phần, cùng hưởng, cùng chia xẻ<br />*  nội động từ<br />- (+ in,  of,  with) cùng tham dự, cùng có phần, cùng hưởng, cùng chia sẻ<br />=to partake in (of) something+ cùng có phần cái gì, cùng hưởng cái gì<br />=to partake with somebody+ cùng tham dự với ai<br />- (+ of) ăn uống (một phần cái gì); (thông tục) hết cả cái gì<br />=he partook of our lowly fare+ anh ta cũng cùng ăn những thứ ăn nghèo nàn đạm bạc của chúng tôi<br />- có phần nào<br />=his manner partakes of insolence+ thái độ của hắn có phần nào láo xược</Q></N></I></F></C>'),
(87673, 'partridge', '<C><F><I><N><Q>@partridge /''pɑ:tridʤ/<br />*  danh từ<br />- (động vật học) gà gô</Q></N></I></F></C>'),
(87674, 'partridge-wood', '<C><F><I><N><Q>@partridge-wood /''pɑ:tridʤwud/<br />*  danh từ<br />- gỗ hồng sắc</Q></N></I></F></C>'),
(87675, 'partridges', '<C><F><I><N><Q>@partridge /''pɑ:tridʤ/<br />*  danh từ<br />- (động vật học) gà gô</Q></N></I></F></C>'),
(87676, 'parts', '<C><F><I><N><Q>@part /pɑ:t/<br />*  danh từ<br />- phần, bộ phận, tập (sách)<br />=[a] great part of this story is true+ phần lớn chuyện đó là đúng<br />=[a] part of them have arrived+ một số trong bọn họ đã đến<br />=3 parts of sugar, 5 of flour+ 3 phần đường, 5 phần bột<br />=spare parts of a machine+ phụ tùng của máy<br />- bộ phận cơ thể<br />=the [privy] parts+ chỗ kín (bộ phận sinh dục)<br />- phần việc, nhiệm vụ<br />=I have done my part+ tôi đã làm phần việc của tôi<br />=it was not my part to interfere+ tôi không có nhiệm vụ can thiệp vào<br />=to have neither part nor lot in+ không có dính dáng gì vào<br />- vai, vai trò; lời nói của một vai kịch; bản chép lời của một vai kịch<br />=her part was well+ vai chị ấy đóng giỏi<br />=they don''t know their parts yet+ họ không thuộc lời các vai của họ<br />=to play an important part in the negotiations+ giữ một vai quan trọng trong cuộc đàm phán<br />=to play a part+ (nghĩa bóng) đóng kịch, giả vờ<br />- (số nhiều) nơi, vùng<br />=I am a stranger in these parts+ tôi là một người lạ trong vùng này<br />- phía, bè<br />=to take someone''s part; to take part with someone+ đứng về phía ai, về bè với ai, ủng hộ ai<br />- (âm nhạc) bè<br />- (từ cổ,nghĩa cổ) tài năng<br />=a man of [good] part+ một người có tài<br />!for my part<br />- về phần tôi<br />!for the most part<br />- phần lớn, phần nhiều<br />!in part<br />- một phần, phần nào<br />!on one''s part; on the part of<br />- về phía<br />=there was no objection on his part+ anh ta không phản đối gì<br />=he apologized on the part of his young brother+ anh ấy xin lỗi hộ em anh ấy<br />!part and parcel<br />- (xem) parcel<br />!part of speech<br />- (ngôn ngữ học) loại từ<br />!to take someething in good part<br />- không chấp nhất điều gì; không phật ý về việc gì<br />!to take part in<br />- tham gia vào<br />*  ngoại động từ<br />- chia thành từng phần, chia làm đôi<br />- rẽ ra, tách ra, tách làm đôi<br />=to part the crowd+ rẽ đám đông ra<br />=to part one''s hair+ rẽ đường ngôi (tóc)<br />- (từ cổ,nghĩa cổ) phân phối, chia phần (cái gì)<br />*  nội động từ<br />- rẽ ra, tách ra, đứt<br />=the crowd parted anf let him through+ đám đông rẽ ra cho anh ấy đi<br />=the cord parted+ thừng đứt ra<br />- chia tay, từ biệt, ra đi<br />=they parted in joy+ họ hoan hỉ chia tay nhau<br />=let us part friends+ chúng ta hãy vui vẻ chia tay nhau<br />=to part from (with) somebody+ chia tay ai<br />- chết<br />- (+ with) bỏ, lìa bỏ<br />=to part with one''s property+ bỏ của cải<br />!to part brass rags with somebody<br />- (xem) brass<br />!to part company with<br />- cắt đắt quan hệ bầu bạn với<br />*  phó từ<br />- một phần<br />=it is made part of iron and part of wood+ cái đó làm một phần bằng sắt một phần bằng gỗ<br /><br />@part<br />- bộ phận, phần // chia thành phần<br />- aliquot p. ước số <br />- imaginaty p. phần ảo<br />- principal p. phần chính<br />- real p. phần thực</Q></N></I></F></C>'),
(87677, 'parturiency', '<C><F><I><N><Q>@parturiency<br />- xem parturient</Q></N></I></F></C>'),
(87678, 'parturient', '<C><F><I><N><Q>@parturient /pɑ:''tjuəriənt/<br />*  tính từ<br />- sắp sinh nở, sắp sinh đẻ<br />- (nghĩa bóng) sắp sáng tạo ra, sắp sáng tác ra (trí óc)</Q></N></I></F></C>'),
(87679, 'parturifacient', '<C><F><I><N><Q>@parturifacient /pɑ:,tjuəri''feiʃənt/<br />*  danh từ<br />- (y học) thuốc làm đẻ dễ</Q></N></I></F></C>'),
(87680, 'parturifacients', '<C><F><I><N><Q>@parturifacient /pɑ:,tjuəri''feiʃənt/<br />*  danh từ<br />- (y học) thuốc làm đẻ dễ</Q></N></I></F></C>'),
(87681, 'parturition', '<C><F><I><N><Q>@parturition /,pɑ:tjuə''riʃn/<br />*  danh từ<br />- sự đẻ, sự sinh đẻ<br />- (nghĩa bóng) sự sáng tạo, sự sáng tác</Q></N></I></F></C>'),
(87682, 'parturitions', '<C><F><I><N><Q>@parturition /,pɑ:tjuə''riʃn/<br />*  danh từ<br />- sự đẻ, sự sinh đẻ<br />- (nghĩa bóng) sự sáng tạo, sự sáng tác</Q></N></I></F></C>'),
(87683, 'partway', '<C><F><I><N><Q>@partway<br />* phó từ<br />- một phần; phần nào</Q></N></I></F></C>'),
(87684, 'party', '<C><F><I><N><Q>@party /''pɑ:ti/<br />*  danh từ<br />- đảng<br />!the Communist Party<br />- đảng Cộng sản<br />=a political party+ một chính đảng<br />- sự đứng về phe (trong vấn đề chính trị); sự trung thành với phe đảng<br />- (định ngữ) (thuộc) đảng, có tính chất đảng phái<br />=party card+ thẻ đảng<br />=party dues+ đảng phí<br />=party member+ đảng viên<br />=party organization+ tổ chức đảng<br />=party local+ trụ sở đảng<br />=party nucleus+ nòng cốt của đảng<br />=party spirit+ tính đảng; óc đảng phái<br />*  danh từ<br />- tiệc, buổi liên hoan<br />- những người cùng đi<br />=the minister anf his party+ bộ trưởng và những người cùng đi<br />- toán, đội, nhóm<br />=landing party+ đội đổ bộ<br />- (pháp lý) bên<br />=the contracting parties+ các bên ký kết<br />- người tham gia, người tham dự<br />=to be a party to something+ thằng cha, lão, anh chàng, gã, con bé, mụ...<br />=an old party with spectales+ lâo đeo kính<br />=a coquettish party+ con bé làm đỏm</Q></N></I></F></C>'),
(87685, 'party-coloured', '<C><F><I><N><Q>@party-coloured /''pɑ:ti,kʌləd/ (party-coloured) /''pɑ:ti,kʌləd/<br />-coloured) /''pɑ:ti,kʌləd/<br />*  tính từ<br />- lẫn màu, nhiều màu</Q></N></I></F></C>'),
