(87687, 'party line', '<C><F><I><N><Q>@party line /''pɑ:tilain/<br />*  danh từ<br />- đường lối của đảng<br />- (từ Mỹ,nghĩa Mỹ),  (như) party_wire</Q></N></I></F></C>'),
