(87701, 'pas', '<C><F><I><N><Q>@pas /pɑ:/<br />*  danh từ<br />- quyền đi trước, quyền ưu tiên<br />=to give the pas+ nhường đi trước, nhường bước; nhường quyền ưu tiên<br />=to take the pas+ được đi trước; được quyền ưu tiên<br />- bước nhảy, bước khiêu vũ<br />=pas seul+ bước vũ ba lê một người biểu diễn<br />=pas de deux+ bước vũ ba lê hai người biểu diễn</Q></N></I></F></C>'),
