(87709, 'pash', '<C><F><I><N><Q>@pash /pæʃ/<br />*  danh từ<br />- (từ lóng),  (viết tắt) của passion<br />- sự say mê<br />=to have a pash for somebody (something)+ say mê ai (cái gì)</Q></N></I></F></C>'),
(87710, 'pasha', '<C><F><I><N><Q>@pasha /''pɑ:ʃə/ (pacha) /''pa:ʃə/<br />*  danh từ<br />- Pasa, tổng trấn (Thổ nhĩ kỳ)</Q></N></I></F></C>'),
