(87712, 'pashas', '<C><F><I><N><Q>@pasha /''pɑ:ʃə/ (pacha) /''pa:ʃə/<br />*  danh từ<br />- Pasa, tổng trấn (Thổ nhĩ kỳ)</Q></N></I></F></C>'),
