(87715, 'pasque-flower', '<C><F><I><N><Q>@pasque-flower /''pɑ:sk,flauə/<br />*  danh từ<br />- (thực vật học) cây bạch đầu ông</Q></N></I></F></C>'),
(87716, 'pasquinade', '<C><F><I><N><Q>@pasquinade /,pæskwi''neid/<br />*  danh từ<br />- bài phỉ báng, bài đả kích ((thường) dán nơi công cộng)</Q></N></I></F></C>'),
(87717, 'pasquinader', '<C><F><I><N><Q>@pasquinader<br />- xem pasquinade</Q></N></I></F></C>'),
(87718, 'pass', '<C><F><I><N><Q>@pass /pɑ:s/<br />*  nội động từ<br />- đi, đi lên; đi qua, đi ngang qua<br />=to pass down the street+ đi xuống phố<br />=to pass along a wall+ đi dọc theo bức tường<br />=to pass across a road+ đi ngang qua đường<br />=to pass over a bridge+ đi qua cầu<br />=pass along!+ đi lên!, đi đi!<br />- (nghĩa bóng) trải qua<br />=to pass through many hardships+ trải qua nhiều khó khăn gian khổ<br />- chuyển qua, truyền, trao, đưa<br />=to pass from mouth to mouth+ truyền từ miệng người này sang miệng người khác<br />- (+ into) chuyển qua, chuyển sang, biến thành, trở thành, đổi thành<br />=when Spring passes into Summer+ câu đó đã trở thành tục ngữ<br />- qua đi, biến đi, mất đi; chết<br />=his fit of anger will soon+ cơn giận của hắn rồi sẽ qua đi ngay<br />=to pass hence; to pass from among us+ đã chết, đã từ trần<br />- trôi đi, trôi qua<br />=time passes rapidly+ thời gian trôi nhanh<br />- được thông qua, được chấp nhận<br />=the bill is sure to pass+ bản dự luật chắc chắn sẽ được thông qua<br />=these theories will not pass now+ những lý thuyết đó sẽ không được chấp nhận nữa<br />- thi đỗ<br />- xảy ra, được làm, được nói đến<br />=I could not hear what was passing+ tôi không nghe thấy những gì người ta nói đến<br />- bị bỏ qua, bị lờ đi; qua đi không ai hay biết<br />=I can''t let it pass+ tôi không thể nào để cho câu chuyện đó bị bỏ qua được<br />- (+ over,  by) bỏ qua, lờ đi<br />=to pass over someone''s mistakes+ bỏ qua lỗi của ai<br />- (đánh bài) bỏ lượt, bỏ bài<br />- (pháp lý) được tuyên án<br />=the verdict passed for the plaintiff+ bản án được tuyên bố cho bên nguyên thắng<br />- (+ upon) xét xử, tuyên án<br />- lưu hành, tiêu được (tiền)<br />=this coin will not pass+ đồng tiền này không tiêu được<br />- (thể dục,thể thao) đâm, tấn công (đấu kiếm)<br />- (từ Mỹ,nghĩa Mỹ) đi ngoài, đi tiêu<br />*  ngoại động từ<br />- qua, đi qua, đi ngang qua, vượt qua<br />=to pass the frontier+ vượt qua biên giới<br />=to pass a mountain range+ vượt qua dãy núi<br />- quá, vượt quá, hơn hẳn<br />=he has passed fifty+ ông ta đã hơn (ngoài) năm mươi<br />=to pass someone''s comprehension+ vượt quá sự biểu biết của ai<br />- thông qua, được đem qua thông qua<br />=to pass a bill+ thông qua một bản dự luật<br />=the bill must pass the parliament+ bản dự luật phải được đem thông qua ở nghị viện<br />- qua được, đạt tiêu chuẩn qua (kỳ thi, cuộc thử thách...)<br />=to pass the examination+ qua được kỳ thi, thi đỗ<br />=to pass muster+ được cho là được, được công nhận là xứng đáng<br />- duyệt<br />=to pass troops+ duyệt binh<br />- đưa qua, chuyển qua, truyền tay, trao<br />=to pass one''s hand over one''s face+ đưa tay vuốt mặt<br />- (thể dục,thể thao) chuyền (bóng...)<br />- cho lưu hành, đem tiêu (tiền giả...)<br />- phát biểu, nói ra, đưa ra (ý kiến...); tuyên (án...)<br />=to pass remarks upon somebody+ phát biểu những ý kiến nhận xét về ai<br />=to pass a sentence+ tuyên án<br />- hứa (lời...)<br />=to pass one''s word+ hứa chắc, đoan chắc<br />!to pass away<br />- trôi qua, đi qua, đi mất<br />- chết, qua đời<br />!to pass by<br />- đi qua, đi ngang qua<br />- bỏ qua, lờ đi, nhắm mắt bỏ qua, làm ngơ<br />!to pass for<br />- được coi là; có tiếng là<br />=to pass for a scholar+ được coi là một học giả<br />!to pass in<br />- chết ((cũng) to pass one''s checks)<br />!to pass off<br />- mất đi, biến mất (cảm giác...)<br />- diễn ra, được thực hiện, được hoàn thành<br />=the whole thing passed off without a hitch+ mọi việc diễn ra không có gì trắc trở<br />- đem tiêu trót lọt (tiền giả...); gian dối tống ấn (cho ai cái gì...)<br />=he passed it off upon her for a Rubens+ hắn gian dối tống ấn cho bà ta một bức tranh mạo là của Ru-ben<br />=to pass oneself off+ mạo nhận là<br />=he passes himself off as a doctor+ nó mạo nhận là một bác sĩ<br />- đánh lạc, sự chú ý, làm cho không chú ý (cái gì)<br />!to pass on<br />- đi tiếp<br />!to pass out<br />- (thực vật học) chết, qua đời<br />- (thông tục) say không biết trời đất gì<br />- mê đi, bất tỉnh<br />!to pass over<br />- băng qua<br />- chết<br />- làm lơ đi, bỏ qua<br />=to pass it over in silence+ làm lơ đi<br />!to pass round<br />- chuyền tay, chuyền theo vòng<br />- đi vòng quanh<br />- cuộn tròn<br />=to pass a rope round a cask+ cuộn cái dây thừng quanh thúng<br />!to pass through<br />- đi qua<br />- trải qua, kinh qua<br />!to pass up<br />- (từ Mỹ,nghĩa Mỹ) từ chối, từ bỏ, khước từ<br />!to pass water<br />- đái<br />*  danh từ<br />- sự thi đỗ; sự trúng tuyển hạng thứ (ở trường đại học)<br />- hoàn cảnh gay go, tình thế gay go<br />=things have come to a pass+ sự việc đi đến chỗ gay go<br />- giấy phép, giấy thông hành; giấy đi xe lửa không mất tiền; giấy vào cửa không mất tiền ((cũng) free pass); thẻ ra vào (triển lãm...); vé mời (xem hát...)<br />- (thể dục,thể thao) sự chuyền bóng (bóng đá); cú đâm, cú tấn công (đấu kiếm)<br />- trò gian dối, trò bài tây<br />- sự đưa tay qua (làm thôi miên...)<br />!to bring to pass<br />- (xem) bring<br />!to come to pass<br />- xảy ra<br />!to make a pass at somebody<br />- (từ lóng) tán tỉnh gỡ gạc ai, gạ gẫm ai<br />*  danh từ<br />- đèo, hẽm núi<br />- (quân sự) con đường độc đạo, vị trí cửa ngõ (để tiến vào một nước)<br />- (hàng hải) eo biển tàu bè qua lại được<br />- cửa thông cho cá vào đăng<br />- (kỹ thuật) khuôn cán, rãnh cán<br />!to sell the pass<br />- (nghĩa bóng) phản bội một cuộc đấu tranh<br /><br />@pass<br />- vượt qua</Q></N></I></F></C>'),
(87719, 'pass-band', '<C><F><I><N><Q>@pass-band<br />* danh từ<br />- (điện tử) dải thông</Q></N></I></F></C>'),
(87720, 'pass-parole', '<C><F><I><N><Q>@pass-parole<br />* danh từ<br />- khẩu lệnh từ tiền tuyến xuống hậu phương</Q></N></I></F></C>'),
(87721, 'passable', '<C><F><I><N><Q>@passable /''pɑ:səbl/<br />*  tính từ<br />- có thể qua lại được<br />=this stream is passable for boats+ dòng sông này thuyền bè có thể qua lại được<br />- tàm tạm<br />=a passable knoledge of French+ sự hiểu biết tàm tạm về tiếng Pháp<br />- có thể thông qua được (đạo luật...)<br />- có thể lưu hành, có thể đem tiêu (tiền...)</Q></N></I></F></C>'),
(87722, 'passableness', '<C><F><I><N><Q>@passableness<br />- xem passable</Q></N></I></F></C>'),
(87723, 'passably', '<C><F><I><N><Q>@passably /''pɑ:səbli/<br />*  phó từ<br />- đạt yêu cầu, tàm tạm</Q></N></I></F></C>'),
(87724, 'passacaglia', '<C><F><I><N><Q>@passacaglia<br />* danh từ<br />- điệu vũ paxacal</Q></N></I></F></C>'),
(87725, 'passado', '<C><F><I><N><Q>@passado<br />* danh từ<br />- cách đâm kiếm thẳng về phía trước, một chân bước lên trước</Q></N></I></F></C>'),
(87726, 'passage', '<C><F><I><N><Q>@passage /''pæsidʤ/<br />*  danh từ<br />- sự đi qua, sự trôi qua<br />=the passage of time+ thời gian trôi qua<br />- lối đi<br />=to force a passage through the crowd+ lách lấy lối đi qua đám đông<br />- hành lang<br />- quyền đi qua (một nơi nào...)<br />- (nghĩa bóng) sự chuyển qua<br />=the passage from poverty to great wealth+ sự chuyển từ cảnh nghèo nàn sang cảnh hết sức giàu có<br />- chuyến đi (tàu biển, máy bay)<br />=a rough passage+ một chuyến đi khó khăn vì biển động<br />=to book [one''s] passage to+ ghi tên mua vé dành chỗ đi<br />- đoạn (bài văn, sách...)<br />=a famour passage+ một đoạn văn nổi tiếng<br />=a difficult passage+ một đoạn khó khăn<br />- sự thông qua (một dự luật...)<br />- (số nhiều) quan hệ giữa hai người; sự chuyện trò trao đổi giữa hai người; chuyện trò tri kỷ giữa hai người<br />=to have stormy passages with somebody+ trao đổi tranh luận sôi nổi với ai<br />- (âm nhạc) nét lướt<br />- (từ Mỹ,nghĩa Mỹ) sự đi ỉa<br />!bird of passage<br />- (xem) bird<br />!passage of (at) arms<br />- (thường) (nghĩa bóng) trận đánh; cuộc va chạm, cuộc cãi cọ<br />*  nội động từ<br />- đi né sang một bên (ngựa, người cưỡi ngựa)<br />*  ngoại động từ<br />- làm cho (ngựa) đi né sang một bên</Q></N></I></F></C>'),
(87727, 'passage boat', '<C><F><I><N><Q>@passage boat /''pæsidʤbout/<br />*  danh từ<br />- phà, đò ngang</Q></N></I></F></C>'),
(87728, 'passage-way', '<C><F><I><N><Q>@passage-way /''pæsidʤwei/<br />*  danh từ<br />- hành lang; đường phố nhỏ, ngõ</Q></N></I></F></C>'),
(87729, 'passages', '<C><F><I><N><Q>@passage /''pæsidʤ/<br />*  danh từ<br />- sự đi qua, sự trôi qua<br />=the passage of time+ thời gian trôi qua<br />- lối đi<br />=to force a passage through the crowd+ lách lấy lối đi qua đám đông<br />- hành lang<br />- quyền đi qua (một nơi nào...)<br />- (nghĩa bóng) sự chuyển qua<br />=the passage from poverty to great wealth+ sự chuyển từ cảnh nghèo nàn sang cảnh hết sức giàu có<br />- chuyến đi (tàu biển, máy bay)<br />=a rough passage+ một chuyến đi khó khăn vì biển động<br />=to book [one''s] passage to+ ghi tên mua vé dành chỗ đi<br />- đoạn (bài văn, sách...)<br />=a famour passage+ một đoạn văn nổi tiếng<br />=a difficult passage+ một đoạn khó khăn<br />- sự thông qua (một dự luật...)<br />- (số nhiều) quan hệ giữa hai người; sự chuyện trò trao đổi giữa hai người; chuyện trò tri kỷ giữa hai người<br />=to have stormy passages with somebody+ trao đổi tranh luận sôi nổi với ai<br />- (âm nhạc) nét lướt<br />- (từ Mỹ,nghĩa Mỹ) sự đi ỉa<br />!bird of passage<br />- (xem) bird<br />!passage of (at) arms<br />- (thường) (nghĩa bóng) trận đánh; cuộc va chạm, cuộc cãi cọ<br />*  nội động từ<br />- đi né sang một bên (ngựa, người cưỡi ngựa)<br />*  ngoại động từ<br />- làm cho (ngựa) đi né sang một bên</Q></N></I></F></C>'),
(87730, 'passageway', '<C><F><I><N><Q>@passageway<br />* danh từ<br />- hành lang; đường phố nhỏ, ngõ</Q></N></I></F></C>'),
(87731, 'passageways', '<C><F><I><N><Q>@passageway<br />* danh từ<br />- hành lang; đường phố nhỏ, ngõ</Q></N></I></F></C>'),
(87732, 'passant', '<C><F><I><N><Q>@passant /''pæsənt/<br />*  tính từ<br />- trong tư thế đi với mắt nhìn về phía bên phải chân đi đằng trước giơ lên (sư tử trong huy chương)</Q></N></I></F></C>'),
(87733, 'passbook', '<C><F><I><N><Q>@passbook /''pɑ:sbuk/<br />*  danh từ<br />- số tiền gửi ngân hàng</Q></N></I></F></C>'),
(87734, 'passbooks', '<C><F><I><N><Q>@passbook /''pɑ:sbuk/<br />*  danh từ<br />- số tiền gửi ngân hàng</Q></N></I></F></C>'),
(87735, 'Passche price index', '<C><F><I><N><Q>@Passche price index<br />- (Econ) Chỉ số giá Passche.<br />+ Chỉ số giá gia quyền theo năm hiện hành.</Q></N></I></F></C>'),
(87736, 'passe', '<C><F><I><N><Q>@passe<br />* tính từ<br />- đã quá thời; lỗi thời<br />- đã quá cũ</Q></N></I></F></C><C><F><I><N><Q>@passé /pɑ:''sei/<br />*  tính từ,  danh từ giống cái passée<br />- tài hết sức tàn; quá thời, lỗi thời</Q></N></I></F></C>'),
(87737, 'passe-partout', '<C><F><I><N><Q>@passe-partout /,pɑ:spɑ:''tu:/<br />*  danh từ<br />- khoá vạn năng<br />- khung ảnh lồng kính (có nẹp giấy nhựa)</Q></N></I></F></C>'),
(87738, 'passe-pied', '<C><F><I><N><Q>@passe-pied<br />* danh từ<br />- điệu vũ lướt chân</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(87739, 'passed', '<C><F><I><N><Q>@passed<br />* tính từ<br />- hợp qui cách (thi cử, ứng tuyển)</Q></N></I></F></C><C><F><I><N><Q>@pass /pɑ:s/<br />*  nội động từ<br />- đi, đi lên; đi qua, đi ngang qua<br />=to pass down the street+ đi xuống phố<br />=to pass along a wall+ đi dọc theo bức tường<br />=to pass across a road+ đi ngang qua đường<br />=to pass over a bridge+ đi qua cầu<br />=pass along!+ đi lên!, đi đi!<br />- (nghĩa bóng) trải qua<br />=to pass through many hardships+ trải qua nhiều khó khăn gian khổ<br />- chuyển qua, truyền, trao, đưa<br />=to pass from mouth to mouth+ truyền từ miệng người này sang miệng người khác<br />- (+ into) chuyển qua, chuyển sang, biến thành, trở thành, đổi thành<br />=when Spring passes into Summer+ câu đó đã trở thành tục ngữ<br />- qua đi, biến đi, mất đi; chết<br />=his fit of anger will soon+ cơn giận của hắn rồi sẽ qua đi ngay<br />=to pass hence; to pass from among us+ đã chết, đã từ trần<br />- trôi đi, trôi qua<br />=time passes rapidly+ thời gian trôi nhanh<br />- được thông qua, được chấp nhận<br />=the bill is sure to pass+ bản dự luật chắc chắn sẽ được thông qua<br />=these theories will not pass now+ những lý thuyết đó sẽ không được chấp nhận nữa<br />- thi đỗ<br />- xảy ra, được làm, được nói đến<br />=I could not hear what was passing+ tôi không nghe thấy những gì người ta nói đến<br />- bị bỏ qua, bị lờ đi; qua đi không ai hay biết<br />=I can''t let it pass+ tôi không thể nào để cho câu chuyện đó bị bỏ qua được<br />- (+ over,  by) bỏ qua, lờ đi<br />=to pass over someone''s mistakes+ bỏ qua lỗi của ai<br />- (đánh bài) bỏ lượt, bỏ bài<br />- (pháp lý) được tuyên án<br />=the verdict passed for the plaintiff+ bản án được tuyên bố cho bên nguyên thắng<br />- (+ upon) xét xử, tuyên án<br />- lưu hành, tiêu được (tiền)<br />=this coin will not pass+ đồng tiền này không tiêu được<br />- (thể dục,thể thao) đâm, tấn công (đấu kiếm)<br />- (từ Mỹ,nghĩa Mỹ) đi ngoài, đi tiêu<br />*  ngoại động từ<br />- qua, đi qua, đi ngang qua, vượt qua<br />=to pass the frontier+ vượt qua biên giới<br />=to pass a mountain range+ vượt qua dãy núi<br />- quá, vượt quá, hơn hẳn<br />=he has passed fifty+ ông ta đã hơn (ngoài) năm mươi<br />=to pass someone''s comprehension+ vượt quá sự biểu biết của ai<br />- thông qua, được đem qua thông qua<br />=to pass a bill+ thông qua một bản dự luật<br />=the bill must pass the parliament+ bản dự luật phải được đem thông qua ở nghị viện<br />- qua được, đạt tiêu chuẩn qua (kỳ thi, cuộc thử thách...)<br />=to pass the examination+ qua được kỳ thi, thi đỗ<br />=to pass muster+ được cho là được, được công nhận là xứng đáng<br />- duyệt<br />=to pass troops+ duyệt binh<br />- đưa qua, chuyển qua, truyền tay, trao<br />=to pass one''s hand over one''s face+ đưa tay vuốt mặt<br />- (thể dục,thể thao) chuyền (bóng...)<br />- cho lưu hành, đem tiêu (tiền giả...)<br />- phát biểu, nói ra, đưa ra (ý kiến...); tuyên (án...)<br />=to pass remarks upon somebody+ phát biểu những ý kiến nhận xét về ai<br />=to pass a sentence+ tuyên án<br />- hứa (lời...)<br />=to pass one''s word+ hứa chắc, đoan chắc<br />!to pass away<br />- trôi qua, đi qua, đi mất<br />- chết, qua đời<br />!to pass by<br />- đi qua, đi ngang qua<br />- bỏ qua, lờ đi, nhắm mắt bỏ qua, làm ngơ<br />!to pass for<br />- được coi là; có tiếng là<br />=to pass for a scholar+ được coi là một học giả<br />!to pass in<br />- chết ((cũng) to pass one''s checks)<br />!to pass off<br />- mất đi, biến mất (cảm giác...)<br />- diễn ra, được thực hiện, được hoàn thành<br />=the whole thing passed off without a hitch+ mọi việc diễn ra không có gì trắc trở<br />- đem tiêu trót lọt (tiền giả...); gian dối tống ấn (cho ai cái gì...)<br />=he passed it off upon her for a Rubens+ hắn gian dối tống ấn cho bà ta một bức tranh mạo là của Ru-ben<br />=to pass oneself off+ mạo nhận là<br />=he passes himself off as a doctor+ nó mạo nhận là một bác sĩ<br />- đánh lạc, sự chú ý, làm cho không chú ý (cái gì)<br />!to pass on<br />- đi tiếp<br />!to pass out<br />- (thực vật học) chết, qua đời<br />- (thông tục) say không biết trời đất gì<br />- mê đi, bất tỉnh<br />!to pass over<br />- băng qua<br />- chết<br />- làm lơ đi, bỏ qua<br />=to pass it over in silence+ làm lơ đi<br />!to pass round<br />- chuyền tay, chuyền theo vòng<br />- đi vòng quanh<br />- cuộn tròn<br />=to pass a rope round a cask+ cuộn cái dây thừng quanh thúng<br />!to pass through<br />- đi qua<br />- trải qua, kinh qua<br />!to pass up<br />- (từ Mỹ,nghĩa Mỹ) từ chối, từ bỏ, khước từ<br />!to pass water<br />- đái<br />*  danh từ<br />- sự thi đỗ; sự trúng tuyển hạng thứ (ở trường đại học)<br />- hoàn cảnh gay go, tình thế gay go<br />=things have come to a pass+ sự việc đi đến chỗ gay go<br />- giấy phép, giấy thông hành; giấy đi xe lửa không mất tiền; giấy vào cửa không mất tiền ((cũng) free pass); thẻ ra vào (triển lãm...); vé mời (xem hát...)<br />- (thể dục,thể thao) sự chuyền bóng (bóng đá); cú đâm, cú tấn công (đấu kiếm)<br />- trò gian dối, trò bài tây<br />- sự đưa tay qua (làm thôi miên...)<br />!to bring to pass<br />- (xem) bring<br />!to come to pass<br />- xảy ra<br />!to make a pass at somebody<br />- (từ lóng) tán tỉnh gỡ gạc ai, gạ gẫm ai<br />*  danh từ<br />- đèo, hẽm núi<br />- (quân sự) con đường độc đạo, vị trí cửa ngõ (để tiến vào một nước)<br />- (hàng hải) eo biển tàu bè qua lại được<br />- cửa thông cho cá vào đăng<br />- (kỹ thuật) khuôn cán, rãnh cán<br />!to sell the pass<br />- (nghĩa bóng) phản bội một cuộc đấu tranh<br /><br />@pass<br />- vượt qua</Q></N></I></F></C>'),
(87740, 'passee', '<C><F><I><N><Q>@passée /passée/<br />*  tính từ<br />- danh từ giống cái của passé<br />=a passée belle+ cô nàng quá lứa hết duyên</Q></N></I></F></C>'),
(87741, 'passement', '<C><F><I><N><Q>@passement<br />* danh từ<br />- tấm thêu/ren<br />* ngoại động từ<br />- trang trí bằng tấm thêu, tấm ren</Q></N></I></F></C>'),
(87742, 'passementerie', '<C><F><I><N><Q>@passementerie /,pɑ:smɑ:ɳ''tri:/<br />*  danh từ<br />- đồ ren tua kim tuyến</Q></N></I></F></C>'),
(87743, 'passenger', '<C><F><I><N><Q>@passenger /''pæsindʤə/<br />*  danh từ<br />- hành khách (đi tàu xe...)<br />- (thông tục) thành viên không có khả năng làm được trò trống gì; thành viên kém không đóng góp đóng góp được gì (cho tổ, đội...)<br />- (định ngữ) (thuộc) hành khách; để chở hành khách<br />=a passenger boat+ tàu thuỷ chở hành khách<br />=a passenger train+ xe lửa chở hành khách</Q></N></I></F></C>'),
(87744, 'passenger-boat', '<C><F><I><N><Q>@passenger-boat<br />* danh từ<br />- thuyền/ tàu chở khách</Q></N></I></F></C>'),
(87745, 'passenger-pigeon', '<C><F><I><N><Q>@passenger-pigeon<br />* danh từ<br />- (động vật học) chim bồ câu di cư theo mùa</Q></N></I></F></C>'),
(87746, 'passenger-train', '<C><F><I><N><Q>@passenger-train<br />* danh từ<br />- tàu hoả chở khách</Q></N></I></F></C>'),
(87747, 'passengers', '<C><F><I><N><Q>@passenger /''pæsindʤə/<br />*  danh từ<br />- hành khách (đi tàu xe...)<br />- (thông tục) thành viên không có khả năng làm được trò trống gì; thành viên kém không đóng góp đóng góp được gì (cho tổ, đội...)<br />- (định ngữ) (thuộc) hành khách; để chở hành khách<br />=a passenger boat+ tàu thuỷ chở hành khách<br />=a passenger train+ xe lửa chở hành khách</Q></N></I></F></C>'),
(87748, 'passer', '<C><F><I><N><Q>@passer /''pɑ:sə/<br />*  danh từ<br />- (như) passer-by<br />- người trúng tuyển hạng thứ (ở trường đại học)</Q></N></I></F></C>'),
(87749, 'passer-by', '<C><F><I><N><Q>@passer-by /''pɑ:sə''bai/<br />*  danh từ,  số nhiều passers-by  /''pɑ:səz''bai/<br />- khách qua đường ((cũng) passer)</Q></N></I></F></C>'),
(87750, 'passerine', '<C><F><I><N><Q>@passerine /''pæsərain/<br />*  tính từ<br />- (động vật học) (thuộc) bộ chim sẻ<br />- nhỏ như chim sẻ<br />*  danh từ<br />- (động vật học) chim thuộc bộ chim sẻ</Q></N></I></F></C>'),
(87751, 'passerines', '<C><F><I><N><Q>@passerine /''pæsərain/<br />*  tính từ<br />- (động vật học) (thuộc) bộ chim sẻ<br />- nhỏ như chim sẻ<br />*  danh từ<br />- (động vật học) chim thuộc bộ chim sẻ</Q></N></I></F></C>'),
(87752, 'passers', '<C><F><I><N><Q>@passer /''pɑ:sə/<br />*  danh từ<br />- (như) passer-by<br />- người trúng tuyển hạng thứ (ở trường đại học)</Q></N></I></F></C>'),
(87753, 'passers-by', '<C><F><I><N><Q>@passers-by /''pɑ:sə''bai/<br />*  danh từ,  số nhiều passers-by  /''pɑ:səz''bai/<br />- khách qua đường ((cũng) passer)</Q></N></I></F></C><C><F><I><N><Q>@passer-by /''pɑ:sə''bai/<br />*  danh từ,  số nhiều passers-by  /''pɑ:səz''bai/<br />- khách qua đường ((cũng) passer)</Q></N></I></F></C>'),
(87754, 'passes', '<C><F><I><N><Q>@pass /pɑ:s/<br />*  nội động từ<br />- đi, đi lên; đi qua, đi ngang qua<br />=to pass down the street+ đi xuống phố<br />=to pass along a wall+ đi dọc theo bức tường<br />=to pass across a road+ đi ngang qua đường<br />=to pass over a bridge+ đi qua cầu<br />=pass along!+ đi lên!, đi đi!<br />- (nghĩa bóng) trải qua<br />=to pass through many hardships+ trải qua nhiều khó khăn gian khổ<br />- chuyển qua, truyền, trao, đưa<br />=to pass from mouth to mouth+ truyền từ miệng người này sang miệng người khác<br />- (+ into) chuyển qua, chuyển sang, biến thành, trở thành, đổi thành<br />=when Spring passes into Summer+ câu đó đã trở thành tục ngữ<br />- qua đi, biến đi, mất đi; chết<br />=his fit of anger will soon+ cơn giận của hắn rồi sẽ qua đi ngay<br />=to pass hence; to pass from among us+ đã chết, đã từ trần<br />- trôi đi, trôi qua<br />=time passes rapidly+ thời gian trôi nhanh<br />- được thông qua, được chấp nhận<br />=the bill is sure to pass+ bản dự luật chắc chắn sẽ được thông qua<br />=these theories will not pass now+ những lý thuyết đó sẽ không được chấp nhận nữa<br />- thi đỗ<br />- xảy ra, được làm, được nói đến<br />=I could not hear what was passing+ tôi không nghe thấy những gì người ta nói đến<br />- bị bỏ qua, bị lờ đi; qua đi không ai hay biết<br />=I can''t let it pass+ tôi không thể nào để cho câu chuyện đó bị bỏ qua được<br />- (+ over,  by) bỏ qua, lờ đi<br />=to pass over someone''s mistakes+ bỏ qua lỗi của ai<br />- (đánh bài) bỏ lượt, bỏ bài<br />- (pháp lý) được tuyên án<br />=the verdict passed for the plaintiff+ bản án được tuyên bố cho bên nguyên thắng<br />- (+ upon) xét xử, tuyên án<br />- lưu hành, tiêu được (tiền)<br />=this coin will not pass+ đồng tiền này không tiêu được<br />- (thể dục,thể thao) đâm, tấn công (đấu kiếm)<br />- (từ Mỹ,nghĩa Mỹ) đi ngoài, đi tiêu<br />*  ngoại động từ<br />- qua, đi qua, đi ngang qua, vượt qua<br />=to pass the frontier+ vượt qua biên giới<br />=to pass a mountain range+ vượt qua dãy núi<br />- quá, vượt quá, hơn hẳn<br />=he has passed fifty+ ông ta đã hơn (ngoài) năm mươi<br />=to pass someone''s comprehension+ vượt quá sự biểu biết của ai<br />- thông qua, được đem qua thông qua<br />=to pass a bill+ thông qua một bản dự luật<br />=the bill must pass the parliament+ bản dự luật phải được đem thông qua ở nghị viện<br />- qua được, đạt tiêu chuẩn qua (kỳ thi, cuộc thử thách...)<br />=to pass the examination+ qua được kỳ thi, thi đỗ<br />=to pass muster+ được cho là được, được công nhận là xứng đáng<br />- duyệt<br />=to pass troops+ duyệt binh<br />- đưa qua, chuyển qua, truyền tay, trao<br />=to pass one''s hand over one''s face+ đưa tay vuốt mặt<br />- (thể dục,thể thao) chuyền (bóng...)<br />- cho lưu hành, đem tiêu (tiền giả...)<br />- phát biểu, nói ra, đưa ra (ý kiến...); tuyên (án...)<br />=to pass remarks upon somebody+ phát biểu những ý kiến nhận xét về ai<br />=to pass a sentence+ tuyên án<br />- hứa (lời...)<br />=to pass one''s word+ hứa chắc, đoan chắc<br />!to pass away<br />- trôi qua, đi qua, đi mất<br />- chết, qua đời<br />!to pass by<br />- đi qua, đi ngang qua<br />- bỏ qua, lờ đi, nhắm mắt bỏ qua, làm ngơ<br />!to pass for<br />- được coi là; có tiếng là<br />=to pass for a scholar+ được coi là một học giả<br />!to pass in<br />- chết ((cũng) to pass one''s checks)<br />!to pass off<br />- mất đi, biến mất (cảm giác...)<br />- diễn ra, được thực hiện, được hoàn thành<br />=the whole thing passed off without a hitch+ mọi việc diễn ra không có gì trắc trở<br />- đem tiêu trót lọt (tiền giả...); gian dối tống ấn (cho ai cái gì...)<br />=he passed it off upon her for a Rubens+ hắn gian dối tống ấn cho bà ta một bức tranh mạo là của Ru-ben<br />=to pass oneself off+ mạo nhận là<br />=he passes himself off as a doctor+ nó mạo nhận là một bác sĩ<br />- đánh lạc, sự chú ý, làm cho không chú ý (cái gì)<br />!to pass on<br />- đi tiếp<br />!to pass out<br />- (thực vật học) chết, qua đời<br />- (thông tục) say không biết trời đất gì<br />- mê đi, bất tỉnh<br />!to pass over<br />- băng qua<br />- chết<br />- làm lơ đi, bỏ qua<br />=to pass it over in silence+ làm lơ đi<br />!to pass round<br />- chuyền tay, chuyền theo vòng<br />- đi vòng quanh<br />- cuộn tròn<br />=to pass a rope round a cask+ cuộn cái dây thừng quanh thúng<br />!to pass through<br />- đi qua<br />- trải qua, kinh qua<br />!to pass up<br />- (từ Mỹ,nghĩa Mỹ) từ chối, từ bỏ, khước từ<br />!to pass water<br />- đái<br />*  danh từ<br />- sự thi đỗ; sự trúng tuyển hạng thứ (ở trường đại học)<br />- hoàn cảnh gay go, tình thế gay go<br />=things have come to a pass+ sự việc đi đến chỗ gay go<br />- giấy phép, giấy thông hành; giấy đi xe lửa không mất tiền; giấy vào cửa không mất tiền ((cũng) free pass); thẻ ra vào (triển lãm...); vé mời (xem hát...)<br />- (thể dục,thể thao) sự chuyền bóng (bóng đá); cú đâm, cú tấn công (đấu kiếm)<br />- trò gian dối, trò bài tây<br />- sự đưa tay qua (làm thôi miên...)<br />!to bring to pass<br />- (xem) bring<br />!to come to pass<br />- xảy ra<br />!to make a pass at somebody<br />- (từ lóng) tán tỉnh gỡ gạc ai, gạ gẫm ai<br />*  danh từ<br />- đèo, hẽm núi<br />- (quân sự) con đường độc đạo, vị trí cửa ngõ (để tiến vào một nước)<br />- (hàng hải) eo biển tàu bè qua lại được<br />- cửa thông cho cá vào đăng<br />- (kỹ thuật) khuôn cán, rãnh cán<br />!to sell the pass<br />- (nghĩa bóng) phản bội một cuộc đấu tranh<br /><br />@pass<br />- vượt qua</Q></N></I></F></C>'),
(87755, 'passibility', '<C><F><I><N><Q>@passibility /,pæsi''biliti/<br />*  danh từ<br />- (tôn giáo) tính dễ cảm động, tính dễ xúc động</Q></N></I></F></C>'),
(87756, 'passible', '<C><F><I><N><Q>@passible /''pæsibl/<br />*  tính từ<br />- (tôn giáo) dễ cảm động, dễ xúc động<br />- chịu đựng được đau khổ</Q></N></I></F></C>'),
(87757, 'passim', '<C><F><I><N><Q>@passim /''pæsim/<br />*  phó từ<br />- khắp nơi, đây đó (dùng để nói về một tác giả...)<br />=this occurs in Milton passim+ điều đó thấy ở khắp trong tác phẩm của Min-tơn</Q></N></I></F></C>'),
(87758, 'passimeter', '<C><F><I><N><Q>@passimeter /''pæsimitə/<br />*  danh từ<br />- cửa vào ga tự động (xe lửa dưới hầm)</Q></N></I></F></C>'),
