(87760, 'passing-bell', '<C><F><I><N><Q>@passing-bell /''pɑ:siɳbel/<br />*  danh từ<br />- hồi chuông cáo chung, hồi chuông báo tử</Q></N></I></F></C>'),
(87761, 'passing-note', '<C><F><I><N><Q>@passing-note /''pɑ:siɳnout/<br />*  danh từ<br />- (âm nhạc) nốt lưới</Q></N></I></F></C>'),
(87762, 'passingly', '<C><F><I><N><Q>@passingly<br />- xem passing</Q></N></I></F></C>'),
(87763, 'passings', '<C><F><I><N><Q>@passing /''pɑ:siɳ/<br />*  danh từ<br />- sự qua, sự trôi qua (thời gian...)<br />*  tính từ<br />- qua đi, trôi qua<br />- thoáng qua, giây lát; ngẫu nhiên, tình cờ<br />*  phó từ<br />- (từ cổ,nghĩa cổ) hết sức, vô cùng<br />=passing rich+ hết sức giàu</Q></N></I></F></C>'),
(87764, 'passion', '<C><F><I><N><Q>@passion /''pæʃn/<br />*  danh từ<br />- cảm xúc mạnh mẽ, tình cảm nồng nàn<br />- sự giận dữ<br />=to fly (fall, get) into a passion+ nổi giận, nổi tam bành<br />- tình dục, tình yêu<br />=sexual passion+ tình dục<br />=tender passion+ tình yêu<br />- sự say mê<br />=to have a passion for something+ say mê cái gì<br />- (tôn giáo) (the passion) những nỗi khổ hình của Chúa Giê-xu; bài ca thuật lại những nỗi khổ hình của Chúa Giê-xu<br />*  nội động từ<br />- (thơ ca) say mê, yêu tha thiết, yêu nồng nàn</Q></N></I></F></C>'),
(87765, 'passion-flower', '<C><F><I><N><Q>@passion-flower /''pæʃn,flauə/<br />*  danh từ<br />- hoa lạc tiên<br />- (thực vật học) cây lạc tiên</Q></N></I></F></C>'),
(87766, 'passion-fruit', '<C><F><I><N><Q>@passion-fruit<br />* danh từ<br />- (thực vật học) quả lạc tiên</Q></N></I></F></C>'),
(87767, 'passion-play', '<C><F><I><N><Q>@passion-play /''pæʃnplei/<br />*  danh từ<br />- kịch huyền bí mô tả những khổ hình của Chúa</Q></N></I></F></C>'),
(87768, 'passion sunday', '<C><F><I><N><Q>@passion sunday<br />* danh từ(Passion Sunday)+chủ nhật thụ hình; ngày chủ nhật thứ năm trong mùa chay (trong Cơ đốc giáo)</Q></N></I></F></C>'),
(87769, 'passion-vine', '<C><F><I><N><Q>@passion-vine<br />* danh từ<br />- xem passion-flower</Q></N></I></F></C>'),
(87770, 'passion week', '<C><F><I><N><Q>@passion week<br />* danh từ<br />- tuần lễ thụ hình (tuần lễ giữa Chủ nhật thụ hình của mùa chay và ngày hội cành)</Q></N></I></F></C>'),
(87771, 'passional', '<C><F><I><N><Q>@passional /''pæʃənl/<br />*  tính từ<br />- (thuộc) say mê; (thuộc) tình dục<br />*  danh từ+ (passionary) /''pæʃnəri/<br />- sách kể những nỗi chịu đựng thống khổ của những kẻ chết vì đạo</Q></N></I></F></C>'),
(87772, 'passionary', '<C><F><I><N><Q>@passionary /''pæʃənl/<br />*  tính từ<br />- (thuộc) say mê; (thuộc) tình dục<br />*  danh từ+ (passionary) /''pæʃnəri/<br />- sách kể những nỗi chịu đựng thống khổ của những kẻ chết vì đạo</Q></N></I></F></C>'),
(87773, 'passionate', '<C><F><I><N><Q>@passionate /''pæʃənit/<br />*  tính từ<br />- sôi nổi, say sưa, say đắm, nồng nàn, nồng nhiệt, thiết tha<br />=a passionate speech+ một bài diễn văn đầy nhiệt tình<br />=a passionate nature+ bản tính sôi nổi<br />- dễ giận, dễ cáu</Q></N></I></F></C>'),
(87774, 'passionately', '<C><F><I><N><Q>@passionately<br />* phó từ<br />- một cách say đắm, nhiệt tình; nồng nhiệt, mạnh mẽ, rất</Q></N></I></F></C>'),
