(87776, 'passionists', '<C><F><I><N><Q>@passionists<br />* danh từ<br />- số nhiều<br />- thành viên giáo đoàn thụ nạn</Q></N></I></F></C>'),
(87777, 'passionless', '<C><F><I><N><Q>@passionless /''pæʃnlis/<br />*  tính từ<br />- không sôi nổi, không say sưa, không nồng nàn, không nồng nhiệt, không thiết tha<br />- không nổi giận, điềm tĩnh</Q></N></I></F></C>'),
(87778, 'passions', '<C><F><I><N><Q>@passion /''pæʃn/<br />*  danh từ<br />- cảm xúc mạnh mẽ, tình cảm nồng nàn<br />- sự giận dữ<br />=to fly (fall, get) into a passion+ nổi giận, nổi tam bành<br />- tình dục, tình yêu<br />=sexual passion+ tình dục<br />=tender passion+ tình yêu<br />- sự say mê<br />=to have a passion for something+ say mê cái gì<br />- (tôn giáo) (the passion) những nỗi khổ hình của Chúa Giê-xu; bài ca thuật lại những nỗi khổ hình của Chúa Giê-xu<br />*  nội động từ<br />- (thơ ca) say mê, yêu tha thiết, yêu nồng nàn</Q></N></I></F></C>'),
(87779, 'passiontide', '<C><F><I><N><Q>@passiontide<br />* danh từ<br />- hai tuần lễ cuối của tuần chay</Q></N></I></F></C>'),
(87780, 'passivation', '<C><F><I><N><Q>@passivation /,pæsi''veiʃn/<br />*  danh từ<br />- (kỹ thuật) sự thụ động hoá<br />- sự oxy hoá chống gỉ<br />- sự rửa bằng axit</Q></N></I></F></C>'),
(87781, 'passive', '<C><F><I><N><Q>@passive /''pæsiv/<br />*  tính từ<br />- bị động, thụ động<br />=to remain passive+ ở trong thế bị động<br />- tiêu cực<br />=passive resistance+ sự kháng cự tiêu cực<br />- (ngôn ngữ học) bị động<br />=passive voice+ dạng bị động<br />- không phải trả lãi (nợ)<br />=passive debt+ nợ không phải trả lãi<br />*  danh từ<br />- (ngôn ngữ học) dạng bị động<br /><br />@passive<br />- bị động; (thống kê) không có phần trăm</Q></N></I></F></C>'),
