(87799, 'passé', '<C><F><I><N><Q>@passé /pɑ:''sei/<br />*  tính từ,  danh từ giống cái passée<br />- tài hết sức tàn; quá thời, lỗi thời</Q></N></I></F></C><C><F><I><N><Q>@passe<br />* tính từ<br />- đã quá thời; lỗi thời<br />- đã quá cũ</Q></N></I></F></C>'),
(87800, 'passée', '<C><F><I><N><Q>@passée /passée/<br />*  tính từ<br />- danh từ giống cái của passé<br />=a passée belle+ cô nàng quá lứa hết duyên</Q></N></I></F></C>'),
(87801, 'past', '<C><F><I><N><Q>@past /pɑ:st/<br />*  tính từ<br />- (thuộc) quá khứ, đã qua, (thuộc) dĩ vãng<br />=for the past few days+ mấy ngày qua<br />=his pain is past now+ cơn đau của anh ấy đã qua rồi<br />- (ngôn ngữ học) quá khứ<br />=past tense+ thói quá khứ<br />=past participle+ động tính từ quá khứ<br />*  danh từ<br />- quá khứ, dĩ vãng; quá khứ không hay ho gì<br />- (ngôn ngữ học) ((thường) the past) thời quá khứ<br />*  phó từ<br />- qua<br />=to walk past+ đi qua<br />=to run past+ chạy qua<br />- quá<br />=the train is past due+ xe lửa quá giờ rồi mà chưa đến<br />*  giới từ<br />- quá, vượt, quá, hơn<br />=it is past six+ đã quá sáu giờ hơn<br />=he is past fifty+ ông ta đã hơn (ngoài) năm mươi<br />=past endurance+ vượt quá sự chịu đựng, không thể chịu đựng nổi<br />- qua<br />=to run past the house+ chạy qua nhà</Q></N></I></F></C>'),
(87802, 'past master', '<C><F><I><N><Q>@past master /''pɑ:st,mɑ:stə/<br />*  danh từ<br />- người trước đây là thợ cả (phường hội)<br />- chủ tịch danh dự (một công ty...)<br />- người giỏi tột bậc; bậc thầy<br />=to be past_master in (of) a subject+ là bậc thầy về môn gì</Q></N></I></F></C>'),
(87803, 'past perfect', '<C><F><I><N><Q>@past perfect<br />* danh từ<br />- &lt;ngôn&gt; dạng thời quá khứ xa<br />* tính từ<br />- &lt;ngôn&gt; thời quá khứ xa</Q></N></I></F></C>'),
