(87849, 'pastoral', '<C><F><I><N><Q>@pastoral /''pɑ:stə/<br />*  tính từ<br />- (thuộc) người chăn súc vật, (thuộc) mục đồng<br />- có tính chất đồng quê<br />=pastoral scenery+ phong cảnh đồng quê<br />=pastoral poems+ những bài thơ về đồng quê<br />- (thuộc) đồng cỏ<br />=pastoral land+ đất đồng cỏ<br />- (thuộc) mục sư<br />*  danh từ<br />- bức hoạ đồng quê; bài thơ đồng quê; kịch đồng quê...<br />- thư của mục sư gửi cho con chiên</Q></N></I></F></C>'),
