(87869, 'pasts', '<C><F><I><N><Q>@past /pɑ:st/<br />*  tính từ<br />- (thuộc) quá khứ, đã qua, (thuộc) dĩ vãng<br />=for the past few days+ mấy ngày qua<br />=his pain is past now+ cơn đau của anh ấy đã qua rồi<br />- (ngôn ngữ học) quá khứ<br />=past tense+ thói quá khứ<br />=past participle+ động tính từ quá khứ<br />*  danh từ<br />- quá khứ, dĩ vãng; quá khứ không hay ho gì<br />- (ngôn ngữ học) ((thường) the past) thời quá khứ<br />*  phó từ<br />- qua<br />=to walk past+ đi qua<br />=to run past+ chạy qua<br />- quá<br />=the train is past due+ xe lửa quá giờ rồi mà chưa đến<br />*  giới từ<br />- quá, vượt, quá, hơn<br />=it is past six+ đã quá sáu giờ hơn<br />=he is past fifty+ ông ta đã hơn (ngoài) năm mươi<br />=past endurance+ vượt quá sự chịu đựng, không thể chịu đựng nổi<br />- qua<br />=to run past the house+ chạy qua nhà</Q></N></I></F></C>'),
(87870, 'pasturable', '<C><F><I><N><Q>@pasturable<br />- xem pasture</Q></N></I></F></C>'),
(87871, 'pasturage', '<C><F><I><N><Q>@pasturage /''pɑ:stjuridʤ/<br />*  danh từ<br />- đồng cỏ thả súc vật<br />- sự chăn thả</Q></N></I></F></C>'),
(87872, 'pasturages', '<C><F><I><N><Q>@pasturage /''pɑ:stjuridʤ/<br />*  danh từ<br />- đồng cỏ thả súc vật<br />- sự chăn thả</Q></N></I></F></C>'),
(87873, 'pasture', '<C><F><I><N><Q>@pasture /''pɑ:stʃə/<br />*  danh từ<br />- đồng cỏ, bãi cỏ<br />- cỏ (cho súc vật gặm)<br />*  ngoại động từ<br />- chăn thả (súc vật)<br />- ăn cỏ (ở đồng cỏ...)<br />*  nội động từ<br />- ăn cỏ, gặm cỏ</Q></N></I></F></C>');
