(87879, 'pasty', '<C><F><I><N><Q>@pasty /''pwsti/<br />*  danh từ<br />- chả nướng bọc bột<br />*  tính từ<br />- sền sệt, nhão (như bột nhão...)<br />- xanh xao, nhợt nhạt ((cũng) pasty-faced)</Q></N></I></F></C>'),
(87880, 'pasty-faced', '<C><F><I><N><Q>@pasty-faced /''pwsti,feist/<br />*  tính từ<br />- xanh xao, nhợt nhạt ((cũng) pasty)</Q></N></I></F></C>'),
(87881, 'pat', '<C><F><I><N><Q>@pat /pæt/<br />*  danh từ<br />- cái vỗ nhẹ, cái vỗ về; tiếng vỗ nhẹ<br />- khoanh bơ nhỏ<br />*  ngoại động từ<br />- vỗ nhẹ, vỗ về<br />=to pat someone on the back+ vỗ nhẹ vào lưng ai<br />- vỗ cho dẹt xuống<br />*  nội động từ<br />- (+ upon) vỗ nhẹ (vào)<br />!to pat oneself on the back<br />- (nghĩa bóng) tự mình khen mình<br />*  phó từ<br />- đúng lúc<br />=the answer came pat+ câu trả lời đến đúng lúc<br />- rất sẵn sàng<br />!to stand pat<br />- không đổi quân bài (đánh bài xì)<br />- (nghĩa bóng) giữ vững lập trường; bám lấy quyết định đã có<br />*  tính từ<br />- đúng lúc<br />- rất sẵn sàng</Q></N></I></F></C>'),
(87882, 'patagia', '<C><F><I><N><Q>@patagia<br />* danh từ<br />- số nhiều<br />- xem patagium</Q></N></I></F></C>'),
(87883, 'patagial', '<C><F><I><N><Q>@patagial<br />* tính từ<br />- (độn gvật học) thuộc mảng dù lượn</Q></N></I></F></C>'),
(87884, 'patagium', '<C><F><I><N><Q>@patagium<br />* danh từ<br />- số nhiều patagia<br />- (động vật học) mảng dù lượn; mấu lưng ngực trước (côn trùng)</Q></N></I></F></C>'),
(87885, 'patamar', '<C><F><I><N><Q>@patamar<br />* danh từ<br />- thuyền buôn ở duyên hải ấn độ</Q></N></I></F></C>'),
(87886, 'patard', '<C><F><I><N><Q>@patard /pe''tɑ:d/<br />*  danh từ<br />- bộc phá<br />- pháo (để đốt)<br />!to be hoist with one''s own petard<br />- (xem) hoist</Q></N></I></F></C>'),
(87887, 'patch', '<C><F><I><N><Q>@patch /pætʃ/<br />*  danh từ<br />- miếng vá<br />- miếng băng dính, miếng thuốc cao (trên vết thương...)<br />- miếng bông che mắt đau<br />- nốt ruồi giả (để tô điểm trên mặt)<br />- mảnh đất<br />=a patch of potatoes+ một đám (mảnh) khoai<br />- màng, vết, đốm lớn<br />- mảnh thừa, mảnh vụn<br />!to strike a bad patch<br />- gặp vận bỉ, gặp lúc không may<br />!not a patch on<br />- (thông tục) không mùi gì khi đem so sánh với, không thấm gót khi đem so sánh với<br />*  ngoại động từ<br />- vá<br />=to patch a tyre+ vá một cái lốp<br />- dùng để vá, làm miếng vá (cho cái gì)<br />=it will patch the hole well enough+ miếng đó đủ để vá cho cái lỗ thủng<br />- ráp, nối (các mảnh, các mấu vào với nhau)<br />- hiện ra từng mảng lốm đốm, loang lổ (trên vật gì)<br />!to patch up<br />- vá víu, vá qua loa<br />- (nghĩa bóng) dàn xếp; dàn xếp qua loa, dàn xếp tạm thời (một vụ bất hoà...)</Q></N></I></F></C>'),
(87888, 'patch-pocket', '<C><F><I><N><Q>@patch-pocket<br />* danh từ<br />- túi nổi, túi đắp (trên quần áo)</Q></N></I></F></C>'),
(87889, 'patchable', '<C><F><I><N><Q>@patchable<br />- xem patch</Q></N></I></F></C>'),
(87890, 'patched', '<C><F><I><N><Q>@patch /pætʃ/<br />*  danh từ<br />- miếng vá<br />- miếng băng dính, miếng thuốc cao (trên vết thương...)<br />- miếng bông che mắt đau<br />- nốt ruồi giả (để tô điểm trên mặt)<br />- mảnh đất<br />=a patch of potatoes+ một đám (mảnh) khoai<br />- màng, vết, đốm lớn<br />- mảnh thừa, mảnh vụn<br />!to strike a bad patch<br />- gặp vận bỉ, gặp lúc không may<br />!not a patch on<br />- (thông tục) không mùi gì khi đem so sánh với, không thấm gót khi đem so sánh với<br />*  ngoại động từ<br />- vá<br />=to patch a tyre+ vá một cái lốp<br />- dùng để vá, làm miếng vá (cho cái gì)<br />=it will patch the hole well enough+ miếng đó đủ để vá cho cái lỗ thủng<br />- ráp, nối (các mảnh, các mấu vào với nhau)<br />- hiện ra từng mảng lốm đốm, loang lổ (trên vật gì)<br />!to patch up<br />- vá víu, vá qua loa<br />- (nghĩa bóng) dàn xếp; dàn xếp qua loa, dàn xếp tạm thời (một vụ bất hoà...)</Q></N></I></F></C>'),
(87891, 'patcher', '<C><F><I><N><Q>@patcher<br />- xem patch</Q></N></I></F></C>'),
(87892, 'patchery', '<C><F><I><N><Q>@patchery /''pætʃəri/<br />*  danh từ<br />- sự vá (đồ rách)<br />- đồ vật chấp vá; việc làm chấp vá</Q></N></I></F></C>'),
(87893, 'patches', '<C><F><I><N><Q>@patch /pætʃ/<br />*  danh từ<br />- miếng vá<br />- miếng băng dính, miếng thuốc cao (trên vết thương...)<br />- miếng bông che mắt đau<br />- nốt ruồi giả (để tô điểm trên mặt)<br />- mảnh đất<br />=a patch of potatoes+ một đám (mảnh) khoai<br />- màng, vết, đốm lớn<br />- mảnh thừa, mảnh vụn<br />!to strike a bad patch<br />- gặp vận bỉ, gặp lúc không may<br />!not a patch on<br />- (thông tục) không mùi gì khi đem so sánh với, không thấm gót khi đem so sánh với<br />*  ngoại động từ<br />- vá<br />=to patch a tyre+ vá một cái lốp<br />- dùng để vá, làm miếng vá (cho cái gì)<br />=it will patch the hole well enough+ miếng đó đủ để vá cho cái lỗ thủng<br />- ráp, nối (các mảnh, các mấu vào với nhau)<br />- hiện ra từng mảng lốm đốm, loang lổ (trên vật gì)<br />!to patch up<br />- vá víu, vá qua loa<br />- (nghĩa bóng) dàn xếp; dàn xếp qua loa, dàn xếp tạm thời (một vụ bất hoà...)</Q></N></I></F></C>'),
(87894, 'patchier', '<C><F><I><N><Q>@patchy /''pætʃi/<br />*  tính từ<br />- vá víu; chắp vá ((nghĩa đen) &amp; (nghĩa bóng))<br />=his knowledge is patchy+ kiến thức của hắn chắp vá thiếu hệ thống</Q></N></I></F></C>'),
(87895, 'patchiest', '<C><F><I><N><Q>@patchy /''pætʃi/<br />*  tính từ<br />- vá víu; chắp vá ((nghĩa đen) &amp; (nghĩa bóng))<br />=his knowledge is patchy+ kiến thức của hắn chắp vá thiếu hệ thống</Q></N></I></F></C>'),
