(87897, 'patchiness', '<C><F><I><N><Q>@patchiness<br />* danh từ<br />- sự chắp vá, việc chắp vá; sự không đều<br />- tính chất lả tả, loang lổ, lốm đốm</Q></N></I></F></C>'),
(87898, 'patching', '<C><F><I><N><Q>@patch /pætʃ/<br />*  danh từ<br />- miếng vá<br />- miếng băng dính, miếng thuốc cao (trên vết thương...)<br />- miếng bông che mắt đau<br />- nốt ruồi giả (để tô điểm trên mặt)<br />- mảnh đất<br />=a patch of potatoes+ một đám (mảnh) khoai<br />- màng, vết, đốm lớn<br />- mảnh thừa, mảnh vụn<br />!to strike a bad patch<br />- gặp vận bỉ, gặp lúc không may<br />!not a patch on<br />- (thông tục) không mùi gì khi đem so sánh với, không thấm gót khi đem so sánh với<br />*  ngoại động từ<br />- vá<br />=to patch a tyre+ vá một cái lốp<br />- dùng để vá, làm miếng vá (cho cái gì)<br />=it will patch the hole well enough+ miếng đó đủ để vá cho cái lỗ thủng<br />- ráp, nối (các mảnh, các mấu vào với nhau)<br />- hiện ra từng mảng lốm đốm, loang lổ (trên vật gì)<br />!to patch up<br />- vá víu, vá qua loa<br />- (nghĩa bóng) dàn xếp; dàn xếp qua loa, dàn xếp tạm thời (một vụ bất hoà...)</Q></N></I></F></C>'),
(87899, 'patchouli', '<C><F><I><N><Q>@patchouli /''pætʃuli:/<br />*  danh từ<br />- (thực vật học) cây hoắc hương</Q></N></I></F></C>'),
