(87946, 'path', '<C><F><I><N><Q>@path /pɑ:θ, snh pɑ:ðz/<br />*  danh từ<br />- đường mòn, đường nhỏ<br />=mountain path+ đường mòn trên núi<br />- con đường, đường đi, đường lối<br />=the path of a comes+ đường đi của sao chổi<br />=on the path of honour+ trên con đường danh vọng<br /><br />@path<br />- bước, đường đi; quỹ đạo<br />- p. of continuous group quỹ đạo trong một nhóm liên tục<br />- p. of a projectile đường đạn<br />- asymptotic p. (giải tích) đường tiệm cận<br />- closed p. đường đóng<br />- edge p. đường gấp khúc, đường cạnh<br />- free p. đường di động tự do<br />- homotopic p.s đường đi đồng luân<br />- inverse p. đường nghịch<br />- mean free p. đường tự do trung bình<br />- minimal p. đường cực tiểu<br />- product p. đường tích<br />- random p. đường đi ngẫu nhiên</Q></N></I></F></C>'),
(87947, 'path-', '<C><F><I><N><Q>@path-<br />- hình thái ghép có nghĩa là bệnh: pathogen mầm bệnh<br />- hình thái ghép có nghĩa là bệnh: pathogen mầm bệnh</Q></N></I></F></C>'),
(87948, 'path-finder', '<C><F><I><N><Q>@path-finder<br />* danh từ<br />- người mở đường, người thám hiểm<br />- người chỉ điểm, tên gián điệp<br />- &lt;qsự&gt; máy bay chỉ điểm (cho máy bay ném bom); người lái máy bay chỉ điểm</Q></N></I></F></C>'),
(87949, 'Path independence', '<C><F><I><N><Q>@Path independence<br />- (Econ) Sự độc lập về đường tiến triển; Độc lập về đường đi.<br />+ Ở nơi diễn ra sự so sánh nhằm lựa chọn một số các giải pháp, sự lựa chọn này được gọi là Độc lập về đường đi khi giải pháp được lựa chọn độc lập với một trật tự để xem xét các giải pháp này.</Q></N></I></F></C>'),
