(88073, 'pats', '<C><F><I><N><Q>@pat /pæt/<br />*  danh từ<br />- cái vỗ nhẹ, cái vỗ về; tiếng vỗ nhẹ<br />- khoanh bơ nhỏ<br />*  ngoại động từ<br />- vỗ nhẹ, vỗ về<br />=to pat someone on the back+ vỗ nhẹ vào lưng ai<br />- vỗ cho dẹt xuống<br />*  nội động từ<br />- (+ upon) vỗ nhẹ (vào)<br />!to pat oneself on the back<br />- (nghĩa bóng) tự mình khen mình<br />*  phó từ<br />- đúng lúc<br />=the answer came pat+ câu trả lời đến đúng lúc<br />- rất sẵn sàng<br />!to stand pat<br />- không đổi quân bài (đánh bài xì)<br />- (nghĩa bóng) giữ vững lập trường; bám lấy quyết định đã có<br />*  tính từ<br />- đúng lúc<br />- rất sẵn sàng</Q></N></I></F></C>'),
